var news_title = ['', '\u201c\u5730\u4e3b\u5bb6\u50bb\u513f\u5b50\u201d \u7279\u6717\u666e\u4e4b\u5b50\u4e0a\u4f20\u9009\u7968\u7167\u88ab\u5632\u7b11', '\u201c\u6743\u529b\u7684\u6e38\u620f\u201d\u5927\u7ed3\u5c40', '\u201c\u6743\u529b\u6e38\u620f\u201d\u6495\u88c2\u7f8e\u56fd\uff1f\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u5927\u9009\u7ec8\u6781\u89d2\u9010', '\u201c\u7cdf\u7cd5\u7684\u4e0d\u662f\u7f8e\u56fd\uff0c\u662f\u65e5\u672c\u5427\u2026\u2026\u201d\u7279\u6717\u666e\u8d62\u4e86\uff0c\u65e5\u672c\u7f51\u53cb\u8868\u793a\u51fa\u68ee\u68ee\u7684\u62c5\u5fe7\u3002\u3002\u3002', '3D\uff1a\u5ddd\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf \u5bf9\u4e2d\u56fd\u8001\u767e\u59d3\u6709\u5565\u5f71\u54cd\uff1f', 'CNBC\u4e13\u680f\u8bc4\u8bba\uff1a\u7279\u6717\u666e\u83b7\u80dc\u4e3a\u98ce\u9669\u6295\u8d44\u5e26\u6765\u826f\u673a', '\u5b89\u500d\u5bf9\u7279\u6717\u666e\u5f53\u9009\u8868\u793a\u60ca\u8bb6 \u8981\u5176\u52a9\u7406\u4e0b\u5468\u8bbf\u7f8e', '\u5b89\u500d\u5411\u7279\u6717\u666e\u81f4\u8d3a \u5f3a\u8c03\u7f8e\u65e5\u540c\u76df\u201c\u4e0d\u53ef\u52a8\u6447\u201d', '\u5965\u5df4\u9a6c\u6c11\u610f\u652f\u6301\u5ea6\u63a5\u8fd1\u5176\u5386\u53f2\u6700\u9ad8\u7eaa\u5f55', '\u5965\u5df4\u9a6c\u795d\u8d3a\u7279\u6717\u666e\u5f53\u9009\u603b\u7edf \u5c06\u786e\u4fdd\u6743\u529b\u5e73\u7a33\u4ea4\u63a5', '\u5965\u5df4\u9a6c\u795d\u8d3a\u7279\u6717\u666e\u80dc\u9009 \u9080\u5176\u8d74\u767d\u5bab\u5546\u8ba8\u8fc7\u6e21\u4e8b\u5b9c', '\u5965\u6717\u5fb7\u8c28\u614e\u795d\u8d3a\u7279\u6717\u666e\u5f53\u9009 \u79f0\u5f00\u542f\u4e0d\u786e\u5b9a\u65f6\u671f', '\u5965\u6717\u5fb7\u8c28\u614e\u795d\u8d3a\u7279\u6717\u666e\u5f53\u9009 \u79f0\u5f00\u542f\u4e0d\u786e\u5b9a\u65f6\u671f', '\u5df4\u52d2\u65af\u5766\u603b\u7edf\u5e9c\u547c\u5401\u7279\u6717\u666e\u63a8\u8fdb\u5df4\u52d2\u65af\u5766\u5efa\u56fd', '\u5ddd\u666e\u4ece\u517c\u804c\u505a\u5230\u603b\u7edf \u4e0a\u4f4d\u4e0d\u6613\u4e14\u505a\u4e14\u73cd\u60dc', '\u5ddd\u666e\u5f53\u9009\u603b\u7edf \u8521\u4f9d\u6797\u5f20\u53ec\u5fe0\u8fd9\u4e9b\u4eba\u65e9\u6599\u5230\u4e86', '\u5fb7\u9632\u957f\u79f0\u7279\u6717\u666e\u5f53\u9009\u4ee4\u4eba\u9707\u64bc \u6b32\u8be2\u5176\u5bf9\u5317\u7ea6\u7acb\u573a', '\u5730\u4e3b\u5bb6\u50bb\u513f\u5b50 \u7279\u6717\u666e\u4e4b\u5b50\u6652\u9009\u7968\u6d89\u8fdd\u6cd5', '\u4fc4\u603b\u7edf\u79d8\u4e66\uff1a\u4fc4\u5e0c\u671b\u7279\u6717\u666e\u6267\u653f\u671f\u95f4\u4fc4\u7f8e\u80fd\u66f4\u591a\u76f8\u4e92\u7406\u89e3', '\u4fc4\u603b\u7edf\u666e\u4eac\u81f4\u7535\u795d\u8d3a\u7279\u6717\u666e\u8d62\u5f97\u7f8e\u56fd\u5927\u9009', '\u83f2\u5f8b\u5bbe\u603b\u7edf\u675c\u7279\u5c14\u7279\u795d\u8d3a\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf', '\u83f2\u5a92\uff1a\u7279\u6717\u666e\u5728\u83f2\u5546\u4e1a\u4f19\u4f34\u88ab\u4efb\u547d\u4e3a\u5bf9\u7f8e\u7279\u4f7f', '\u679c\u7136\u4e0d\u670d\uff01\u5e0c\u62c9\u91cc\u56e2\u961f\u62d2\u7edd\u8d25\u9009\u6f14\u8bb2', '\u597d\u83b1\u575e\u4e3a\u5e0c\u62c9\u91cc\u54ed\u6ce3', '\u73af\u7403\u65f6\u62a5\uff1a\u7279\u6717\u666e\u5927\u80dc \u7f8e\u56fd\u4f20\u7edf\u653f\u6cbb\u906d\u731b\u70c8\u51b2\u51fb', '\u73af\u7403\u65f6\u62a5\u8fde\u7ebf\u7279\u6717\u666e\u7f8e\u56fd\u534e\u4eba\u5e86\u529f\u96c6\u4f1a\u8054\u7edc\u4eba', '\u91d1\u707f\u8363\uff1a\u7279\u6717\u666e\u5f53\u9009\u6216\u653e\u7eb5\u65e5\u97e9\u6269\u519b \u4e2d\u56fd\u4e0d\u7528\u6015', '\u62d2\u8c08\u5357\u6d77\u7684\u7279\u6717\u666e\uff0c\u7a76\u7adf\u662f\u4e2a\u4ec0\u4e48\u6001\u5ea6\uff1f', '\u7f57\u7389\u51e4\uff1a\u6211\u4e3a\u4ec0\u4e48\u652f\u6301\u7279\u6717\u666e', '\u9a6c\u5b66\u8005\uff1a\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf\uff0c\u4e2d\u7f8e\u5173\u7cfb\u4e0d\u4f1a\u53d1\u751f\u8d28\u53d8', '\u9a6c\u603b\u7406\u795d\u8d3a\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf \u671f\u671b\u4e24\u56fd\u7ee7\u7eed\u5408\u4f5c', '\u5a92\u4f53\uff1a\u7279\u6717\u666e\u80dc\u9009\u4e3a\u4e16\u754c\u7ecf\u6d4e\u7f69\u4e0a\u4e00\u5c42\u96fe\u973e', '\u5a92\u4f53\uff1a\u7279\u6717\u666e\u5df2\u505a\u597d\u4e24\u624b\u51c6\u5907 \u62df\u597d\u8d25\u9009\u6f14\u8bf4', '\u5a92\u4f53\u79f0\u7279\u6717\u666e\u80dc\u9009\u51e0\u7387\u5347\u81f395% \u62ff\u4e0b\u591a\u4e2a\u5173\u952e\u5dde', '\u7f8e\u56fd\u5927\u9009\u7279\u6717\u666e137:104\u9886\u5148 \u6447\u6446\u5dde\u6218\u51b5\u7126\u707c', '\u7f8e\u56fd\u5927\u9009\u7279\u6717\u666e\u4e00\u8def\u9886\u5148 \u52a0\u62ff\u5927\u79fb\u6c11\u5c40\u5b98\u7f51\u5d29\u6e83', '\u7f8e\u56fd\u5927\u9009\u73b0\u573a \u5e0c\u62c9\u91cc\u652f\u6301\u8005\u76f8\u62e5\u800c\u6ce3(\u56fe)', '\u7f8e\u56fd\u5f53\u9009\u603b\u7edf\u7279\u6717\u666e\u4e3b\u8981\u653f\u7b56\u4e3b\u5f20\u662f\u5565', '\u7f8e\u56fd\u4e24\u5973\u5b50\u6295\u7968\u7ad9\u6297\u8bae\u7279\u6717\u666e \u534a\u88f8\u906d\u902e\u6355(\u56fe)', '\u7f8e\u56fd\u6c11\u4f17\u5982\u4f55\u8bc4\u4ef7\u7279\u6717\u666e\u80dc\u9009 \u4e2d\u7f8e\u5173\u7cfb\u8d70\u5411\u5982\u4f55', '\u7f8e\u56fd\u540d\u5634\u79f0\u5c0f\u5e03\u4ec0\u628a\u9009\u7968\u6295\u7ed9\u5e0c\u62c9\u91cc \u53d1\u8a00\u4eba\u8f9f\u8c23', '\u7f8e\u56fd\u4e09\u5dde\u7387\u5148\u5f00\u7968 \u7279\u6717\u666e19\uff1a3\u6682\u65f6\u9886\u5148\u5e0c\u62c9\u91cc', '\u7f8e\u56fd\u603b\u7edf\u5927\u9009\u6700\u540e\u5bf9\u51b3 \u5e0c\u62c9\u91cc\u3001\u7279\u6717\u666e\u5747\u6709\u673a\u4f1a\u521b\u5386\u53f2', '\u7f8e\u5a92:\u7279\u6717\u666e\u51fb\u8d25\u5e0c\u62c9\u91cc\u8d62\u5f97\u7f8e\u56fd\u5927\u9009', '\u7f8e\u5a92\u6279\u7279\u6717\u666e\u80dc\u9009\u662f\u201c\u5669\u68a6\u201d \u79f0\u7f8e\u6c11\u4f17\u8df3\u8fdb\u6df1\u6e0a', '\u540d\u5634\u79f0\u5c0f\u5e03\u4ec0\u6295\u7968\u7ed9\u5e0c\u62c9\u91cc \u53d1\u8a00\u4eba\u8f9f\u8c23:\u7559\u767d', '\u9ed8\u514b\u5c14\u5411\u7279\u6717\u666e\u81f4\u8d3a\u4fe1 \u7f8e\u5a92\uff1a\u66f4\u50cf\u8b66\u544a\u4fe1', '\u7ebd\u7ea6\u65f6\u62a5\uff1a\u7279\u6717\u666e\u80dc\u9009\u51e0\u7387\u8d85\u8fc780%', '\u7ebd\u7ea6\u65f6\u62a5\uff1a\u5e0c\u62c9\u91cc\u5927\u9009\u83b7\u80dc\u7387\u964d\u4f4e', '\u5973\u4ebaor\u5546\u4eba \u7f8e\u4e0b\u5c4a\u603b\u7edf\u4eca\u65e5\u63ed\u6653\uff1f', '\u504f\u8fdc\u5c0f\u9547\u6295\u4e0b\u7f8e\u5927\u9009\u7b2c\u4e00\u7968', '\u666e\u4eac\u795d\u8d3a\u7279\u6717\u666e\u5f53\u9009\u603b\u7edf \u79f0\u613f\u4e0e\u5176\u5171\u540c\u5f00\u5c55\u5de5\u4f5c', '\u65e5\u672c\u653f\u5e9c\u592e\u884c\u7d27\u6025\u5f00\u4f1a\u5e94\u5bf9\u7279\u6717\u666e\u80dc\u9009', '\u65e5\u5a92\uff1a\u7279\u6717\u666e\u5f53\u9009\u7f8e\u603b\u7edf\u5c06\u5168\u9762\u5f71\u54cd\u65e5\u672c\u5b89\u4fdd\u548c\u7ecf\u6d4e', '\u5b9e\u65f6\u64ad\u62a5\uff1a\u5e0c\u62c9\u91cc\u8d62\u4e0b\u5f17\u5409\u5c3c\u4e9a\u5dde 122\uff1a168\u6682\u843d\u540e\u7279\u6717\u666e', '\u53f0\u5a92\uff1a\u65e0\u8bba\u7279\u6717\u666e\u8f93\u8d62 \u9009\u540e\u7684\u5171\u548c\u515a\u6050\u5c06\u5206\u88c2', '\u7279\u6717\u666e\uff1a\u4ece\u53c2\u52a0\u771f\u4eba\u79c0\u7684\u5730\u4ea7\u5927\u4ea8\u5230\u7f8e\u56fd\u603b\u7edf', '\u7279\u6717\u666e\uff1a\u6295\u7968\u7cfb\u7edf\u53d7\u4eba\u4e3a\u64cd\u63a7', '\u7279\u6717\u666e\uff1a\u5c0f\u5e03\u4ec0\u4e0d\u7ed9\u6211\u6295\u7968\u7684\u51b3\u5b9a\u4ee4\u4eba\u96be\u8fc7', '\u7279\u6717\u666e\u79f0\u5c06\u6210\u4e3a\u201c\u6240\u6709\u7f8e\u56fd\u4eba\u7684\u603b\u7edf\u201d', '\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf \u5206\u6790\u79f0\u4e2d\u7f8e\u7ecf\u8d38\u5b58\u4e0d\u786e\u5b9a\u6027', '\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf \u5e02\u573a\u907f\u9669\u60c5\u7eea\u660e\u663e', '\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf \u5e0c\u62c9\u91cc\u4eca\u665a\u4e0d\u53d1\u8868\u8d25\u9009\u6f14\u8bf4', '\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf \u4e13\u5bb6\u79f0\u5176\u7ecf\u6d4e\u653f\u7b56\u6216\u53d8\u6e29\u548c', '\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf\uff0c\u5168\u7403\u5a92\u4f53\u600e\u4e48\u8bf4\uff1f', '\u7279\u6717\u666e\u987e\u95ee\uff1a\u7279\u6717\u666e\u5728\u516c\u5bd3\u4e2d\u559d\u53ef\u4e50\u770b\u7ed3\u679c', '\u7279\u6717\u666e\u51fb\u8d25\u5e0c\u62c9\u91cc\u8d62\u5f97\u7f8e\u56fd\u5927\u9009', '\u7279\u6717\u666e\u7ade\u9009\u56e2\u961f\u603b\u5e72\u4e8b\u5eb7\u7ef4\u4e0a\u4f20\u7279\u6717\u666e\u5fae\u7b11\u7167\u7247', '\u7279\u6717\u666e\u53ef\u80fd\u8d62\u5f97\u5927\u9009 \u65e5\u672c\u8d22\u52a1\u7701\u53ec\u5f00\u7d27\u6025\u4f1a\u8bae', '\u7279\u6717\u666e\u80dc\u9009\u8bb2\u8bdd\u9010\u4e00\u611f\u8c22\u652f\u6301\u8005\uff1a\u4f60\u4eec\u5c06\u4ee5\u6211\u4e3a\u50b2', '\u7279\u6717\u666e\u7279\u522b\u5173\u6ce8NBA \u66fe\u4e3a\u6797\u4e66\u8c6a\u75af\u72c2\u8868\u73b0\u70b9\u8d5e\u52a9\u5a01', '\u7279\u6717\u666e\u900f\u9732\u5df2\u63a5\u5230\u5e0c\u62c9\u91cc\u7684\u795d\u8d3a\u7535\u8bdd', '\u7279\u6717\u666e\u4e3a\u4f55\u80fd\u9006\u8f6c\u6c11\u8c03\u9ad8\u8c03\u5f53\u9009\uff1f', '\u7279\u6717\u666e\u5ba3\u5e03\u8d62\u5f972016\u7f8e\u56fd\u603b\u7edf\u5927\u9009', '\u7279\u6717\u666e\u6f14\u8bb2\u81f4\u8c22\u5e0c\u62c9\u91cc\uff1a\u611f\u8c22\u5979\u6240\u505a\u7684\u5de5\u4f5c', '\u7279\u6717\u666e\u610f\u5916\u80dc\u9009 \u53ea\u6709\u8fd9\u4e24\u5927\u7406\u7531', '\u7279\u6717\u666e\u8d62\u5f972016\u5e74\u7f8e\u56fd\u603b\u7edf\u5927\u9009', '\u7279\u6717\u666e\u8d62\u5f972016\u5e74\u7f8e\u56fd\u603b\u7edf\u9009\u4e3e', '\u7279\u6717\u666e\u8d62\u5f97\u5927\u9009\u6982\u7387\u4e0a\u5347 \u9ec4\u91d1\u4ef7\u683c\u51b2\u78341300\u7f8e\u5143', '\u7279\u6717\u666e\u8d62\u5f97\u7f8e\u56fd\u5927\u9009\u6982\u7387\u5347\u81f350%  \u5168\u7403\u5e02\u573a\u95ea\u5d29', '\u7279\u6717\u666e\u8d62\u5f97\u7f8e\u56fd\u5927\u9009\u5168\u7403\u91d1\u878d\u5e02\u573a\u9707\u8361\u660e\u663e', '\u7279\u6717\u666e\u8d62\u5f97\u897f\u5f17\u5409\u5c3c\u4e9a\u5dde \u6682\u65f624\uff1a3\u9886\u5148', '\u7279\u6717\u666e\u5728\u83f2\u5546\u4e1a\u4f19\u4f34\u88ab\u4efb\u547d\u4e3a\u83f2\u5f8b\u5bbe\u5bf9\u7f8e\u7279\u4f7f', '\u7279\u6717\u666e\u5c55\u73b0\u81ea\u4fe1\uff1a\u79f0\u5c06\u4f1a\u5728\u5f88\u591a\u5dde\u80dc\u51fa \u4f46\u4e5f\u7559\u6709\u9057\u61be', '\u7279\u6717\u666e\u8fd9\u4f4d\u201c\u4e09\u65e0\u603b\u7edf\u201d\u5c06\u600e\u6837\u6cbb\u7406\u7f8e\u56fd', '\u6295\u8d44\u8005\u8c28\u614e\u9884\u671f\u5e0c\u62c9\u91cc\u5c06\u80dc\u9009 \u7f8e\u80a1\u6536\u76d8\u4e0a\u626c', '\u56fe\u89e3\uff1a\u7279\u6717\u666e\u5f53\u9009\u54ea\u51e0\u7c7b\u4eba\u7fa4\u5c06\u53d7\u5230\u5f71\u54cd\uff1f', '\u5916\u5a92\uff1a\u514b\u6797\u987f\u4e0d\u4f1a\u5728\u5e0c\u62c9\u91cc\u9009\u4e3e\u4e4b\u591c\u6f14\u8bb2', '\u5916\u5a92\uff1a\u7279\u6717\u666e\u83b7\u80dc\u524d\u666f\u5927 \u4e9a\u6d32\u80a1\u5e02\u8d70\u4f4e', '\u65e0\u7f18\u767d\u5bab  \u201c\u56de\u5bb6\u7761\u89c9\u5427\u201d', '\u5434\u5e7c\u73c9\uff1a\u7279\u6717\u666e\u5f53\u9009\u5e76\u65e0\u663e\u793a\u7f8e\u56fd\u6587\u5316\u7684\u4f18\u8d8a', '\u5e0c\u62c9\u91cc\uff1a\u4ee5\u201c\u6700\u8c26\u5351\u5fc3\u60c5\u201d\u6295\u7968\u7ed9\u81ea\u5df1 \u6211\u5f88\u5f00\u5fc3', '\u5e0c\u62c9\u91cc\u79f0\u4e0d\u7ba1\u7ed3\u679c\u5982\u4f55\u90fd\u8981\u611f\u8c22\u5176\u56e2\u961f', '\u5e0c\u62c9\u91cc\u627f\u8ba4\u5728\u603b\u7edf\u9009\u4e3e\u4e2d\u5931\u8d25', '\u5e0c\u62c9\u91cc\u76ee\u524d\u4e0d\u627f\u8ba4\u8d25\u9009 \u53ef\u80fd\u8981\u6c42\u91cd\u65b0\u8ba1\u7968', '\u5e0c\u62c9\u91cc\u53d6\u6d88\u80dc\u9009\u70df\u82b1\u79c0', '\u5e0c\u62c9\u91cc\u82e5\u80dc\u9009\uff0c\u4f1a\u62ff\u4ec0\u4e48\u904f\u5236\u4e2d\u56fd\uff1f', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u9f50\u805a\u66fc\u54c8\u987f \u7ebd\u7ea65000\u8b66\u529b\u6212\u5907', '\u5e0c\u62c9\u91cc\u5df2\u81f4\u7535\u7279\u6717\u666e\u627f\u8ba4\u5728\u7f8e\u56fd\u5927\u9009\u4e2d\u8d25\u9009', '\u5e0c\u62c9\u91cc\u652f\u6301\u8005\uff1a\u4e0d\u660e\u767d\u8fd9\u4e2a\u56fd\u5bb6\u53d1\u751f\u4e86\u4ec0\u4e48', '\u4e60\u8fd1\u5e73\u81f4\u7535\u795d\u8d3a\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf', '\u5c0f\u5e03\u4ec0\u672a\u6295\u7968\u7ed9\u7279\u6717\u666e\u548c\u5e0c\u62c9\u91cc \u7279\u6717\u666e\u79f0\u96be\u8fc7', '\u82f1\u56fd\u9996\u76f8\u7279\u96f7\u838e-\u6885\u795d\u8d3a\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf', '\u82f1\u5a92\uff1a\u7279\u6717\u666e\u80dc\u9009\u76f8\u5f53\u4e8e\u7f8e\u56fd\u7248\u201c\u8131\u6b27\u516c\u6295\u201d', '\u4e13\u5bb6\uff1a\u7279\u6717\u666e\u5f53\u9009\u5c06\u6269\u5927\u4e2d\u56fd\u5f71\u54cd\u529b \u5e26\u6765\u66f4\u591a\u52a8\u8361', '\u4e13\u5bb6\uff1a\u7279\u6717\u666e\u5f53\u9009\u7f8e\u603b\u7edf\u65e0\u788d\u5168\u7403\u6c14\u5019\u6cbb\u7406\u201c\u5927\u6c14\u5019\u201d', '\u201c\u5927\u9009\u65e5\u201d\u6765\u4e86\uff01\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u8fce\u7ec8\u6781\u5927\u8003', '2016\u7f8e\u56fd\u5927\u9009\u7b2c\u4e00\u5904\u6295\u7968\u7ed3\u675f \u5e0c\u62c9\u91cc\u9ad8\u4e8e\u7279\u6717\u666e', 'FBI\u518d\u5ea6\u5efa\u8bae\u4e0d\u8d77\u8bc9\u5e0c\u62c9\u91cc', '\u5927\u9009\u6295\u7968\u5728\u5373 \u5e0c\u62c9\u91cc\u548c\u7279\u6717\u666e\u4e3e\u884c\u6700\u540e\u7ade\u9009\u96c6\u4f1a', '\u6cd5\u56fd\u7cfb\u8c31\u5b66\u5bb6\uff1a\u5e0c\u62c9\u91cc\u548c\u5965\u6717\u5fb7\u662f\u8fdc\u4eb2', '\u6e2f\u5a92:\u7279\u6717\u666e\u4e9a\u6d32\u652f\u6301\u529b\u8c03\u67e5 \u97e9\u6700\u4f4e\u4e2d\u56fd\u5360\u699c\u9996', '\u514b\u6797\u987f\u548c\u7279\u6717\u666e\u7a76\u7adf\u4e89\u4ec0\u4e48\uff1f', '\u6ca1\u4eba\u6307\u671b\u5e0c\u62c9\u91cc\u80fd\u5e26\u9886\u7f8e\u56fd\u518d\u6b21\u4f1f\u5927', '\u7f8e\u5927\u9009\u534e\u5c14\u8857\u201c\u62bc\u5b9d\u201d\u5e0c\u62c9\u91cc \u7f8e\u80a1\u5927\u5e45\u56de\u6696', '\u7f8e\u5927\u9009\u5f00\u59cb\u6295\u7968 \u5e0c\u62c9\u91cc\u5728\u9996\u4e2a\u5f00\u7968\u5c0f\u95474\u6bd42\u80dc', '\u7f8e\u5927\u9009\u6c11\u8c03:\u591a\u6570\u4eba\u8ba4\u4e3a\u7f8e\u5a92\u504f\u8892\u5e0c\u62c9\u91cc', '\u7f8e\u5927\u9009\u9996\u6279\u6295\u7968\u7ad9\u9646\u7eed\u5f00\u653e \u7279\u6717\u666e32\uff1a25\u9886\u5148', '\u7f8e\u4e13\u5bb6\u7528\u4e2d\u6587\u4e3a\u603b\u7edf\u5019\u9009\u4eba\u201c\u6d4b\u5b57\u201d\uff1a\u7279\u6717\u666eVS\u5e0c\u62c9\u91cc \u5192\u72afVS\u5e0c\u671b', '\u4eba\u5bb6 \u9003\u8fc7\u4e00\u52ab', '\u5982\u679c\u5e0c\u62c9\u91cc\u80dc\u9009 \u8be5\u548b\u79f0\u547c\u514b\u6797\u987f\uff1f', '\u4e16\u754c\u5404\u5730\u201c\u795e\u517d\u201d\u9884\u6d4b\u7f8e\u56fd\u5927\u9009\uff1a\u7279\u6717\u666e\u8d62\u547c\u58f0\u9ad8', '\u7279\u6717\u666e\u9635\u8425\u8bbd\u5e0c\u62c9\u91cc\u66fe\u8ba9\u5973\u4f63\u590d\u5370\u673a\u5bc6\u8d44\u6599', '\u6295\u7968\u524d\u6700\u540e\u4e00\u5929 \u5e0c\u62c9\u91cc\u548c\u7279\u6717\u666e\u201c\u8c41\u51fa\u8001\u547d\u201d', '\u5916\u5a92:\u7279\u6717\u666e\u524d\u987e\u95ee\u6295\u8bc9\u5e0c\u62c9\u91cc\u56e2\u961f\u8fdd\u53cd\u9009\u4e3e\u89c4\u5219', '\u5e0c\u62c9\u91cc\u524d\u5f80\u7ebd\u7ea6\u6295\u7968\u7ad9\u4e3a\u81ea\u5df1\u6295\u7968 \u4e08\u592b\u966a\u540c', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u7ebd\u7ea6\u5e86\u5927\u9009\u6295\u7968\u65e5 \u8b66\u65b9\u914d\u5907\u91cd\u6b66\u5668', '\u5e0c\u62c9\u91cc\u4e0e\u514b\u6797\u987f\u73b0\u8eab\u6295\u7968\u7ad9 \u5927\u58f0\u9ad8\u558a\uff1a\u6211\u975e\u5e38\u5feb\u4e50(\u56fe)', '\u8fd9\u9009\u60c5\u600e\u4e00\u4e2a\u201c\u620f\u201d\u5b57\u4e86\u5f97', '\u4e13\u5bb6\u9884\u6d4b\u5e0c\u62c9\u91cc\u5f97293\u5f20\u9009\u4e3e\u4eba\u7968 \u7279\u6717\u666e\u83b7\u80dc\u96be', '\u81ea\u5df1 \u67aa\u51fb\u60ca\u9b42', '\u6700\u5927\u80c6\u7684\u9884\u6d4b\uff1a\u5e0c\u62c9\u91cc\u9886\u51485%\u51fb\u8d25\u7279\u6717\u666e', '\u6700\u540e\u4e00\u640f\u5927\u6218\u201c\u6447\u6446\u5dde\u201d', '\u6700\u65b0\u6c11\u8c03\uff1a\u5e0c\u62c9\u91cc\u80dc\u7387\u8fbe\u4e5d\u6210', '\u201c\u7279\u6717\u666e\u5a01\u80c1\u201d\u5c06\u4e3b\u5bfc\u6700\u65b0\u4e00\u5c4a\u56fd\u9645\u6c14\u5019\u53d8\u5316\u5927\u4f1a', 'FBI\u79f0\u4e0d\u4f1a\u5c31\u201c\u90ae\u4ef6\u95e8\u201d\u8d77\u8bc9\u5e0c\u62c9\u91cc', 'FBI\u653e\u8fc7\u5e0c\u62c9\u91cc\uff0c\u7279\u6717\u666e\u65e0\u5948\u5927\u52bf\u5df2\u53bb', 'FBI\u7ed3\u675f\u5bf9\u5e0c\u62c9\u91cc\u90ae\u4ef6\u95e8\u8c03\u67e5 \u7279\u6717\u666e\u56e2\u961f\u56de\u5e94', 'FBI\u51b3\u5b9a\u4e0d\u8d77\u8bc9\u5e0c\u62c9\u91cc \u7279\u6717\u666e\u7ade\u9009\u603b\u90e8:\u8c03\u67e5\u8349\u7387', '\u5927\u9009\u524d\u5915\u7f8e\u5a92\u516c\u5e03\u6700\u7ec8\u6c11\u8c03\uff1a\u5e0c\u62c9\u91cc\u9886\u51484%(\u56fe)', '\u5927\u9009\u6295\u7968\u5012\u657048\u5c0f\u65f6\uff1a\u7279\u6717\u666e\u5355\u65e5\u201c\u8dd1\u201d\u4e94\u5dde', '\u6e2f\u5a92\uff1a\u7279\u6717\u666e\u5728\u4e9a\u6d32\u516d\u56fd\u652f\u6301\u7387\u4e2d\u56fd\u6700\u9ad8', '\u63a5\u8fde\u7206\u6599\u5e0c\u62c9\u91cc \u7ef4\u57fa\u89e3\u5bc6\u4e3a\u4f55\u201c\u9752\u7750\u201d\u7f8e\u56fd\u5927\u9009', '\u5170\u5fb7\u516c\u53f8\u6700\u65b0\u6c11\u8c03\uff1a\u5e0c\u62c9\u91cc\u83b7\u80dc\u6982\u7387\u5927\u5e45\u9886\u5148', '\u7f8e\u5927\u9009\u6700\u540e\u51b2\u523a \u7279\u6717\u666e\u5e0c\u62c9\u91cc\u8d74\u6447\u6446\u5dde\u62c9\u7968', '\u7f8e\u7ade\u9009\u7eaa\u5ff5\u54c1\u4e1a\u8005\u901a\u8fc7\u9500\u552e\u60c5\u51b5\u9884\u6d4b\u5e0c\u62c9\u91cc\u4f1a\u80dc\u9009', '\u58a8\u897f\u54e5\u4eba\u7838\u7279\u6717\u666e\u50cf \u5e0c\u5180\u5176\u5728\u7f8e\u603b\u7edf\u5927\u9009\u4e2d\u843d\u8d25', '\u793e\u8bc4\uff1a\u5e0c\u62c9\u91cc\u4e0d\u4f1a\u5168\u8d62\uff0c\u7279\u6717\u666e\u4e0d\u4f1a\u5168\u8f93', '\u4e16\u754c\u65e5\u62a5\uff1a\u5e0c\u62c9\u91cc\u80dc\u8d25\u5173\u952e \u5b88\u4f4f\u516d\u5dde\u201c\u9632\u706b\u5899\u201d', '\u7279\u6717\u666e\uff1a\u5e0c\u62c9\u91cc\u53d7\u5230\u201c\u6b3a\u8bc8\u4f53\u7cfb\u201d\u7684\u5e87\u62a4', '\u7279\u6717\u666e\u88ab\u7279\u5de5\u7d27\u6025\u9001\u4e0b\u53f0', '\u7279\u6717\u666e\u6f84\u6e05\u53cd\u4e2d\u7acb\u573a\uff1a\u4e0d\u8d23\u5907\u4e2d\u56fd \u662f\u7f8e\u653f\u5e9c\u611a\u8822', '\u7279\u6717\u666e\u56de\u5e94FBI\u4e0d\u8d77\u8bc9\u5e0c\u62c9\u91cc\uff1a\u5979\u53d7\u5230\u5e87\u62a4', '\u7279\u6717\u666e\u6311\u8d77\u201c\u9634\u8c0b\u8bba\u201d \u79f0\u9009\u4e3e\u906d\u4e0d\u6b63\u5f53\u64cd\u7eb5', '\u7279\u6717\u666e\u9047\u523a\u6740\u7cfb\u865a\u60ca\u4e00\u573a \u5f15\u9a9a\u4e71\u7537\u5b50\u5e76\u672a\u643a\u67aa', '\u7ef4\u57fa\u89e3\u5bc6\uff1aCNN\u540c\u6c11\u4e3b\u515a\u534f\u5546\u91c7\u8bbf\u7279\u6717\u666e\u7684\u95ee\u9898', '\u5e0c\u62c9\u91cc\u83b7\u5229\u597d\u6d88\u606f\uff1aFBI\u7ef4\u6301\u201c\u7535\u90ae\u95e8\u201d\u8c03\u67e5\u7ed3\u8bba', '\u5e0c\u62c9\u91cc\u7ade\u9009\u96c6\u4f1a\u4e0a\u4e00\u6f14\u8bb2\u4eba\u4e34\u65f6\u201c\u53d8\u8282\u201d \u73b0\u573a\u4eba\u7fa4\u6b22\u547c', '\u82f1\u56fd\u7bdd\u706b\u8282\u3000\u7279\u6717\u666e\u6700\u62a2\u955c', '\u6885\u62c9\u5c3c\u5a05\u4e3a\u592b\u52a9\u9009', '\u7f8e\u56fd\u5927\u9009\u51b2\u523a\u9636\u6bb5\u9009\u60c5\u80f6\u7740 \u5e0c\u62c9\u91cc\u4f18\u52bf\u660e\u663e\u7f29\u5c0f', '\u7f8e\u56fd\u5927\u9009\u524d\u6700\u540e\u4e00\u4e2a\u5468\u672b \u5e0c\u62c9\u91cc\u55d3\u97f3\u5636\u54d1\u5fd9\u62c9\u7968', '\u7f8e\u56fd\u5168\u56fd\u5927\u9009\u6295\u7968\u5728\u5373 \u5e0c\u62c9\u91cc\u7968\u4ed3\u9632\u706b\u5899\u6050\u5931\u5b88', '\u7f8e\u5a92\uff1a\u5e0c\u62c9\u91cc\u66fe\u7ed9\u5973\u513f\u8f6c\u53d1\u7f8e\u56fd\u56fd\u52a1\u9662\u673a\u5bc6\u90ae\u4ef6', '\u7279\u6717\u666e\u59bb\u5b50\u88ab\u66dd\u66fe\u975e\u6cd5\u201c\u6253\u9ed1\u5de5\u201d \u5411\u516c\u4f17\u8bf4\u8c0e', '\u7279\u6717\u666e\u6f14\u8bb2\u73b0\u573a\u53d1\u751f\u9a9a\u4e71 \u88ab\u7279\u5de5\u7d27\u6025\u5e26\u4e0b\u8bb2\u53f0', '\u7279\u6717\u666e\u4e4b\u59bb\uff1a\u82e5\u6210\u7b2c\u4e00\u592b\u4eba\u5c06\u51c0\u5316\u7f51\u7edc\u7528\u8bed', '\u5434\u5f66\u7956\u6652\u9009\u7968\u79f0\u6295\u5e0c\u62c9\u91cc\uff1a\u7279\u6717\u666e\u8ba8\u538c\u4e2d\u56fd', 'FBI\u6b63\u5728\u8c03\u67e5\u7f8e\u56fd\u6c11\u4e3b\u515a\u201c\u5047\u6587\u4ef6\u201d', '\u7ef4\u57fa\u89e3\u5bc6\u963f\u6851\u5947:\u5e0c\u62c9\u91cc\u662f\u5229\u6bd4\u4e9a\u5206\u88c2\u7684\u5173\u952e\u4eba\u7269', '\u5e0c\u62c9\u91cc\u56fd\u52a1\u537f\u4efb\u5185 \u514b\u6797\u987f\u57fa\u91d1\u4f1a\u66fe\u6536\u5361\u5854\u5c14\u767e\u4e07\u7f8e\u5143', '\u5171\u548c\u515a\u5370\u5ea6\u6559\u7ec4\u7ec7\u62a8\u51fb\u5e0c\u62c9\u91cc\u63a5\u53d7\u6781\u7aef\u7ec4\u7ec7\u6350\u6b3e', '\u7f8e\u56fd\u4e54\u6cbb\u4e9a\u6c11\u5175\u8bad\u7ec3\uff1a\u5e0c\u62c9\u91cc\u5f53\u9009\u5c31\u8fdb\u519b\u534e\u76db\u987f', '\u7f8e\u56fd\u603b\u7edf\u5927\u9009\u5012\u65705\u5929\uff1a\u5e0c\u62c9\u91cc\u9886\u5148\u4f18\u52bf\u7f29\u5c0f', '\u6c11\u8c03\uff1a\u66fe\u503e\u5411\u5e0c\u62c9\u91cc\u201c\u6447\u6446\u5dde\u201d\u51fa\u73b0\u4e0e\u7279\u6717\u666e\u4e0d\u5206\u80dc\u8d1f\u573a\u9762', '\u7279\u6717\u666e\u59bb\u5b50\u9996\u6b21\u5355\u72ec\u53d1\u8868\u8bb2\u8bdd \u79f0\u53cd\u5bf9\u7f51\u7edc\u6b3a\u51cc', '\u5e0c\u62c9\u91cc\u518d\u9677\u201c\u7535\u90ae\u95e8\u201d \u7279\u6717\u666e\u8c28\u8a00\u4ee5\u5b88\u597d\u5c40\u9762', '\u5e0c\u62c9\u91cc\u5728\u6447\u6446\u5dde\u652f\u6301\u7387\u4e0b\u6ed1 \u6c11\u4e3b\u515a\u652f\u6301\u8005\u4eec\u7d27\u5f20', '\u6447\u6446\uff1f\u66fe\u9884\u6d4b\u5e0c\u62c9\u91cc\u83b7\u80dc\u300a\u534e\u76db\u987f\u90ae\u62a5\u300b\uff1a\u7279\u6717\u666e\u4e5f\u53ef\u80fd\u8d62', '\u201c\u7535\u90ae\u95e8\u201d\u6253\u51fb\u5e0c\u62c9\u91cc\u9009\u60c5 \u6025\u8bf7\u5965\u5df4\u9a6c\u52a9\u9635', 'FBI\u91cd\u542f\u5e0c\u62c9\u91cc\u201c\u90ae\u4ef6\u95e8\u201d\u8c03\u67e5\uff0c\u5965\u5df4\u9a6c\u4e3a\u5565\u770b\u4e0d\u4e0b\u53bb\u4e86\uff1f', '\u5965\u5df4\u9a6c\u5c31\u91cd\u542f\u5e0c\u62c9\u91cc\u90ae\u4ef6\u95e8\u8c03\u67e5\u8c34\u8d23FBI\u5c40\u957f', '\u5965\u5df4\u9a6c\u633a\u5e0c\u62c9\u91cc\u5411\u9009\u6c11\u558a\u8bdd:\u56fd\u5bb6\u547d\u8fd0\u5728\u4f60\u4eec\u624b\u4e2d', '\u4ece\u5e0c\u62c9\u91cc\u548c\u6734\u747e\u60e0\u770b\u5973\u6027\u4ece\u653f\u4e4b\u957f\u77ed', '\u6297\u8bae\u8005\u558a\u201c\u514b\u6797\u987f\u662f\u5f3a\u5978\u72af\u201d \u5e0c\u62c9\u91cc\u7f55\u89c1\u5927\u53d1\u813e\u6c14\u6012\u65a5', '\u7f8e\u5927\u9009\u6c11\u8c03\u5e0c\u62c9\u91cc\u652f\u6301\u738745% \u8d85\u7279\u6717\u666e6\u4e2a\u767e\u5206\u70b9', '\u7f8e\u56fd\u5927\u9009\u8d1f\u80fd\u91cf\u6ee1\u6ee1', '\u7f8e\u56fd\u4f1a\u6bd4\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u66f4\u201c\u62db\u4eba\u70e6\u201d\uff1f', '\u7f8e\u6c11\u4e3b\u515a\u652f\u6301\u8005\uff1a\u91cd\u542f\u5bf9\u5e0c\u62c9\u91cc\u8c03\u67e5\u4e0d\u4f1a\u5f71\u54cd\u5176\u652f\u6301\u7387', '\u5973\u5b50\u79f013\u5c81\u906d\u7279\u6717\u666e\u5f3a\u5978 \u53d7\u5a01\u80c1\u672a\u80fd\u51fa\u5e2d\u53d1\u5e03\u4f1a', '\u793a\u5a01\u8005\u5927\u558a\u514b\u6797\u987f\u662f\u5f3a\u5978\u72af \u5e0c\u62c9\u91cc\u5927\u53d1\u813e\u6c14\u6012\u65a5', '\u7279\u6717\u666e\u8f93\u4e86\uff0c\u7f8e\u56fd\u4f1a\u5185\u6218\u5417\uff1f', '\u4e3a\u4ec0\u4e48\u7cbe\u82f1\u9636\u5c42\u75db\u6068\u201c\u5ddd\u666e\u201d', '\u5e0c\u62c9\u91cc\u8001\u516c\u4e11\u95fb\u7ffb\u65b0', '\u5e0c\u62c9\u91cc\u90ae\u4ef6\u95e8\u5ef6\u70e7\u9009\u60c5\u751f\u53d8 \u5965\u5df4\u9a6c\u7f55\u89c1\u8c34\u8d23FBI', '\u5e0c\u62c9\u91cc\u6700\u5927\u7684\u547d\u95e8\u662f\u4e00\u4e2a\u58f0\u540d\u72fc\u85c9\u7684\u7537\u4eba', '\u82f1\u5a92\uff1a\u5e0c\u62c9\u91cc\u662f\u534e\u5c14\u8857\u94f6\u884c\u5bb6\u4eec\u201c\u66f4\u559c\u7231\u7684\u654c\u4eba\u201d', '\u6700\u65b0\u6c11\u8c03\u7279\u6717\u666e\u9886\u5148 \u5e0c\u62c9\u91cc\u6307\u8d23\u6c11\u8c03\u201c\u88ab\u64cd\u63a7\u201d', '3K\u515a\u62a5\u7eb8\u5927\u5934\u6761\u5ba3\u4f20\u7279\u6717\u666e\u7ade\u9009\u53e3\u53f7 \u7ade\u9009\u56e2\u961f\uff1a\u62d2\u7edd\uff01', 'CNN\u89e3\u96c7\u4e00\u540d\u65f6\u4e8b\u8bc4\u8bba\u5458 \u79f0\u5176\u5411\u5e0c\u62c9\u91cc\u6cc4\u6f0f\u8fa9\u9898', 'FBI\u516c\u5e032001\u5e74\u8c03\u67e5\u514b\u6797\u987f\u8d66\u514d\u91d1\u878d\u7f6a\u72af\u6587\u4ef6', '\u5965\u5df4\u9a6c\u4e3a\u5e0c\u62c9\u91cc\u62c9\u7968\uff1a\u5979\u8fdc\u6bd4\u53e6\u4e00\u4e2a\u4eba\u66f4\u6709\u8d44\u683c', '\u7f8e\u56fd\u4f17\u9662\u8bae\u957f\uff1a\u5df2\u7ecf\u63d0\u524d\u6295\u7968\u7ed9\u7279\u6717\u666e', '\u6c11\u8c03\u663e\u793a\u7279\u6717\u666e\u652f\u6301\u7387\u81ea5\u6708\u4ee5\u6765\u9996\u6b21\u53cd\u8d85\u5e0c\u62c9\u91cc', '\u5e0c\u62c9\u91cc\u540e\u9662\u8d77\u706b \u7537\u5b50\u81ea\u79f0\u514b\u6797\u987f\u79c1\u751f\u5b50\u8981\u9a8cDNA', '\u5411\u5e0c\u62c9\u91cc\u6cc4\u8fa9\u9898CNN\u8bc4\u8bba\u5458\u88ab\u89e3\u7ea6', 'CNN\u8bc4\u8bba\u5458\u6d89\u5acc\u5411\u5e0c\u62c9\u91cc\u9635\u8425\u900f\u9732\u8fa9\u8bba\u9898\u76ee', 'FBI\u518d\u8c03\u67e5\u5e0c\u62c9\u91cc\u90ae\u4ef6\u95e8 \u7279\u6717\u666e\u652f\u6301\u7387\u8fc5\u901f\u4e0a\u5347', '\u7f8e\u56fd\u5927\u9009\u6c11\u8c03\u80f6\u7740 \u5e0c\u62c9\u91cc\u9886\u5148\u7279\u6717\u666e1%', '\u7f8e\u5a92\uff1a\u7279\u6717\u666e\u8bbe\u7acb\u90ae\u7bb1\u670d\u52a1\u5668\u4e0e\u4fc4\u7f57\u65af\u79d8\u5bc6\u8054\u7cfb', '\u519c\u573a\u4e3bor\u519c\u6c11\uff1f\u5356\u623f\u53bb\u6fb3\u6d32\u517b\u725b\u7f8e\u4e0d\u7f8e', '\u4ed6\u4eec\u548c\u7279\u6717\u666e\u6709\u4ec0\u4e48\u4ec7\u4ec0\u4e48\u6028\uff1f', '\u7ef4\u57fa\u89e3\u5bc6\u62ab\u9732CNN\u5458\u5de5\u591a\u6b21\u5411\u5e0c\u62c9\u91cc\u6cc4\u9732\u521d\u9009\u8fa9\u9898', '\u5e0c\u62c9\u91cc\u4f1a\u629b\u5f03\u201c\u7b2c\u4e8c\u4e2a\u5973\u513f\u201d\u5417\uff1f', '\u5e0c\u62c9\u91cc\u4e5f\u201c\u95f9\u95fa\u871c\u201d?', '\u5e0c\u62c9\u91cc\u90ae\u4ef6\u95e8\u8c03\u67e5\u91cd\u542f FBI\u5c40\u957f\u906d\u6279\u574f\u4e86\u89c4\u77e9', '\u5e0c\u62c9\u91cc\u652f\u6301\u7387\u9886\u5148 \u7279\u6717\u666e:\u5979\u5373\u4f7f\u5f53\u9009\u4e5f\u8981\u53d7\u5ba1', 'FBI\u91cd\u542f\u5e0c\u62c9\u91cc\u7535\u90ae\u95e8\u8c03\u67e5\u906d\u8d28\u7591 \u88ab\u6307\u6545\u610f\u5ef6\u540e', '\u4e0d\u61c2\u7535\u8111\uff0c\u53ef\u80fd\u4f1a\u5bb3\u6b7b\u5e0c\u62c9\u91cc', '\u56de\u5934\u9556\uff01\u5171\u548c\u515a\u51fa\u8eabFBI\u5c40\u957f\u8d8a\u8fc7\u5965\u5df4\u9a6c\u518d\u67e5\u5e0c\u62c9\u91cc\u7535\u90ae', '\u5a92\u4f53\u79f0FBI\u5df2\u7ecf\u53d6\u5f97\u641c\u67e5\u4ee4 \u68c0\u89c6\u5e0c\u62c9\u91cc\u7535\u90ae', '\u7f8e\u56fd\u5927\u9009\u90e8\u5206\u5730\u533a\u7387\u5148\u6295\u7968 \u5e0c\u62c9\u91cc\u4ec5\u5fae\u5f31\u9886\u5148', '\u7f8e\u56fd\u5927\u9009\u5c06\u9006\u8f6c\uff1f\u9ed1\u5ba2\u7206\u4e16\u7eaa\u731b\u6599\u201c\u6253\u57ae\u201d\u5e0c\u62c9\u91cc', '\u7f8e\u56fd\u5927\u9009\u5185\u534e\u8fbe\u5dde\u63d0\u524d\u6295\u7968 \u5e0c\u62c9\u91cc\u51e0\u4e4e\u7a33\u80dc', '\u7f8e\u5a92\uff1aFBI\u5df2\u83b7\u5bf9\u5e0c\u62c9\u91cc\u90ae\u4ef6\u95e8\u8c03\u67e5\u4ee4', '\u7f8e\u5a92\u5206\u6790\u201cFBI\u518d\u8c03\u67e5\u5e0c\u62c9\u91cc\u90ae\u4ef6\u201d\uff1a\u4f60\u5e94\u77e5\u9053\u7684\u51e0\u4ef6\u4e8b', '\u4eb2\u5e0c\u62c9\u91cc\u7f8e\u5a92\u6c11\u8c03\uff1a\u7279\u6717\u666e\u4e0e\u5e0c\u62c9\u91cc\u652f\u6301\u7387\u51e0\u4e4e\u6301\u5e73', '\u5e0c\u62c9\u91cc\u201c\u90ae\u4ef6\u95e8\u201d\u5f71\u54cd\u9009\u60c5 \u6c11\u8c03\u6bd4\u7279\u6717\u666e\u4ec5\u9ad81%', '\u5e0c\u62c9\u91cc\u7684\u201c\u597d\u83b1\u575e\u670b\u53cb\u5708\u201d', '\u5e0c\u62c9\u91cc\u518d\u9677\u90ae\u4ef6\u95e8\u98ce\u6ce2 \u7279\u6717\u666e:\u6b22\u8fceFBI\u7684\u4e3e\u52a8', '\u5e0c\u62c9\u91cc\u9635\u8425\u6124\u6012\u8ba8\u4f10FBI\u5c40\u957f \u7f8e\u5b66\u8005\uff1a\u4ed6\u4f01\u56fe\u5f71\u54cd\u5927\u9009\u7ed3\u679c', 'FBI\u91cd\u542f\u201c\u90ae\u4ef6\u95e8\u201d\u4e8b\u4ef6\u8c03\u67e5 \u5e0c\u62c9\u91cc\u5927\u9009\u60ac\u4e86\uff1f', 'FBI\u91cd\u542f\u201c\u90ae\u4ef6\u95e8\u201d\u8c03\u67e5 \u6216\u6210\u4e3a\u5e0c\u62c9\u91cc\u7ade\u9009\u969c\u788d', 'FBI\u91cd\u542f\u201c\u90ae\u4ef6\u95e8\u201d\u8c03\u67e5\u5e0c\u62c9\u91cc\u9009\u60c5\u8981\u9006\u8f6c\uff1f', 'FBI\u91cd\u542f\u5e0c\u62c9\u91cc\u201c\u90ae\u4ef6\u95e8\u201d\u8c03\u67e5', '\u7279\u6717\u666e\u5728\u5e0c\u62c9\u91cc\u88ab\u8c03\u67e5\u540e\u8ffd\u52a01000\u4e07\u7ade\u9009\u8d44\u91d1', '\u5e0c\u62c9\u91cc\u56de\u5e94FBI\u91cd\u542f\u201c\u90ae\u4ef6\u95e8\u201d\u8c03\u67e5\uff1a\u6df1\u611f\u4e0d\u5b89', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u201c\u6bd4\u4e11\u95fb\u201d', '\u5e0c\u62c9\u91cc\u65b0\u9677\u201c\u95fa\u871c\u95e8\u201d\u7f8e\u56fd\u9009\u6c11\u518d\u201c\u5206\u795e\u201d', '\u5e0c\u62c9\u91cc\u9009\u60c5\u4f1a\u5426\u9006\u8f6c\uff1fFBI\u518d\u67e5\u201c\u90ae\u4ef6\u95e8\u201d', '\u7ade\u9009\u8d44\u91d1\u591a \u5e0c\u62c9\u91cc\u786c\u6c14', '\u7f8e\u56fdFBI\u91cd\u542f\u5bf9\u5e0c\u62c9\u91cc\u201c\u90ae\u4ef6\u95e8\u201d\u8c03\u67e5', '\u7279\u6717\u666e\u201c\u7c89\u4e1d\u201d\u8d85\u516d\u6210\u6216\u7591\u5927\u9009\u7ed3\u679c', '\u7279\u6717\u666e\u5982\u679c\u8f93\u4e86\uff0c\u7f8e\u56fd\u4f1a\u5185\u6218\u5417\uff1f', '\u5e0c\u62c9\u91cc\u201c\u90ae\u4ef6\u95e8\u201d\u518d\u8d77\u6ce2\u6f9c \u79f0\u76f8\u4fe1\u7ed3\u8bba\u4e0d\u4f1a\u6539\u53d8', '\u5e0c\u62c9\u91cc\u56de\u5e94FBI\u91cd\u542f\u90ae\u4ef6\u95e8\u8c03\u67e5\uff1a\u6211\u6709\u4fe1\u5fc3', '\u5e0c\u62c9\u91cc\u7ade\u9009\u8d44\u91d1\u4e3a\u7279\u6717\u666e\u4e24\u500d\u591a \u9ad8\u8fbe1.53\u4ebf\u7f8e\u5143', '\u4fc4\u5a92:\u7f8e\u6c11\u8c03\u79f0\u7f8e\u56fd\u4eba\u8ba4\u4e3a\u5e0c\u62c9\u91cc\u9690\u7792\u66f4\u591a\u4fe1\u606f', '\u7f8e\u5a92:\u5e0c\u62c9\u91cc\u82e5\u5f53\u9009\u603b\u7edf \u5c06\u542f\u7528\u62dc\u767b\u62c5\u4efb\u56fd\u52a1\u537f', '\u7f8e\u5a92:\u5e0c\u62c9\u91cc\u82e5\u8d62\u5f97\u5927\u9009\u6216\u9009\u62dc\u767b\u51fa\u4efb\u56fd\u52a1\u537f', '\u7f8e\u6c11\u8c03\u79f0\u7279\u6717\u666e\u5728\u4f5b\u5dde\u9884\u5148\u6295\u7968\u4e2d\u9886\u5148\u5e0c\u62c9\u91cc', '\u7c73\u6b47\u5c14\u4e3a\u5e0c\u62c9\u91cc\u52a9\u9635\u62c9\u7968 \u4e24\u4f4d\u7b2c\u4e00\u592b\u4eba\u540c\u53f0\u79c0\u4eb2\u5bc6', '\u6c11\u8c03\uff1a\u4e00\u534a\u7f8e\u56fd\u4eba\u8ba4\u4e3a\u5e0c\u62c9\u91cc\u9690\u7792\u66f4\u591a\u4fe1\u606f', '\u524d\u82ac\u5170\u5c0f\u59d0\u7206\u731b\u6599\uff1a\u7279\u6717\u666e\u6293\u8fc7\u6211\u7684\u5c41\u80a1(\u56fe)', '\u7279\u6717\u666e\uff1a\u5e94\u8be5\u53d6\u6d88\u5927\u9009 \u76f4\u63a5\u5ba3\u5e03\u6211\u662f\u603b\u7edf', '\u7279\u6717\u666e:\u5e94\u8be5\u53d6\u6d88\u5927\u9009\u76f4\u63a5\u5ba3\u5e03\u6211\u83b7\u80dc', '\u7279\u6717\u666e\u88ab\u4f20\u662f\u83ab\u65af\u79d1\u201c\u5ba0\u513f\u201d \u666e\u4eac:\u4e00\u6d3e\u80e1\u8a00', '\u7279\u6717\u666e\u540d\u4e0b\u65b0\u9152\u5e97\u5f00\u5f20 \u7cfb\u534e\u76db\u987f\u6700\u6602\u8d35\u9152\u5e97\u4e4b\u4e00', '\u7279\u6717\u666e\u5148\u4e3a\u9152\u5e97\u526a\u5f69\u540e\u6f14\u8bb2', '\u7279\u6717\u666e\u518d\u7206\u60ca\u4eba\u8a00\u8bba\uff1a\u201c\u5e94\u53d6\u6d88\u5927\u9009\uff0c\u76f4\u63a5\u5ba3\u5e03\u6211\u83b7\u80dc\u201d', '\u7279\u6717\u666e\u518d\u6279\u5e0c\u62c9\u91cc\uff1a\u5979\u771f\u8870\uff01\u6211\u7684\u5929\u5450\uff0c\u6211\u4eec\u4fe9\u5dee\u522b\u771f\u5927\uff01', '\u7279\u6717\u666e\u906d\u4eba\u8ba8\u538c\u597d\u83b1\u575e\u661f\u661f\u8eba\u67aa', '\u5e0c\u62c9\u91cc\u751f\u65e5\u81ea\u79f0\u201c\u672a\u6765\u7684\u603b\u7edf\u201d \u7279\u6717\u666e\u597d\u83b1\u575e\u5927\u9053\u4e4b\u661f\u88ab\u7838', '1700\u4e07\u7f8e\u5143\uff01\u7279\u6717\u666e\u6d89\u5acc\u865a\u5047\u7406\u8d54', '\u9c8d\u5a01\u5c14\u5012\u6208\u652f\u6301\u5e0c\u62c9\u91cc', '\u6c11\u4e3b\u515a\u63d0\u524d\u653b\u51fb\u5e0c\u62c9\u91cc2020\u5e74\u7f8e\u56fd\u5927\u9009\u6f5c\u5728\u5bf9\u624b', '\u7279\u6717\u666e\uff1a\u4f60\u662f\u53f2\u4e0a\u6700\u5dee\u603b\u7edf \u5965\u5df4\u9a6c\uff1a\u8d77\u7801\u6211\u5f53\u4e0a\u4e86', '\u7279\u6717\u666e\u6d89\u9a97\u4fdd1700\u4e07\u7f8e\u5143 \u627f\u8ba4\u628a\u90e8\u5206\u94b1\u636e\u4e3a\u5df1\u6709', '\u7279\u6717\u666e\u4e3a\u81ea\u5bb6\u9152\u5e97\u5f00\u4e1a\u526a\u5f69 \u88ab\u6279\u4e3a\u4f01\u4e1a\u6253\u5e7f\u544a', '\u5e0c\u62c9\u91cc\u793e\u4ea4\u5a92\u4f53\u53d1\u6587\u4e3a\u81ea\u5df1\u5e86\u751f \u79f0\u81ea\u5df1\u672a\u6765\u603b\u7edf', '\u6700\u65b0\u6c11\u8c03\u79f0\u5e0c\u62c9\u91cc\u9886\u5148\u7279\u6717\u666e\u4f18\u52bf\u7f29\u5c0f \u9009\u60c5\u7d27\u5f20', '\u66fe\u627e\u5e0c\u62c9\u91cc\u56e2\u961f\u5e2e\u7ade\u9009\u8054\u5408\u56fd\u79d8\u4e66\u957f\uff1f\u9646\u514b\u6587\u5426\u8ba4', '\u5927\u9009\u5e76\u975e\u53ea\u6709\u5e0c\u62c9\u91cc\u7279\u6717\u666e \u8fd8\u6709\u8fd9\u4e24\u4f4d\u201c\u795e\u4eba\u201d', '\u7f8e\u56fd\u5f97\u5dde\u5927\u9009\u63d0\u524d\u6295\u7968\uff1a\u7279\u6717\u666e\u4ee5\u5fae\u5f31\u4f18\u52bf\u9886\u5148', '\u62b9\u9ed1\u65e0\u4e0b\u9650 \u5e0c\u62c9\u91cc\u7adf\u201c\u653e\u9e2d\u5b50\u201d', '\u8428\u79d1\u9f50\u7ade\u9009\u603b\u7edf\u5b66\u7279\u6717\u666e\uff1a\u6cd5\u56fd\u5927\u9009\u88ab\u64cd\u63a7\uff01', '\u7279\u6717\u666e\u79f0\u5965\u5df4\u9a6c\u6210\u6700\u5dee\u603b\u7edf \u5965\u5df4\u9a6c:\u81f3\u5c11\u6211\u5f53\u8fc7', '\u7279\u6717\u666e\u7684\u201c\u845b\u5e95\u65af\u5821\u6f14\u8bf4\u201d', '\u7279\u6717\u666e\u62b5\u6b7b\u4e0d\u8ba4\u8f93\uff1f\u7f8e\u5a92:\u4ed6\u4eab\u53d7\u4e89\u6597\u5e26\u6765\u7684\u5feb\u4e50', '\u7279\u6717\u666e\u9a82\u4e86\u591a\u5c11\u4eba\uff1f\u300a\u7ebd\u7ea6\u65f6\u62a5\u300b\u767b\u4e24\u6574\u7248', '\u7279\u6717\u666e\u60f3\u201c\u6500\u4e0a\u201d\u6797\u80af\uff0c\u5374\u906d\u4f17\u591a\u5a92\u4f53\u5632\u7b11', '\u5e0c\u62c9\u91cc\u653e\u9e2d\u54ac\u7279\u6717\u666e', '\u7f8e\u5927\u9009\u6700\u540e\u9636\u6bb5 \u5e0c\u62c9\u91cc\u201c\u653e\u5927\u62db\u201d', '\u7f8e\u56fd\u9009\u6c11\uff1a\u72d7\u72d7\u6700\u597d', '\u6c11\u8c03\u9886\u5148\uff1f\u5e0c\u62c9\u91cc\u60f3\u5165\u4e3b\u767d\u5bab\u6216\u4ecd\u6709\u96be\u5173', '\u666e\u4eac\uff1a\u7f8e\u56fd\u5fc5\u987b\u505c\u6b62\u6279\u8bc4\u4fc4\u7f57\u65af \u5426\u5219\u540e\u679c\u81ea\u8d1f', '\u7279\u6717\u666e\u9996\u6b21\u627f\u8ba4\u9009\u60c5\u843d\u540e \u575a\u79f0\u4e0d\u4f1a\u653e\u5f03\u9009\u4e3e', '\u5e0c\u62c9\u91cc\u7ade\u9009\u4eba\u6c14\u6e10\u9ad8 \u6269\u5927\u7ade\u9009\u52bf\u5934\u6b32\u593a\u56fd\u4f1a\u591a\u6570', '\u201c\u5927\u5634\u201d\u518d\u66dd\u64a9\u59b9', '\u201c\u5e0c\u666e\u201d\u6fc0\u6218\u201c\u6447\u6446\u5dde\u201d', '\u7f8e\u5927\u9009\u6c11\u8c03\uff1a\u5e0c\u62c9\u91cc\u4ecd\u9886\u5148\u7279\u6717\u666e \u7ed3\u679c\u4ecd\u5b58\u53d8\u6570', '\u7279\u6717\u666e\u88ab\u6307\u66fe\u6f5c\u89c4\u5219\u8273\u661f \u672c\u4eba\u56de\u5e94(\u56fe)', '\u7279\u6717\u666e\u845b\u5e95\u65af\u5821\u7545\u60f3\u201c\u767e\u65e5\u65b0\u653f\u201d', '\u7279\u6717\u666e\u7ade\u9009\u4e3b\u7ba1\u627f\u8ba4\u9009\u60c5\u843d\u540e \u671b\u4e89\u53d6\u6447\u6446\u9009\u6c11', '\u7279\u6717\u666e\u63d0\u51fa\u5c0f\u76ee\u6807', '\u5e0c\u62c9\u91cc\u4e0d\u6127\u8001\u53f8\u673a', '\u5e0c\u62c9\u91cc\u60ca\u9047\u201c\u767d\u8272\u7c89\u672b\u201d  \u7279\u6717\u666e\u72c2\u8a00\u201c\u767e\u65e5\u65b0\u653f\u201d', '\u4f0a\u6717\u770b\u597d\u5e0c\u62c9\u91cc\u8fd8\u662f\u7279\u6717\u666e\uff1f\u9c81\u54c8\u5c3c\uff1a\u90fd\u4e0d\u548b\u5730', '\u81ea\u7531\u53cd\u6297\u6c11\u4e3b\uff1a\u7279\u6717\u666e\u4e00\u4e2a\u4eba\u7684\u6218\u4e89', '\u201c\u5047\u5982\uff0c\u6211\u5f53\u4e86\u603b\u7edf\u2026\u2026\u201d\u7279\u6717\u666e\u7545\u60f3\u201c\u767e\u65e5\u65b0\u653f\u201d', '\u97e9\u56fd\u524d\u5916\u957f\uff1a\u7279\u6717\u666e\u82e5\u5f53\u9009\u662f\u97e9\u56fd\u5669\u68a6', '\u7279\u6717\u666e\uff1a\u82e5\u5f53\u9009\u767e\u65e5\u4e4b\u5185\u7528\u65b0\u653f\u98a0\u8986\u65e7\u5efa\u5236', '\u7279\u6717\u666e\u7ffb\u65e7\u8d26\u5632\u7c73\u6b47\u5c14 \u79f0\u5176\u5bf9\u5e0c\u62c9\u91cc\u201c\u53d8\u8138\u5feb\u201d', '\u4e3a\u4ec0\u4e48\u4e2d\u56fd\u7cbe\u82f1\u559c\u6b22\u7279\u6717\u666e\uff1f', '\u4e0d\u627f\u8bfa\u63a5\u53d7\u5927\u9009\u7ed3\u679c \u7279\u6717\u666e\u906d\u201c\u70ae\u8f70\u201d', '\u62d2\u7edd\u627f\u8ba4\u5927\u9009\u7ed3\u679c \u7279\u6717\u666e\u906d\u201c\u70ae\u8f70\u201d', '\u7f8e\u56fd\u5927\u9009\u6c11\u8c03\uff1a\u7279\u6717\u666e\u548c\u5e0c\u62c9\u91cc\u5dee\u8ddd\u6b63\u5728\u7f29\u5c0f', '\u8f93\u4e86\u5c31\u4e0d\u8ba4\u8d26\uff1f \u7279\u6717\u666e\u5927\u5634\u53c8\u60f9\u7978', '\u7279\u6717\u666e\u626d\u8f6c\u9893\u52bf\u5728\u6b64\u4e00\u4e3e', '\u7279\u6717\u666e\u906d\u201c\u70ae\u8f70\u201d', '\u201c\u8bf4\u7740\u8bf4\u7740\u5c31\u5f00\u59cb\u4eba\u8eab\u653b\u51fb\u201d', '\u5965\u5df4\u9a6c\u6279\u7279\u6717\u666e\u8511\u89c6\u9009\u4e3e\u7ed3\u679c\u8bf4\u6cd5:\u4e3a\u654c\u4eba\u505a\u4e8b', '\u5171\u548c\u515a\u627f\u8ba4\u7279\u6717\u666e\u5927\u52bf\u5df2\u53bb \u5e0c\u62c9\u91cc\u5c06\u538b\u5012\u6027\u80dc\u5229', '\u4e24\u4eba\u90fd\u8dd1\u9898 \u65c1\u89c2\u8005\u201c\u8eba\u67aa\u201d', '\u7f8e\u56fd\u5927\u9009\u7b2c\u4e09\u8fa9', '\u7f8e\u56fd\u6c11\u8c03:\u5e0c\u62c9\u91cc\u548c\u7279\u6717\u666e\u4ecd\u9ad8\u5ea6\u4e0d\u53d7\u9009\u6c11\u6b22\u8fce', '\u52df\u6350\u4e0d\u987a \u7279\u6717\u666e\u7ade\u9009\u7ecf\u8d39\u6216\u521b\u5386\u5e74\u603b\u7edf\u9009\u6218\u6700\u4f4e\u503c', '\u7279\u6717\u666e\u548c\u5e0c\u62c9\u91cc\u51fa\u5e2d\u6148\u5584\u665a\u5bb4\u201c\u7b11\u91cc\u85cf\u5200\u201d', '\u7279\u6717\u666e\u82e5\u8d25\u9009\uff0c\u7f8e\u56fd\u653f\u6cbb\u66f4\u96be\u770b\uff1f', '\u7279\u6717\u666e\u8f93\u6389\u5927\u9009\u540e\u7684\u4e09\u79cd\u53ef\u80fd\uff1a\u7f8e\u56fd\u6216\u5c06\u7206\u53d1\u5185\u6218\uff1f', '\u65e0\u8bba\u5e0c\u62c9\u91cc\u7279\u6717\u666e \u4e0b\u5c4a\u7f8e\u56fd\u603b\u7edf\u6ce8\u5b9a\u82e6\u5dee', '\u5e0c\u62c9\u91cc\u7684\u201c\u5047\u7b11\u201d\u4f1a\u8ba9\u5979\u4ed8\u51fa\u4ee3\u4ef7\uff1f', '\u5e0c\u62c9\u91cc\u516c\u5f00\u8ba8\u8bba\u6838\u6b66\u53d1\u5c04\u4fe1\u606f\u6328\u6279', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u4e09\u8fa9\uff1a\u8dd1\u9898\uff0c\u4eba\u8eab\u653b\u51fb\uff01', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u665a\u5bb4\u9762\u5bf9\u9762 \u6bd4\u62fc\u201c\u7b11\u91cc\u85cf\u5200\u201d', '\u7ec8\u6781\u4e92\u6495\u7ee7\u7eed\u8dd1\u9898', '\u201c\u4e09\u8fa9\u201d\u5728\u5373\u5f62\u52bf\u53ef\u5371 \u7279\u6717\u666e\u642c\u6765\u5965\u5df4\u9a6c\u54e5\u54e5', '\u8d4c\u535a\u7f51\u7ad9\u8c6a\u8d4c\u5e0c\u62c9\u91cc', '\u8c6a\u8d4c\u5e0c\u62c9\u91cc\u5f53\u603b\u7edf \u535a\u5f69\u7f51\u7ad9\u63d0\u524d\u4ed8\u94b1', '\u7f8e\u56fd\u5927\u9009\u4eca\u65e5\u6700\u540e\u4e00\u8fa9 \u7279\u6717\u666e\u5e0c\u62c9\u91cc\u4e92\u9ed1\u5230\u5e95', '\u7f8e\u56fd\u5927\u9009\u6495X\u7b2c\u4e09\u6ce2\u4e28\u5e0c\u62c9\u91cc\uff1a\u4f60\u662f\u5080\u5121\uff01\u7279\u6717\u666e\uff1a\u4f60\u624d\u662f\uff01', '\u7f8e\u56fd\u5927\u9009\u6700\u540e\u4e00\u8fa9 \u5e0c\u62c9\u91cc\uff1a\u4f60\u662f\u666e\u4eac\u7684\u6728\u5076', '\u7f8e\u5a92\u5531\u8870\u7279\u6717\u666e\uff1a\u7ade\u9009\u4e4b\u8def\u5c31\u6b64\u7ec8\u7ed3', '\u7f8e\u603b\u7edf\u5927\u9009\u201c\u4e09\u8fa9\u201d\u5373\u5c06\u4e3e\u884c', '\u7f8e\u603b\u7edf\u5019\u9009\u4eba\u4eca\u8fce\u201c\u7ec8\u8fa9\u201d \u7279\u6717\u666e\u9762\u4e34\u80cc\u6c34\u4e00\u6218', '\u7f8e\u603b\u7edf\u5019\u9009\u4eba\u8fce\u201c\u6700\u540e\u4e00\u6218\u201d \u7279\u6717\u666e\u6216\u7834\u91dc\u6c89\u821f', '\u660e\u661f\u540d\u6d41\u529b\u633a\u5e0c\u62c9\u91cc', '\u7279\u6717\u666e\u642c\u6765\u5965\u5df4\u9a6c\u54e5\u54e5', '\u7279\u6717\u666e\u513f\u65f6\u6545\u5c45\u6302\u724c\u62cd\u5356 \u8d77\u62cd\u4ef784.9\u4e07\u7f8e\u5143', '\u7279\u6717\u666e\u7ec8\u8fa9\u5507\u67aa\u820c\u6218\u5e0c\u62c9\u91cc \u672a\u627f\u8bfa\u63a5\u53d7\u9009\u4e3e\u7ed3\u679c', '\u5e0c\u62c9\u91cc\u4e09\u8fa9\u7279\u6717\u666e \u5341\u56de\u5408\u820c\u6218\u7cbe\u534e\u5b9e\u5f55', '\u652f\u6301\u5e0c\u62c9\u91cc\u9635\u5bb9\u5f3a\u5927\uff1a\u660e\u661f\u540d\u6d41\u5bcc\u5546\u7eb7\u7eb7\u53d1\u58f0', '\u201c\u8bfa\u5956\u7ea7\u201d\u6210\u679cor\u5b66\u672f\u9020\u5047\uff1f', '\u5965\u5df4\u9a6c\u54e5\u54e5\u5c06\u51fa\u5e2d\u5927\u9009\u8fa9\u8bba\u52a9\u529b\u7279\u6717\u666e', '\u5965\u5df4\u9a6c\u518d\u65a5\u7279\u6717\u666e\u4e0d\u914d\u505a\u603b\u7edf', '\u7f8e\u56fd\u5927\u9009\u5c06\u8fdb\u884c\u7b2c\u4e09\u573a\u8fa9\u8bba \u5e0c\u62c9\u91cc\u652f\u6301\u7387\u4ecd\u9886\u5148', '\u7279\u6717\u666e\u59bb\u5b50\u4e3a\u592b\u8fa9\u62a4\uff1a\u89c6\u9891\u8a00\u8bba\u662f\u7537\u5b69\u95f4\u7684\u8c08\u8bdd', '\u7279\u6717\u666e\u4fae\u8fb1\u5973\u6027\u8a00\u8bba\u7ee7\u7eed\u53d1\u9175 \u5176\u59bb\u51fa\u9762\u8fa9\u62a4', '\u7ef4\u57fa\u89e3\u5bc6\uff1a\u5e0c\u62c9\u91cc\u66fe\u8003\u8651\u8ba9\u5e93\u514b\u6216\u76d6\u8328\u5f53\u526f\u603b\u7edf', '\u7ef4\u57fa\u89e3\u5bc6\uff1a\u96c5\u864e\u627f\u8bfa\u5e2e\u52a9\u5e0c\u62c9\u91cc\u5728\u793e\u4ea4\u7f51\u7edc\u4e0a\u7092\u4f5c', '\u5e0c\u62c9\u91cc\u53d7\u6cd5\u5916\u5305\u5e87\uff1f', '\u6700\u540e\u4e00\u573a\u820c\u6218\u524d \u7279\u6717\u666e\u4e0e\u5e0c\u62c9\u91cc\u90fd\u53bb\u4e86\u54ea', '\u7279\u6717\u666e\u53cd\u51fb\uff1a\u62a8\u51fb\u5e0c\u62c9\u91cc\u201c\u55d1\u836f\u201d \u6307\u8d23\u5bf9\u624b\u821e\u5f0a', '\u7279\u6717\u666e\u59bb\u5b50\u63a5\u53d7\u4e13\u8bbf\u634d\u536b\u4e08\u592b \u79f0\u5176\u201c\u88ab\u6002\u607f\u201d', '\u7279\u6717\u666e\u6307\u8d23\u201c\u7f8e\u56fd\u5927\u9009\u88ab\u64cd\u7eb5\u201d \u767d\u5bab\u9488\u950b\u76f8\u5bf9', '\u610f\u89c1\u53c8\u4e0d\u4e00\u81f4\uff01\u7279\u6717\u666e\u548c\u5f6d\u65af\u600e\u4e48\u4e86\uff1f', '\u4e0eFBI\u6697\u901a\u6b3e\u66f2', '\u4e0e\u8001\u5927\u5531\u5bf9\u53f0\u620f', '\u6c11\u8c03\uff1a\u4e8c\u6b21\u8fa9\u8bba\u540e \u5e0c\u62c9\u91cc\u9886\u5148\u7279\u6717\u666e\u8fbe\u4e24\u4f4d\u6570', '\u7279\u6717\u666e\u6279\u7f8e\u56fd\u5927\u9009\u906d\u64cd\u63a7 \u7ade\u9009\u642d\u6863\u8bd5\u56fe\u964d\u6e29', '\u7279\u6717\u666e\u6307\u8d23\u7f8e\u5927\u9009\u88ab\u64cd\u7eb5 \u6000\u7591\u5e0c\u62c9\u91cc\u670d\u7528\u5174\u594b\u5242', '\u7ef4\u57fa\u89e3\u5bc6\u516c\u5e03\u5e0c\u62c9\u91cc\u9ad8\u76db\u5185\u90e8\u6f14\u8bb2\u6240\u6709\u5185\u5bb9', '\u201c\u975e\u793c\u95e8\u201d\u7ee7\u7eed\u53d1\u9175\u7279\u6717\u666e\u81ea\u79f0\u906d\u9677\u5bb3', '\u516d\u5973\u540c\u6307\u7279\u6717\u666e\u66fe\u201c\u800d\u6d41\u6c13\u201d', '\u5e0c\u62c9\u91cc\u56e2\u961f\u6c42\u514b\u6797\u987f\u53d6\u6d88\u6f14\u8bb2', '\u5e0c\u62c9\u91cc\u6f14\u8bb2\u5185\u5bb9\u88ab\u66dd\u5149\uff1a\u9650\u5236\u534e\u5c14\u8857\u662f\u65e0\u5948\u4e4b\u4e3e', '\u300a\u7ebd\u7ea6\u65f6\u62a5\u300b\u4e0d\u64a4\u7a3f \u7279\u6717\u666e\u51c6\u5907\u6253\u5b98\u53f8', '\u7f8e\u7b2c\u4e00\u592b\u4eba\u7c73\u6b47\u5c14\u6302\u5e05\u6279\u7279\u6717\u666e\u4fae\u8fb1\u5973\u6027\u8a00\u8bba', '\u7279\u6717\u666e\u201c\u5f00\u6495\u201d\u300a\u7ebd\u7ea6\u65f6\u62a5\u300b', '\u7279\u6717\u666e\u88ab\u66dd\u66fe\u5bf9\u591a\u540d\u5973\u6027\u4f38\u54b8\u732a\u624b \u6b32\u8d77\u8bc9\u5a92\u4f53', '\u7ef4\u57fa\u89e3\u5bc6:\u5e0c\u62c9\u91cc\u66fe\u5a01\u80c1\u7528\u53cd\u5bfc\u7cfb\u7edf\u5305\u56f4\u4e2d\u56fd', '\u7ef4\u57fa\u89e3\u5bc6\u62ab\u9732\u5e0c\u62c9\u91cc\u56e2\u961f\u4e0e\u7d22\u7f57\u65af\u63a5\u89e6\u7ec6\u8282', '\u7c73\u6b47\u5c14\u65a5\u7279\u6717\u666e\u7325\u4eb5\u5973\u6027 \u7f8e\u5a92\u79f0\u5176\u7cfb\u5e0c\u62c9\u91cc\u5229\u5668', '\u7279\u6717\u666e\u5426\u8ba4\u66fe\u5bf9\u5973\u6027\u505a\u51fa\u4e0d\u5f53\u884c\u4e3a \u5c06\u51fa\u793a\u8bc1\u636e', '\u5e0c\u62c9\u91cc\u7b79\u6b3e\uff1a\u672a\u676526\u5929\u662f\u7f8e\u56fd\u5386\u53f2\u6700\u91cd\u8981\u7684\u65e5\u5b50', '\u53c8\u7206\u7279\u6717\u666e\u6027\u4e11\u95fb', '2\u540d\u5973\u6027\u79f0\u66fe\u906d\u7279\u6717\u666e\u6027\u9a9a\u6270 \u7279\u6717\u666e\u5426\u8ba4', '\u7f8e14\u540d\u8b66\u5458\u6234\u7279\u6717\u666e\u5ba3\u4f20\u5e3d\u6267\u52e4\u5c06\u906d\u5904\u7f5a', '\u7f8e\u5927\u9009\u8fce\u6700\u540e\u4e00\u573a\u8fa9\u8bba \u7279\u6717\u666e\u4e0e\u5171\u548c\u515a\u5173\u7cfb\u6076\u5316', '\u7279\u6717\u666e \u5185\u5fe7', '\u7279\u6717\u666e\u88ab\u6307\u6027\u9a9a\u6270\u964c\u751f\u5973\u5b50\uff1a\u4ed6\u50cf\u7ae0\u9c7c\u4e00\u6837\u6478\u6211', '\u5e0c\u62c9\u91cc\u7ade\u9009\u9ed1\u6599\u518d\u66dd\u5149:\u66fe\u8bbe\u8ba1\u5982\u4f55\u8ba9\u5bf9\u624b\u8ba8\u4eba\u538c', '\u5171\u548c\u515a\u201c\u629b\u5f03\u201d\u7279\u6717\u666e\uff1f', '\u9ec4\u4e86 \u8d4c\u573a\u5173\u95e8', '\u7f8e\u5171\u548c\u515a\u7c4d\u4f17\u8bae\u957f\u9ed8\u8ba4\u7279\u6717\u666e\u8d25\u9009\uff1f', '\u7279\u6717\u666e\uff1a\u7f8e\u5a92\u5bf9\u7ef4\u57fa\u89e3\u5bc6\u62ab\u9732\u5e0c\u62c9\u91cc\u5185\u5bb9\u5931\u58f0', '\u7279\u6717\u666e\u5230\u4e86\u6700\u5371\u9669\u7684\u65f6\u5019_fina', '\u7279\u6717\u666e\u5931\u52bf \u5e0c\u62c9\u91cc\u51b2\u523a\u4e5f\u8270\u96be', '\u7279\u6717\u666e\u8ba8\u597d\u201c\u8ff7\u4f60\u7248\u7279\u6717\u666e\u201d', '\u7279\u6717\u666e\u518d\u653e\u72e0\u8bdd \u8bae\u957f\u9ed8\u8ba4\u8d25\u9009\uff1f', '\u7279\u6717\u666e\u906d\u5171\u548c\u515a\u9ad8\u5c42\u201c\u80cc\u53db\u201d \u79f0\u6bd4\u5e0c\u62c9\u91cc\u8fd8\u96be\u641e', '\u683d\u4e86 \u80a1\u795e\u6253\u538b', '\u4e8c\u8fa9\u5fd2\u4e8c', '\u5a92\u4f53\uff1a\u53f2\u4e0a\u6700\u6076\u6bd2', '\u7f8e\u4f17\u8bae\u957f:\u5c06\u4e0d\u518d\u4e0e\u7279\u6717\u666e\u540c\u53f0\u52a9\u9009\u6216\u4e3a\u5176\u8fa9\u62a4', '\u7ef4\u57fa\u89e3\u5bc6\u516c\u5e03\u7b2c\u4e8c\u6279\u6d89\u5e0c\u62c9\u91cc\u90ae\u4ef6', '\u5e0c\u62c9\u91cc\u4e3a\u4ec0\u4e48\u4e0d\u6562\u8bf4\u7ebd\u7ea6Uber\u53ea\u80fd\u7ebd\u7ea6\u4eba\u5f00\uff1f', '\u6027\u4e0e\u8c0e\u8a00\u5927\u9009\u4e8c\u8fa9\u53f2\u4e0a\u6700\u4e11\u964b', '\u201c\u4e92\u76f8\u4f24\u5bb3\u201d\u7f8e\u56fd\u5927\u9009\u9ed1\u6599\u8fed\u51fa', '\u5bf9\u9762\u4e5f\u5f88\u70c2\uff0c\u51ed\u5565\u8981\u9000\u9009', '\u5251\u62d4\u5f29\u5f20\uff01\u7279\u6717\u666e\u5e0c\u62c9\u91cc\u8fa9\u8bba\u5f00\u573a\u7f55\u89c1\u4e0d\u63e1\u624b', '\u514b\u6797\u987f\u7eef\u95fb\u5973\u4e3b\u89d2\u201c\u52a9\u653b\u201d\u7279\u6717\u666e:\u5e0c\u62c9\u91cc\u66f4\u53ef\u6015', '\u7f8e\u5927\u9009\u7b2c\u4e8c\u573a\u8fa9\u8bba \u5e0c\u62c9\u91cc\u7279\u6717\u666e\u6216\u4e92\u63ed\u201c\u9ed1\u6599\u201d', '\u7f8e\u56fd\u5927\u9009\u7b2c\u4e8c\u573a\u8fa9\u8bba\u4eca\u5929\u4e3e\u884c \u7279\u6717\u666e\u80fd\u81ea\u6551\u5417\uff1f', '\u7279\u6717\u666e\u88ab\u5171\u548c\u515a\u5927\u4f6c\u8981\u6c42\u9000\u9009 \u4e13\u5bb6\u79f0\u5176\u8d25\u5c40\u5df2\u5b9a', '\u7279\u6717\u666e\u56de\u5e94\u4fae\u8fb1\u5973\u6027\u8a00\u8bba:\u6211\u662f\u7a7a\u8c08\u514b\u6797\u987f\u662f\u884c\u52a8', '\u7279\u6717\u666e\u4f1a\u4e0d\u4f1a\u9000\u9009\uff1f', '\u7279\u6717\u666e\u5c31\u662f\u4e0d\u9000\u9009', '\u56f4\u89c2\u7f8e\u56fd\u5927\u9009\u201c\u4e8c\u8fa9\u201d\u4e28\u5e0c\u62c9\u91cc\uff1a\u4f60\u73a9\u5f04\u5df2\u5a5a\u5987\u5973\uff01\u7279\u6717\u666e\uff1a\u4f60\u8001\u516c\u6027\u9a9a\u6270\u591a\u540d\u5973\u6027\uff01', '\u5e0c\u62c9\u91cc\u88ab\u66dd\u4e3a\u8d5a\u94b1\u6cc4\u5bc6:\u95ed\u95e8\u6f14\u8bb2\u8c08\u51fb\u6bd9\u62c9\u767b\u5185\u5e55', '\u5e0c\u62c9\u91cc\u95ed\u95e8\u6f14\u8bb2\u6cc4\u5bc6', '\u5e0c\u62c9\u91cc\u6d89\u5acc\u6cc4\u5bc6\uff1f', '\u5e0c\u62c9\u91cc\u518d\u8fa9\u7279\u6717\u666e  \u6700\u7cbe\u5f69\u7684\u820c\u6218\u90fd\u5728\u8fd9\u91cc', '\u4f20\u7f8e\u5171\u548c\u515a\u9ad8\u5c42\u6b32\u653e\u5f03\u7279\u6717\u666e \u8f6c\u5411\u526f\u603b\u7edf\u5019\u9009\u4eba', '\u5171\u548c\u515a\u4f1a\u5728\u6700\u540e\u4e00\u523b\u629b\u5f03\u7279\u6717\u666e\u4e48\uff1f', '\u7f8e\u5171\u548c\u515a\u6350\u6b3e\u4eba\u62df\u66ff\u6362\u7279\u6717\u666e \u56e0\u5176\u6b67\u89c6\u5973\u6027\u8a00\u8bba', '\u7f8e\u56fd\u5927\u9009\u7b2c\u4e8c\u573a\u8fa9\u8bba\u5c06\u767b\u573a \u7279\u6717\u666e\u9762\u4e34\u786c\u4ed7', '\u7f8e\u5a92\u66dd\u5149\u7279\u6717\u666e\u4fae\u8fb1\u5973\u6027\u8a00\u8bba \u81ea\u5df1\u5973\u513f\u4e5f\u4e0d\u653e\u8fc7', '\u4ed6\u6b67\u89c6\u5973\u6027 \u5979\u9633\u5949\u9634\u8fdd', '\u7279\u6717\u666e\uff1a\u4e0d\u4f1a\u56e0\u7325\u4eb5\u5973\u6027\u5f55\u97f3\u66dd\u5149\u9000\u9009', '\u7279\u6717\u666e\u9760\u8bf4\u8c0e\u5f53\u4e0a\u7f8e\u56fd\u603b\u7edf\uff1f', '\u7279\u6717\u666e\u59bb\u5b50\uff1a\u4e0d\u80fd\u63a5\u53d7\u4e08\u592b\u7684\u65e0\u793c\u8a00\u8bba', '\u7279\u6717\u666e\u4e3a\u79fd\u8bed\u89c6\u9891\u9053\u6b49', '\u7279\u6717\u666e\u4fae\u8fb1\u5973\u6027\u4e11\u95fb\u53d1\u9175 \u591a\u4f4d\u515a\u5185\u4eba\u58eb\u8981\u5176\u9000\u9009', '\u5371\u673a\u516c\u5173\u80fd\u529b\uff0c\u7279\u6717\u666e\u7684\u5927\u786c\u4f24', '\u7ef4\u57fa\u89e3\u5bc6\u65b0\u6587\u4ef6\u91cd\u521b\u5e0c\u62c9\u91cc\u7ade\u9009 \u5982\u90479\u7ea7\u5730\u9707', '\u88ab\u66dd\u201c\u6d41\u6c13\u8a00\u8bba\u201d\u7684\u7279\u6717\u666e\u8fd8\u80fd\u8d62\u5f97\u5927\u9009\u5417\uff1f', '\u7eaf\u5c5e\u5de7\u5408\uff1f\u7ef4\u57fa\u89e3\u5bc6\u66dd\u5149\u5e0c\u62c9\u91cc\u534e\u5c14\u8857\u8bb2\u8bdd\u5b9e\u5f55', '\u662f\u8c01\u6316\u51fa\u90a3\u6bb5\u8ba9\u7279\u6717\u666e\u9053\u6b49\u8ba4\u9519\u7684\u89c6\u9891\uff1f', '\u7279\u6717\u666e\u201c\u628a\u59b9\u201d\u5f55\u97f3\u6587\u5b57\u5b9e\u5f55', '\u7279\u6717\u666e10\u5e74\u524d\u5f55\u97f3\u6cc4\u9732 \u81ea\u5938\u73a9\u5f04\u5df2\u5a5a\u5973\u5b50\u7ecf\u5386', '\u7279\u6717\u666e\u987e\u95ee\uff1a\u82e5\u7279\u6717\u666e\u5f53\u9009 \u5c06\u4f18\u5148\u8ddf\u82f1\u56fd\u8c08\u81ea\u8d38', '\u7279\u6717\u666e\u5c31\u4e0d\u96c5\u8a00\u8bba\u9053\u6b49\uff1a\u6211\u9519\u4e86', '\u4e3a\u4ec0\u4e48\u7f8e\u56fd\u4e3b\u6d41\u5a92\u4f53\u5bf9\u7279\u6717\u666e\u96f6\u652f\u6301\uff1f', '\u7ef4\u57fa\u89e3\u5bc6\u62ab\u9732\u5e0c\u62c9\u91cc\u975e\u516c\u5f00\u8bb2\u8bdd\u7a3f:\u8d5e\u6210\u5f00\u653e\u8fb9\u5883', '\u5e0c\u62c9\u91cc\u6279\u7279\u6717\u666e\u4fae\u8fb1\u5973\u6027\u8a00\u8bba\uff1a\u771f\u53ef\u6015', '\u4e2d\u5b57\u5168\u7a0b\uff1a\u7279\u6717\u666e10\u5e74\u524d\u5f55\u97f3\u66dd\u5149 \u70ab\u8000\u73a9\u5f04\u5df2\u5a5a\u5973\u5b50\u7ecf\u5386', '\u4f17\u8bae\u957f\u745e\u5b89\u53d6\u6d88\u4e0e\u7279\u6717\u666e\u5171\u540c\u51fa\u5e2d\u7ade\u9009\u6d3b\u52a8', '\u7f8e\u56fd\u4fdd\u5b88\u6d3e\u7eb8\u5a92\u6253\u7834\u4e2d\u7acb\u4f20\u7edf \u201c\u80cc\u4e66\u201d\u5e0c\u62c9\u91cc', '\u7f8e\u4e24\u515a\u526f\u603b\u7edf\u5019\u9009\u4eba\u8fa9\u8bba\u5e0c\u62c9\u91cc\u548c\u7279\u6717\u666e\u4e5f\u201c\u8eba\u67aa\u201d', '\u5e0c\u62c9\u91cc\u548c\u7279\u6717\u666e\u201c\u8eba\u67aa\u201d', '\u7eef\u95fb\u7f20\u8eab\u5bf9\u7279\u6717\u666e\u672a\u5fc5\u662f\u574f\u4e8b_fina', '\u7f8e\u56fd\u591a\u5bb6\u4fdd\u5b88\u6d3e\u7eb8\u5a92\u6253\u7834\u4f20\u7edf\u201c\u80cc\u4e66\u201d\u5e0c\u62c9\u91cc', '\u7f8e\u56fd\u4e9a\u88d4\u66f4\u652f\u6301\u7279\u6717\u666e\u8fd8\u662f\u5e0c\u62c9\u91cc\uff1f', '\u7279\u6717\u666e\u4e11\u95fb\u9891\u53d1\u5e0c\u62c9\u91cc\u201c\u731b\u653b\u201d', '\u7ef4\u57fa\u63ed\u79d8\u521b\u59cb\u4eba\u6216\u7206\u731b\u6599 \u7279\u6717\u666e\u65b9\u79f0\u5e0c\u62c9\u91cc\u8981\u5b8c', '\u7f8e\u5927\u9009\u6700\u540e\u51b2\u523a\u6447\u6446\u5dde\u9009\u60c5\u7d27\u7ef7 \u5e0c\u62c9\u91cc\u5e0c\u671b\u5927', '\u7f8e\u56fd\u7ebd\u7ea6\u5dde\u52d2\u4ee4\u7279\u6717\u666e\u57fa\u91d1\u4f1a\u505c\u6b62\u7b79\u6b3e', '\u7279\u6717\u666e\u57fa\u91d1\u4f1a\u88ab\u505c\u6b62\u5728\u7ebd\u7ea6\u52df\u8d44', '\u7279\u6717\u666e\u57fa\u91d1\u6d89\u65e0\u7167\u7ecf\u8425\u88ab\u505c\u6b62\u7b79\u6b3e \u5e0c\u62c9\u91cc\u6293\u628a\u67c4', '\u7279\u6717\u666e\u88ab\u66dd\u66fe\u51fa\u6f14\u82b1\u82b1\u516c\u5b50\u201c\u6210\u4eba\u7247\u201d', '\u7279\u6717\u666e\u88ab\u66dd\u6f14\u8fc7\u201c\u6210\u4eba\u7247\u201d', '\u7279\u6717\u666e\u7a0e\u52a1\u8bb0\u5f55\u88ab\u63ed\u9732\u672a\u5426\u8ba4 \u5f71\u54cd\u9009\u60c5\u8a00\u4e4b\u5c1a\u65e9', '\u7279\u6717\u666e\u6f14\u201c\u6210\u4eba\u7247\u201d', '\u652f\u6301\u5ddd\u666e\u53cd\u5bf9\u5e0c\u62c9\u91cc', '\u7f8e\u56fd\u5927\u9009\u592a\u6c61\uff01\u7279\u6717\u666e\u88ab\u66dd\u6f14\u8fc7\u201c\u6210\u4eba\u7247\u201d', '\u7f8e\u5a92\u653e\u5f0334\u5e74\u7f8e\u56fd\u5927\u9009\u4e2d\u7acb\u4f20\u7edf\uff1a\u522b\u9009\u7279\u6717\u666e', '\u7279\u6717\u666e\u88ab\u66dd\u66fe\u4eae\u76f8\u300a\u82b1\u82b1\u516c\u5b50\u300b\u8272\u60c5\u5f71\u7247', '\u7279\u6717\u666e\u51cc\u6668\u6390\u67b6\u201c\u73af\u59d0\u201d', '\u53c8\u5f00\u6218\uff01\u5e0c\u62c9\u91cc\u6279\u7279\u6717\u666e\u5e03\u5c40\u53e4\u5df4\u725f\u5229\u6d89\u8fdd\u6cd5', '\u591a\u5bb6\u7f8e\u62a5\u56e0\u201c\u633a\u5e0c\u201d\u906d\u9000\u8ba2', '\u591a\u5bb6\u7f8e\u56fd\u62a5\u7eb8\u56e0\u652f\u6301\u5e0c\u62c9\u91cc\u906d\u5927\u6279\u91cf\u8bfb\u8005\u9000\u8ba2', '\u7279\u6717\u666e\u51cc\u6668\u6390\u67b6\u73af\u7403\u5c0f\u59d0 \u5e0c\u62c9\u91cc:\u771f\u662f\u75af\u4e86', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u5747\u79f0\u6b23\u8d4f\u5fb7\u56fd\u603b\u7406\u9ed8\u514b\u5c14', '\u652f\u6301\u5e0c\u62c9\u91cc \u591a\u5bb6\u7f8e\u62a5\u201c\u53db\u515a\u201d\u906d\u9000\u8ba2', '\u591a\u540d\u524d\u5458\u5de5\u7206\u6599\uff1a\u7279\u6717\u666e\u53ea\u96c7\u7528\u5e74\u8f7b\u6f02\u4eae\u5973\u5b50', '\u7f8e\u5a92\u79f0\u7279\u6717\u666e\u8fdd\u53cd\u7981\u8fd0\u4ee4 \u65d7\u4e0b\u516c\u53f8\u5728\u53e4\u5df4\u505a\u751f\u610f', '\u7279\u6717\u666e\u8d22\u5bcc\u4e00\u5e74\u7f29\u6c348\u4ebf\u7f8e\u5143', '\u7279\u6717\u666e\u5916\u4ea4\u987e\u95ee\u5c06\u8bbf\u65e5 \u6216\u4e0e\u65e5\u672c\u9ad8\u5c42\u8c08\u4e9a\u6d32\u653f\u7b56', '\u5e0c\u62c9\u91cc\u79f0\u5404\u56fd\u9886\u8896\u4e2d\u656c\u4f69\u9ed8\u514b\u5c14 \u8d5e\u5176\u575a\u5f3a\u4e0d\u51e1', '\u9009\u603b\u7edf\u4e0d\u6613 \u7279\u6717\u666e\u8d22\u5bcc1\u5e74\u201c\u7f29\u6c34\u201d8\u4ebf\u7f8e\u91d1', '\u201c\u5c0f\u732a\u5c0f\u59d0\u201d\u590d\u4ec7\u7279\u6717\u666e', '\u798f\u5e03\u65af\uff1a\u7279\u6717\u666e\u7684\u8d22\u5bcc\u4e00\u5e74\u201c\u7f29\u6c34\u201d8\u4ebf\u7f8e\u5143', '\u524d\u73af\u7403\u5c0f\u59d0\u66fe\u88ab\u7279\u6717\u666e\u4fae\u8fb1 \u4eca\u6210\u5e0c\u62c9\u91cc\u79d8\u5bc6\u6b66\u5668', '\u8eab\u9ad8\u4e0d\u591f,\u6c14\u573a\u6765\u51d1', '\u7279\u6717\u666e\u653b\u51fb\u5e0c\u62c9\u91cc:\u6ca1\u63d0\u83b1\u6e29\u65af\u57fa\u662f\u6211\u539a\u9053', '\u201c\u5c0f\u82cf\u6253\u201d\u80fd\u6cbb\u764c\uff0c\u6551\u547d\u826f\u65b9or\u533b\u5b66\u5984\u60f3\uff1f', '\u89c2\u70b9\u4ea4\u950b\u5c11 \u4e92\u76f8\u63ed\u77ed\u591a', '\u4e24\u5206\u949f \u5e0c\u62c9\u91cc\u7279\u6717\u666e\u9996\u573a\u8fa9\u8bba\u4eae\u70b9\u90fd\u5728\u8fd9\uff01', '\u7f8e\u56fd\u5927\u9009\u7b2c\u4e00\u8fa9\u82b1\u7d6e\uff1a\u7eaa\u5ff5\u95e8\u7968\u5370\u9519\u5e0c\u62c9\u91cc\u540d\u5b57', '\u6c11\u8c03\uff1a\u7f8e\u5927\u9009\u4e3e\u884c\u9996\u573a\u7535\u89c6\u8fa9\u8bba \u5e0c\u62c9\u91cc\u5360\u4e0a\u98ce', '\u6390\u6b7b\u4f60\u7684\u6e29\u67d4', '\u7279\u6717\u666e\u7684\u6027\u683c\u7f3a\u9677\uff0c\u4e00\u518d\u8bc1\u660e\u4e0d\u9002\u5408\u5f53\u603b\u7edf', '\u7279\u6717\u666e\u548c\u5e0c\u62c9\u91cc\uff0c\u771f\u6b63\u4f1a\u4f24\u5bb3\u4e2d\u56fd\u7684\u662f\u8c01\uff1f', '\u201c\u7279\u6717\u666e\u4e0a\uff0c\u7ecf\u6d4e\u5012\u201d\uff0c\u6ca1\u60f3\u5230\u5e0c\u62c9\u91cc\u4e5f\u4f1a\u53e3\u51fa\u91d1\u53e5\u2026\u2026', '\u4e2a\u5934\u5f88\u91cd\u8981\uff01', '\u770b\u201c\u5e0c\u666e\u201d\u5982\u4f55\u201c\u4e92\u76f8\u4f24\u5bb3\u201d', '\u7f8e\u5927\u9009\u8fa9\u8bba\u8c08\u53cd\u6050\u95ee\u9898\uff1a\u7279\u6717\u666e\u5927\u6279\u5e0c\u62c9\u91cc\u548c\u5965\u5df4\u9a6c', '\u7f8e\u5927\u9009\u9996\u8fa9\u4e09\u5927\u770b\u70b9', '\u7f8e\u5927\u9009\u9996\u573a\u7535\u89c6\u8fa9\u8bba\u524d \u5e0c\u62c9\u91cc\u652f\u6301\u7387\u9886\u5148\u7279\u6717\u666e', '\u7f8e\u56fd\u5927\u9009\u9996\u573a\u8fa9\u8bba\u767b\u573a \u5e0c\u62c9\u91cc\u7279\u6717\u666e\u6b63\u9762\u4ea4\u950b', '\u7f8e\u56fd\u5927\u9009\u9996\u573a\u8fa9\u8bba\u5f00\u59cb \u7279\u6717\u666e\u5e0c\u62c9\u91cc\u6b63\u9762\u4ea4\u950b', '\u7f8e\u4e3e\u884c\u603b\u7edf\u5927\u9009\u9996\u573a\u8fa9\u8bba \u5e0c\u62c9\u91cc\u7279\u6717\u666e\u6b63\u9762\u4ea4\u950b', '\u4f60\u4fe9\u201c\u6bd4\u70c2\u201d\u6211\u4eec\u201c\u5403\u74dc\u201d', '\u7279\u6717\u666e\u820c\u6218\u5e0c\u62c9\u91cc\uff1a\u90a3\u4e9b\u4f60\u60f3\u4e0d\u5230\u7684\u201c\u91d1\u53e5\u201d', '\u7279\u6717\u666e\u8c08\u5c31\u4e1a\u626f\u4e0a\u4e2d\u56fd \u8d5e\u57fa\u7840\u8bbe\u65bd\u4f18\u4e8e\u7f8e\u56fd', '\u5e0c\u62c9\u91cc\u548c\u7279\u6717\u666e\u5c06\u9996\u6b21\u8fa9\u8bba', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u201c\u9996\u6218\u201d \u8c01\u8d62\u4e86\u8fd9\u6b21\u5927\u8fa9\u8bba\uff1f', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u5927\u9009\u9996\u6b21\u8fa9\u8bba \u7f8e\u5a92\uff1a\u96be\u5206\u80dc\u8d1f', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u90fd\u843d\u6c34\u8c01\u4f1a\u5f97\u6551\uff1f\u7f51\u53cb\uff1a\u7f8e\u56fd', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u9996\u573a\u8fa9\u8bba\u5507\u67aa\u820c\u6218 \u4e92\u63ed\u9ed1\u5386\u53f2', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u9996\u573a\u8fa9\u8bba\u4e0a\u6f14\u5507\u67aa\u820c\u6218\uff1a\u4e92\u63ed\u9ed1\u5386\u53f2', '\u5e0c\u62c9\u91cc\u4e0e\u7279\u6717\u666e\u4eca\u5c55\u5f00\u201c\u5927\u9009\u7b2c\u4e00\u8fa9\u201d', '\u73b0\u573a\u76f4\u51fb\u5e0c\u62c9\u91cc\u548c\u7279\u6717\u666e\u9996\u6b21\u5bf9\u51b3', '\u6b63\u5728\u76f4\u64ad\uff1a\u5e0c\u62c9\u91ccvs\u7279\u6717\u666e \u8c01\u66f4\u80dc\u4e00\u7b79\uff1f', '\u76f4\u64ad\uff1a\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u201c\u7b2c\u4e00\u6218\u201d \u592e\u89c6\u8bb0\u8005\u76f4\u51fb\u73b0\u573a', '\u7f8e\u60c5\u62a5\u673a\u6784\u76ef\u4e0a\u7279\u6717\u666e\u987e\u95ee', '\u7ebd\u7ea6\u65f6\u62a5\u529b\u633a\u5e0c\u62c9\u91cc \u65a5\u7279\u6717\u666e\u4e3a\u8fd1\u4ee3\u6700\u5dee\u5019\u9009\u4eba', '\u56db\u5927\u6307\u5357\u52a9\u4f60\u56f4\u89c2\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u9996\u6b21\u6b63\u9762\u4ea4\u950b', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u9996\u5ea6\u6b63\u9762\u4ea4\u950b \u6216\u5de6\u53f31/3\u9009\u6c11\u610f\u5411', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u8fce\u9996\u573a\u5927\u9009\u8fa9\u8bba \u6536\u89c6\u5c06\u7834\u5386\u53f2\u7eaa\u5f55', '\u5965\u5df4\u9a6c\u8bbd\u7279\u6717\u666e\u4e0d\u61c2\u975e\u88d4\u5386\u53f2 8\u5c81\u5c0f\u5b69\u90fd\u61c2', '\u5973\u603b\u7edf\u7684\u201c\u9ed1\u5929\u9e45\u4e8b\u4ef6\u201d', '\u5916\u5a92\uff1a\u5e0c\u62c9\u91cc\u4efb\u56fd\u52a1\u537f\u671f\u95f4\u66fe\u5728\u4fc4\u9057\u843d\u673a\u5bc6\u6587\u4ef6', '\u6614\u65e5\u52b2\u654c\u514b\u9c81\u5179\u5ba3\u5e03\u4e3a\u7279\u6717\u666e\u80cc\u4e66', '\u7f8e\u5927\u9009\u9996\u573a\u7535\u89c6\u8fa9\u8bba\u5728\u5373 \u5e0c\u62c9\u91cc\u6c11\u8c03\u9886\u5148\u7279\u6717\u666e', '\u7f8e\u603b\u7edf\u5019\u9009\u4eba\u7279\u6717\u666e\u88ab\u66dd\u632a\u7528\u57fa\u91d1\u4f1a\u8d44\u91d1', '\u58a8\u603b\u7edf\uff1a\u7279\u6717\u666e\u7684\u9519\uff01', '\u5e0c\u62c9\u91cc\u5bfb\u6c42\u5927\u5e45\u4e0a\u8c03\u623f\u4ea7\u7a0e', '\u201c\u53cc\u9762\u201d\u7279\u6717\u666e\uff1a\u4ed6\u7684\u201c\u7406\u6027\u201d\u4f60\u77e5\u591a\u5c11\uff1f', '\u5965\u5df4\u9a6c\u4e4b\u540e,TPP\u6050\u6ca1\u4eba\u201c\u63a5\u76d8\u201d', '\u7f8e75\u540d\u5916\u4ea4\u5b98\u53d1\u516c\u5f00\u4fe1 \u5fe7\u7279\u6717\u666e\u8a00\u8bba\u5f15\u5916\u4ea4\u98ce\u6ce2', '\u6c11\u8c03\uff1a75%\u7f8e\u56fd\u4eba\u8ba4\u4e3a\u7279\u6717\u666e\u5065\u5eb7\u72b6\u51b5\u66f4\u9002\u5f53\u603b\u7edf', '\u7279\u6717\u666e\u57fa\u91d1\u4f1a\u201c\u9ed1\u5e55\u201d\u66dd\u5149', '\u7279\u6717\u666e\u5e0c\u62c9\u91cc\u5c06\u8fdb\u884c\u9996\u573a\u7535\u89c6\u8fa9\u8bba \u6536\u89c6\u6216\u521b\u7eaa\u5f55', '\u7279\u6717\u666e\u559c\u6b22\u5403\u5feb\u9910 \u4f46\u90a3\u4e5f\u8d62\u4e0d\u4e86\u9910\u996e\u4e1a\u7684\u5fc3', '\u201c\u5927\u5634\u201d\u7279\u6717\u666e\u7684\u957f\u5b50\u4e5f\u662f\u4e2a\u201c\u5927\u5634\u5df4\u201d', '\u8001\u5e03\u4ec0\u8981\u652f\u6301\u5e0c\u62c9\u91cc\uff1f', '\u7f8e\u56fd\u5927\u9009\u771f\u662f\u8d8a\u6765\u8d8a\u70ed\u95f9\u4e86\uff0c\u7279\u6717\u666e\u53c8\u88ab\u7f51\u53cb\u9ed1\u51fa\u7fd4\u4e86\u2026\u2026', '\u4e3a\u95ee\u9f0e\u767d\u5bab \u5e0c\u62c9\u91cc\u7279\u6717\u666e\u8fd9\u4e24\u4f4d\u8001\u4eba\u5230\u5e95\u6709\u591a\u62fc', '\u5c0f\u7279\u6717\u666e\u3000\u5927\u5634\u7236\u4eb2 \u6211\u8d85', '\u201c\u795e\u52a9\u653b\u201d\uff1a\u7f8e\u56fd\u524d\u603b\u7edf\u8001\u5e03\u4ec0\u62df\u6295\u7968\u7ed9\u5e0c\u62c9\u91cc', '\u5b81\u201c\u53db\u515a\u201d\u4e5f\u4e0d\u8981\u7279\u6717\u666e  \u8001\u5e03\u4ec0\u5c06\u6295\u7968\u5e0c\u62c9\u91cc', '\u8c01\u4e3a\u88ad\u51fb\u8d1f\u8d23\uff1f\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u201c\u5f00\u6495\u201d', '\u88ad\u51fb\u5230\u5e95\u8be5\u8c01\u8d1f\u8d23\uff1f\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u201c\u5f00\u6495\u201d', '\u5b89\u500d\u4e0e\u5e0c\u62c9\u91cc\u4f1a\u8c08\u786e\u8ba4\u65e5\u7f8e\u540c\u76df\u91cd\u8981\u6027', '\u5176\u5b9e,\u4ed6\u4eec\u90fd\u6709\u75c5', '\u7279\u6717\u666e\u7684\u903b\u8f91\u8352\u8c2c\uff0c\u4e3a\u4ec0\u4e48\u8fd8\u5f88\u6709\u5e02\u573a\uff1f', '\u5965\u5df4\u9a6c\u53d1\u8868\u6fc0\u60c5\u6f14\u8bb2 \u547c\u5401\u975e\u6d32\u88d4\u9009\u6c11\u652f\u6301\u5e0c\u62c9\u91cc', '\u5965\u5df4\u9a6c\u53d1\u8868\u6f14\u8bb2\u4e3a\u5e0c\u62c9\u91cc\u62c9\u7968 \u6697\u81ea\u8bbd\u523a\u7279\u6717\u666e', '\u5965\u5df4\u9a6c\u558a\u8bdd\u975e\u88d4\u9009\u6c11:\u4e0d\u9009\u5e0c\u62c9\u91cc\u5c31\u662f\u4eba\u8eab\u4fae\u8fb1\u6211', '\u5965\u5df4\u9a6c\u547c\u5401\u975e\u88d4\u7f8e\u56fd\u4eba\u62b5\u5236\u7279\u6717\u666e\uff1a\u7ed9\u4ed6\u6295\u7968\u662f\u7f9e\u8fb1\u6211', '\u7f8e\u56fd\u5386\u53f2\u4e0a\u75c5\u592b\u6cbb\u56fd\u8bef\u8fc7\u54ea\u4e9b\u4e8b', '\u7f8e\u56fd\u8fde\u53d1\u4e09\u8d77\u88ad\u51fb\u4e8b\u4ef6 \u5e0c\u62c9\u91cc\u79f0\u662f\u201c\u660e\u663e\u6050\u88ad\u201d', '\u7ebd\u7ea6\u7206\u70b8\u6848\u786e\u7cfb\u6050\u6016\u88ad\u51fb\uff0c\u800c\u5e0c\u62c9\u91cc\u6b63\u7b49\u7740\u7279\u6717\u666e\u51fa\u9519', '\u7279\u6717\u666e\u53c8\u717d\u52a8\u5bf9\u5e0c\u62c9\u91cc\u52a8\u7c97', '\u7279\u6717\u666e\u53c8\u6311\u8845\u5e0c\u62c9\u91cc\uff1f', '\u5e0c\u62c9\u91cc\u4e00\u8de4\u201c\u6454\u201d\u51fa\u65e0\u6570\u7f51\u7edc\u8c23\u8a00 \u4ec0\u4e48\u624d\u662f\u771f\u76f8', '\u91ce\u751f\u52a8\u7269\u5b66\u5bb6\uff1a\u7279\u6717\u666e\u50cf\u9ed1\u7329\u7329 \u7528\u60f3\u50cf\u529b\u4e0a\u4f4d', '\u7591\u53cd\u7279\u6717\u666e\u540c\u6027\u604b\u8005\u5236\u9020\u7ebd\u7ea6\u7206\u70b8\uff1a\u79f0\u53ea\u662f\u5f00\u59cb \u5a01\u80c1\u518d\u653b\u51fb', '\u518d\u79c0\u5916\u4ea4\u80fd\u529b \u7279\u6717\u666e\u5c06\u5728\u8054\u5927\u671f\u95f4\u4e0e\u57c3\u53ca\u603b\u7edf\u4f1a\u8c08', '\u201c\u5065\u5eb7\u95e8\u201d\u65e0\u788d\u6c11\u8c03\uff1f\u5e0c\u62c9\u91cc\u4ecd\u9886\u5148\u7279\u6717\u666e', '\u201c\u5065\u5eb7\u95e8\u201d\u65e0\u788d\u6c11\u8c03\u5e0c\u62c9\u91cc\u7ee7\u7eed\u9886\u5148', '\u66fc\u54c8\u987f\u53d1\u751f\u7206\u70b8\u5df2\u5bfc\u81f425\u4eba\u53d7\u4f24 \u7279\u6717\u666e\u79f0\u662f\u70b8\u5f39\u5f15\u8d77', '\u8eab\u9677\u201c\u5065\u5eb7\u95e8\u201d\uff0c\u5e0c\u62c9\u91cc\u4ecd\u9886\u5148\u7279\u6717\u666e', '\u7279\u6717\u666e\u627f\u8ba4\u5965\u5df4\u9a6c\u672c\u571f\u51fa\u751f', '\u7279\u6717\u666e\u653b\u51fb\u5e0c\u62c9\u91cc\u79fb\u6c11\u653f\u7b56 \u6307\u8d23\u5176\u6253\u7b97\u201c\u653e\u5f03\u8fb9\u5883\u201d', '\u5e0c\u62c9\u91cc\u590d\u51fa\u8d70\u4e24\u6b65', '\u5e0c\u62c9\u91cc\u56de\u5e94\u7279\u6717\u666e\u7ebd\u7ea6\u7206\u70b8\u201c\u70b8\u5f39\u8bf4\u201d\uff1a\u8fd8\u662f\u7b49\u7b49\u518d\u8bf4\u5427', '\u5e0c\u62c9\u91cc\u9886\u5148\u7279\u6717\u666e4\u4e2a\u767e\u5206\u70b9', '\u5e0c\u62c9\u91cc\u9886\u5148\u7279\u6717\u666e4\u4e2a\u767e\u5206\u70b9 \u5065\u5eb7\u72b6\u51b5\u5f71\u54cd\u6709\u9650', '\u5a92\u4f53\uff1a\u90a3\u4e9b\u7f8e\u56fd\u7684\u201c\u75c5\u4eba\u201d\u603b\u7edf', '\u5a92\u4f53\u76d8\u70b9\u6709\u66ff\u8eab\u7684\u56fd\u5916\u653f\u8981', '\u7f8e\u524d\u56fd\u52a1\u537f\u8d28\u7591\u5e0c\u62c9\u91cc\uff1a\u5979\u7ecf\u624b\u7684\u6bcf\u4ef6\u4e8b\u90fd\u641e\u7838', '\u7279\u6717\u666e\u9996\u5ea6\u516c\u5f00\u627f\u8ba4\u5965\u5df4\u9a6c\u751f\u4e8e\u7f8e\u56fd', '\u7279\u6717\u666e\u518d\u63d0\u7ecf\u6d4e\u632f\u5174\u8ba1\u5212 \u79f0\u8981\u521b3.5%\u5e74\u5747\u589e\u957f\u7387', '\u5e0c\u62c9\u91cc\u8bbd\u7279\u6717\u666e\uff1a\u4e0d\u4f1a\u50cf\u4ed6\u90a3\u6837\u70ed\u8877\u201c\u4f5c\u79c0\u201d', '\u5e0c\u62c9\u91cc\u6068\u5965\u5df4\u9a6c', '\u5e0c\u62c9\u91cc\u56e02008\u5e74\u8d25\u9009\u8bb0\u4ec7 \u79f0\u5965\u5df4\u9a6c\u201c\u90a3\u4e2a\u7537\u7684\u201d', '\u90ae\u4ef6\u66dd\u5149\uff1a\u5e0c\u62c9\u91cc\u6068\u5965\u5df4\u9a6c', '\u7279\u6717\u666e\u516c\u5f00\u4f53\u68c0\u62a5\u544a:\u201c\u4ece\u672a\u95f4\u65ad\u201d\u53c2\u4e0e\u7ade\u9009\u6d3b\u52a8', '\u7279\u6717\u666e\u5f55\u533b\u7597\u8131\u53e3\u79c0\u56de\u51fb\u8d28\u7591 \u5e0c\u62c9\u91cc\u6652\u533b\u751f\u4fe1\u4ef6', '\u5e0c\u62c9\u91cc\u88ab\u66dd\u9690\u7792\u75c5\u60c5\u8fd120\u5e74', '\u5e0c\u62c9\u91cc\u60a3\u80ba\u708e\u540e\u91cd\u56de\u7ade\u9009\u8f68\u9053 \u8bbd\u7279\u6717\u666e\u70ed\u8877\u4f5c\u79c0', '\u7ade\u9009\u56e2\u961f\u79f0\u5e0c\u62c9\u91cc\u5b8c\u5168\u5065\u5eb7 \u7f8e\u5a92\uff1a\u8bf4\u670d\u529b\u4e0d\u591f', '\u7f8e\u5927\u9009\u201c\u6325\u91d1\u5982\u571f\u201d', '\u7f8e\u7535\u89c6\u53f0\u9519\u8bef\u53d1\u5e03\u5e0c\u62c9\u91cc\u6b7b\u4ea1\u6d88\u606f\u540e\u6025\u706d\u706b', '\u7f8e\u56fd\u524d\u56fd\u52a1\u537f\u7535\u90ae\u88ab\u66dd\u5149 \u79f0\u7279\u6717\u666e\u4e3a\u7f8e\u56fd\u4e4b\u803b', '\u7279\u6717\u666e\u7ade\u9009\u9020\u52bf\u53c8\u906d\u840c\u5a03\u62a2\u955c', '\u5e0c\u62c9\u91cc\uff0c \u5e26\u75c5\u5de5\u4f5c\u4e5f\u662f\u9519?', '\u5e0c\u62c9\u91cc\u88ab\u66dd\u8fd120\u5e74\u6765\u5e38\u5e38\u9690\u7792\u75c5\u60c5', '\u5e0c\u62c9\u91cc\u88ab\u66dd\u9690\u7792\u75c5\u60c5\u8fd120\u5e74 \u624b\u4e0b\u804c\u5458\u4e0d\u77e5\u60c5', '\u5e0c\u62c9\u91cc\u7ade\u9009\u56e2\u961f\u79f0\u5176\u5b8c\u5168\u5065\u5eb7 \u5c06\u91cd\u8fd4\u7ade\u9009\u6d3b\u52a8', '\u5e0c\u62c9\u91cc\u8001\u77e3,\u5c1a\u80fd\u201c\u9009\u201d\u5426?', '\u5e0c\u62c9\u91cc\u9886\u5148\u4f18\u52bf\u7f29\u5c0f', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u6652\u4f53\u68c0\u5355\uff1a\u4e00\u4e2a\u80ba\u708e \u4e00\u4e2a\u80c6\u56fa\u9187\u9ad8', '\u4e0d\u662f\u4e0d\u6cbb\u4e4b\u75c7\uff0c\u5e0c\u62c9\u91cc\u4e0d\u81f3\u4e8e\u5f03\u9009', '\u83f2\u65b0\u603b\u7edf\u5c61\u6b21\u88ab\u4e0e\u7279\u6717\u666e\u505a\u5bf9\u6bd4\uff1f \u767d\u5bab\u5982\u6b64\u8bf4', '\u524d\u56fd\u52a1\u537f\u9c8d\u5a01\u5c14\uff1a\u7279\u6717\u666e\u662f\u4e00\u4e2a\u56fd\u9645\u6076\u68cd', '\u7279\u6717\u666e\u767d\u5bab\u9644\u8fd1\u5f00\u9152\u5e97', '\u7279\u6717\u666e\u6709\u94b1', '\u5e0c\u62c9\u91cc\uff0c\u4f60\u6ca1\u4e8b\u5427\uff1f', '\u5e0c\u62c9\u91cc\uff1a\u201c\u4e0d\u5065\u5eb7\u201d\u7684\u5230\u5e95\u662f\u4ec0\u4e48', '\u5e0c\u62c9\u91cc\uff1a\u65e0\u5176\u4ed6\u75be\u75c5\u53ef\u9690\u7792 \u7279\u6717\u666e\uff1a\u521a\u505a\u4f53\u68c0\u7ed3\u679c\u826f\u597d', '\u5e0c\u62c9\u91cc\uff1a\u53ea\u662f\u80ba\u708e\uff0c\u6ca1\u5927\u4e8b\u513f', '\u5e0c\u62c9\u91cc\u8eab\u8fb9\u795e\u79d8\u5973\u5b50\u662f\u201c\u4fbf\u8863\u533b\u751f\u201d\uff1f', '\u5e0c\u62c9\u91cc\u8c08\u5065\u5eb7\u72b6\u51b5\uff1a\u53ea\u662f\u80ba\u708e\uff0c\u6ca1\u5927\u4e8b', '\u5e0c\u62c9\u91cc\u56e0\u80ba\u708e\u9759\u517b\u6570\u65e5 \u5c06\u4e8e15\u65e5\u6062\u590d\u7ade\u9009\u6d3b\u52a8', '\u201c9\xb711\u201d\u6d3b\u52a8\u5e0c\u62c9\u91cc\u201c\u75c5\u9000\u201d', '\u4e92\u6252\u201c\u9ed1\u5386\u53f2\u201d \u4e00\u8def\u6390\u5230\u5e95', '\u7f8e\u56fd\u5927\u9009\uff1a\u4e00\u4e2a\u8eab\u4f53\u6709\u95ee\u9898\uff0c\u4e00\u4e2a\u7cbe\u795e\u6709\u95ee\u9898', '\u5916\u5a92:\u5e0c\u62c9\u91cc\u660f\u53a5\u4ee4\u5927\u9009\u751f\u53d8 \u4f20\u95fb\u5c06\u627e\u5019\u9009\u66ff\u8865', '\u4e07\u4e00\u5e0c\u62c9\u91cc\u201c\u75c5\u9000\u201d  \u6c11\u4e3b\u515a\u8be5\u600e\u4e48\u529e\uff1f', '\u5e0c\u62c9\u91cc\u5065\u5eb7\u8bae\u9898\u6210\u7f8e\u9009\u6218\u7126\u70b9 \u7279\u6717\u666e\u5ba1\u614e\u5e94\u5bf9', '\u8981\u94b1\u4e0d\u8981\u547d\uff01\u5e0c\u62c9\u91cc\u65e5\u5747\u7b79550\u4e07\u7f8e\u5143\u7d2f\u51fa\u80ba\u708e', '\u7f8e\u56fd\u6c11\u4e3b\u515a\u603b\u7edf\u5019\u9009\u4eba\u5e0c\u62c9\u91cc\u53d6\u6d88\u897f\u6d77\u5cb8\u884c\u7a0b', '\u7279\u6717\u666e\uff1a\u5e0c\u671b\u5e0c\u62c9\u91cc\u5c3d\u5feb\u597d\u8d77\u6765', '\u5e0c\u62c9\u91cc\u53c2\u52a0911\u7eaa\u5ff5\u6d3b\u52a8\u63d0\u524d\u9000\u573a \u533b\u751f\u79f0\u60a3\u80ba\u708e', '\u5e0c\u62c9\u91cc\u51fa\u5e2d\u201c9\xb711\u201d\u7eaa\u5ff5\u6d3b\u52a8\u63d0\u524d\u79bb\u573a \u533b\u751f\u79f0\u5176\u60a3\u80ba\u708e', '\u5e0c\u62c9\u91cc\u7684\u8fd9\u6b21\u8dcc\u5012 \u7f8e\u56fd\u5927\u9009\u5f62\u52bf\u6216\u5c06\u5c31\u6b64\u9006\u8f6c', '\u5e0c\u62c9\u91cc\u6076\u8bc4\u7279\u6717\u666e\u7c89\u4e1d\uff1a\u534a\u6570\u90fd\u662f\u53ef\u60b2\u4e4b\u4eba', '\u5e0c\u62c9\u91cc\u5931\u8a00,\u7279\u6717\u666e\u6293\u628a\u67c4', '\u5e0c\u62c9\u91cc\u56e0\u75c5\u53d6\u6d8812\u65e5\u6d3b\u52a8\uff1a\u60a3\u80ba\u708e\u9075\u533b\u5631\u4f11\u606f', '\u5e0c\u62c9\u91cc\u56e0\u75c5\u53d6\u6d88\u6d3b\u52a8 \u7279\u6717\u666e\u79f0\u5176\u6ca1\u4f53\u529b\u5f53\u603b\u7edf', '\u7279\u6717\u666e\u7ade\u9009\u642d\u6863\u6652\u7eb3\u7a0e\u5355 \u5e0c\u62c9\u91cc\u6b64\u524d\u66fe\u591a\u6b21\u63d0\u8d77', '\u6269\u519b!\u589e\u52a0\u56fd\u9632\u9884\u7b97!', '\u58a8\u8d22\u957f\u4e0b\u53f0 \u7686\u56e0\u7279\u6717\u666e\uff1f', '\u7279\u6717\u666e\u76db\u8d5e\u666e\u4eac\u5e0c\u62c9\u91cc\u6279\u4ed6\u201c\u4e0d\u7231\u56fd!\u201d', '\u7279\u6717\u666e\u76db\u8d5e\u666e\u4eac\u906d\u5e0c\u62c9\u91cc\u72c2\u201c\u55b7\u201d\uff1a\u4f60\u4e0d\u7231\u56fd', '\u7279\u6717\u666e\u63a8\u51fa\u5927\u89c4\u6a21\u6269\u519b\u4e3b\u5f20\u7b3c\u7edc\u519b\u4eba\u9009\u6c11', '\u7279\u6717\u666e\u516c\u5f00\u6f14\u8bb2\u518d\u8d5e\u666e\u4eac:\u4ed6\u5f53\u603b\u7edf\u6bd4\u5965\u5df4\u9a6c\u5f3a', '\u7279\u6717\u666e\u626c\u8a00\u5927\u5e45\u589e\u52a0\u9632\u52a1\u9884\u7b97', '\u7279\u6717\u666e\u626c\u8a00\u5927\u589e\u9632\u52a1\u9884\u7b97 \u81ea\u79f0\u6b32\u5148\u5feb\u901f\u51fb\u8d25IS', '\u5e0c\u62c9\u91cc\u5fd9\u81ea\u8fa9\uff0c\u7279\u6717\u666e\u8d5e\u666e\u4eac', '\u7f8e\u56fd\u5927\u9009\u4e92\u9ed1\u5347\u7ea7 \u7279\u6717\u666e\u79f0\u5e0c\u62c9\u91cc\u6ca1\u603b\u7edf\u76f8', '\u7f8e\u5a92\uff1a\u58a8\u897f\u54e5\u8d22\u653f\u90e8\u957f\u56e0\u9080\u8bf7\u7279\u6717\u666e\u5230\u8bbf\u8f9e\u804c', '\u7279\u6717\u666e\uff1a\u82e5\u5f53\u9009\u5c06\u589e\u52a0\u519b\u8d39 \u9650\u65f6\u62df\u5b9a\u51fb\u8d25IS\u8ba1\u5212', '\u7279\u6717\u666e\u79f0\u82e5\u5f53\u9009\u5c06\u6269\u5927\u519b\u8d39\u652f\u51fa\u548c\u519b\u961f\u89c4\u6a21', '\u7279\u6717\u666e\u5e0c\u62c9\u91cc\u6fc0\u8fa9\u56fd\u5b89\u95ee\u9898 \u4e92\u65a5\u5bf9\u65b9\u7f3a\u9886\u8896\u54c1\u8d28', '\u7279\u6717\u666e\u518d\u5938\u666e\u4eac\uff1a\u4ed6\u6bd4\u5965\u5df4\u9a6c\u5f3a\u591a\u4e86', '\u7f8e\u56fd\u7b2c\u4e00\u592b\u4eba\u7c73\u6b47\u5c14\u51fa\u9a6c \u52a9\u5e0c\u62c9\u91cc\u62a2\u653b\u5973\u6027\u9009\u7968', '\u5e0c\u62c9\u91cc\u6c11\u8c03\u843d\u540e\u618b\u4e0d\u4f4f\u201c\u653e\u5927\u62db\u201d\u5168\u529b\u731b\u653b\u7279\u6717\u666e(\u56fe)', '\u9762\u5bf9\u8c03\u67e5,\u5e0c\u62c9\u91cc\u7b54\u51fa39\u4e2a\u201c\u4e0d\u8bb0\u5f97\u201d', '\u7279\u6717\u666e\u5c06\u4eba\u6027\u5316\u5bf9\u5f85\u975e\u6cd5\u79fb\u6c11 \u907f\u8c08\u5168\u9762\u9063\u8fd4', '\u7279\u6717\u666e\u5f8b\u5e08\u53d1\u73b0\u201c\u7279\u6717\u666e\u5934\u50cf\u201d\u767d\u4e91\uff1a\u4e0a\u5e1d\u8bf4\u5c31\u662f\u4ed6\uff01', '\u5e0c\u62c9\u91cc\u6f14\u8bb2\u671f\u95f4\u54b3\u55fd\u4e0d\u6b62 \u81ea\u5632\u5bf9\u7279\u6717\u666e\u8fc7\u654f(\u56fe)', 'FBI\u516c\u5f00\u201c\u90ae\u4ef6\u95e8\u201d\u62a5\u544a\u6307\u5e0c\u62c9\u91cc\u201c\u5927\u610f\u201d', 'FBI\u516c\u5f00\u5e0c\u62c9\u91cc\u90ae\u4ef6\u95e8\u62a5\u544a \u79f0\u5176\u201c\u6781\u7aef\u5927\u610f\u201d', '\u201c\u6838\u6309\u94ae\u4ea4\u7ed9\u7279\u6717\u666e \u5b9e\u5728\u4fe1\u4e0d\u8fc7\u201d', 'FBI:\u201c\u654c\u5bf9\u5916\u56fd\u4eba\u201d\u4fb5\u5165\u4e0e\u5e0c\u62c9\u91cc\u6709\u6765\u5f80\u4eba\u7684\u90ae\u7bb1 \u5e76\u7a83\u5176\u90ae\u4ef6', 'FBI\uff1a\u672a\u627e\u5230\u5e0c\u62c9\u91cc\u90ae\u7bb1\u88ab\u5165\u4fb5\u8bc1\u636e \u4f46\u4e0d\u80fd\u6392\u9664\u53ef\u80fd\u6027', 'FBI\u516c\u5e03\u5e0c\u62c9\u91cc\u90ae\u4ef6\u95e8\u8c03\u67e5\u62a5\u544a \u5927\u91cf\u6bb5\u843d\u88ab\u62b9\u53bb', 'FBI\u516c\u5f00\u5e0c\u62c9\u91cc\u90ae\u4ef6\u95e8\u90e8\u5206\u8c03\u67e5\u62a5\u544a \u4e0d\u5efa\u8bae\u63d0\u5211\u4e8b\u6307\u63a7', '\u6838\u6309\u94ae\u7ed9\u7279\u6717\u666e\u62dc\u767b\u8868\u793a\u4e0d\u653e\u5fc3', '\u7279\u6717\u666e\u592b\u4eba\u72b6\u544a\u300a\u6bcf\u65e5\u90ae\u62a5\u300b', '\u5e0c\u62c9\u91cc\u72c2\u63fd\u5de8\u989d\u6350\u6b3e', '\u7279\u6717\u666e\u8bbf\u95ee\u58a8\u897f\u54e5\u5f15\u8d77\u4f17\u6012', '\u7279\u6717\u666e\u5c06\u51fa\u5341\u62db\u904f\u5236\u975e\u6cd5\u79fb\u6c11 \u58a8\u897f\u54e5\u62d2\u51fa\u94b1\u914d\u5408', '\u5e0c\u62c9\u91cc8\u6708\u7ade\u9009\u7b79\u6b3e1.43\u4ebf\u7f8e\u5143 \u521b\u4e2a\u4eba\u6700\u4f73\u7eaa\u5f55', '\u5e0c\u62c9\u91cc\u5378\u4efb\u56fd\u52a1\u537f\u540e\u4ecd\u6d89\u90ae\u4ef6\u6cc4\u5bc6 \u906d\u5171\u548c\u515a\u62a8\u51fb', '\u79fb\u6c11\u653f\u7b56\u4e0d\u6539\u7279\u6717\u666e\u518d\u201c\u800d\u786c\u201d', '\u5fb7\u5916\u957f\u6279\u7279\u6717\u666e\u662f\u201c\u6bd2\u836f\u201d', '\u96f6\u5bb9\u5fcd\uff01\u7279\u6717\u666e\u5ba3\u5e03\u79fb\u6c11\u653f\u7b56\uff1a\u5c06\u8fc5\u901f\u9063\u8fd4\u975e\u6cd5\u79fb\u6c11', '\u6c11\u8c03\u79f0\u7f8e\u5927\u9009\u7279\u6717\u666e\u652f\u6301\u7387\u53cd\u8d85\u5e0c\u62c9\u91cc \u4ecd\u6709\u80dc\u7b97', '\u7279\u6717\u666e\u53d1\u8868\u79fb\u6c11\u653f\u7b56\u6f14\u8bb2\uff1a\u4e0d\u4f1a\u5927\u8d66\u975e\u6cd5\u79fb\u6c11', '\u7279\u6717\u666e\u53d1\u8868\u79fb\u6c11\u653f\u7b56\u6f14\u8bf4\u524d\u8bbf\u95ee\u58a8\u897f\u54e5', '\u7279\u6717\u666e\u89c1\u58a8\u603b\u7edf\u3000\u4e3a\u8bb2\u548c\u8fd8\u4e3a\u78b0\u786c\uff1f', '\u7279\u6717\u666e\u89c1\u58a8\u603b\u7edf\u60f3\u8bb2\u548c', '\u201c\u5973\u5a7f\u201d\u7325\u4eb5\u7167\u4f24\u5230\u5e0c\u62c9\u91cc', '\u5e0c\u62c9\u91cc\u5e72\u5c06\u4e0e\u4e08\u592b\u5206\u5c45', '\u4e00\u5fcd\u518d\u5fcd\u4e4b\u540e\uff0c\u5e0c\u62c9\u91cc\u8eab\u540e\u7684\u5973\u4eba\u5982\u4f55\u5904\u7406\u5bb6\u4e11\uff1f', '\u7f8e\u56fd\u5927\u9009\u524d70\u5929\u7279\u6717\u666e\u9009\u60c5\u544a\u6025 \u5e0c\u62c9\u91cc\u6c11\u610f\u9886\u5148', '\u7f8e\u56fd\u4f5c\u5bb6\u8fde\u7eed\u51fa\u4e66\u4e13\u9ed1\u5e0c\u62c9\u91cc \u96c6\u4e2d\u8c08\u8bba\u201c\u90ae\u4ef6\u95e8\u201d\u771f\u76f8', '\u7279\u6717\u666e\u79f0\u82e5\u5f53\u9009\u5c06\u8a93\u8a00\u6253\u51fb\u975e\u6cd5\u79fb\u6c11', '\u7279\u6717\u666e\u7684\u5899', '\u7b11\u9762\u864eor\u9b3c\u89c1\u6101\uff0c\u4f60\u66f4\u559c\u6b22\u54ea\u4e00\u6b3e\u4e0a\u53f8\u5462', '\u7f8e\u65b0\u4e66\u66dd\u5e0c\u62c9\u91cc\u201c\u53db\u56fd\u5f0f\u8d2a\u6c61\u201d \u6216\u6405\u52a8\u5927\u9009\u9009\u60c5', '\u201c\u6350\u6b3e\u95e8\u201d\u5bf9\u5e0c\u62c9\u91cc\u6740\u4f24\u529b\u6709\u9650', '\u5b98\u4e8c\u4ee3\u201d\u73a9\u706b \u7279\u6717\u666e\u6413\u706b', '\u6c11\u8c03\uff1a\u5e0c\u62c9\u91cc\u652f\u6301\u5ea6\u9996\u89c1\u7834\u4e94\u6210 \u9065\u9065\u9886\u5148\u7279\u6717\u666e', '\u5e0c\u62c9\u91cc\u6279\u7279\u6717\u666e\u5c06\u4ec7\u6068\u4e3b\u6d41\u5316 \u7279\u6717\u666e\u79f0\u5176\u987d\u56fa', '\u201c\u90ae\u4ef6\u95e8\u201d\u672a\u5b8c \u5e0c\u62c9\u91cc\u53c8\u9677\u732e\u91d1\u4e11\u95fb', '\u7f8e\u56fd\u5927\u9009\u5e0c\u62c9\u91cc\u5728\u5173\u952e\u6447\u6446\u5dde\u9886\u5148\u7279\u6717\u666e', '\u7f8e\u519b\u5185\u90e8\u57f9\u8bad\u6750\u6599\u5916\u6cc4  \u5e0c\u62c9\u91cc\u88ab\u5047\u5b9a\u4e3a\u5a01\u80c1\u5bf9\u8c61', '\u7f8e\u519b\u5185\u90e8\u57f9\u8bad\u8d44\u6599\u5c06\u5e0c\u62c9\u91cc\u63cf\u8ff0\u4e3a\u7f8e\u56fd\u5bb6\u5b89\u5168\u5a01\u80c1', '\u7279\u6717\u666e:\u514b\u6797\u987f\u57fa\u91d1\u4f1a\u4e3a\u201c\u653f\u6cbb\u53f2\u4e0a\u6700\u8150\u8d25\u673a\u6784\u201d', '\u7279\u6717\u666e\u592b\u4eba\u6885\u62c9\u5c3c\u5a05\u88ab\u6307\u201c\u5e94\u53ec\u5973\u201d', '\u7279\u6717\u666e\u518d\u6b21\u8868\u8fbe\u5bf9\u534e\u8d38\u6613\u5f3a\u786c\u7acb\u573a \u5a01\u80c1\u5f81\u6536\u9ad8\u989d\u5173\u7a0e', '\u5916\u5a92\uff1a\u7279\u6717\u666e\u5c06\u6539\u53d8\u81ea\u8eab\u79fb\u6c11\u653f\u7b56 \u63d0\u201c\u4eba\u9053\u9ad8\u6548\u201d', '\u5e0c\u62c9\u91cc\u201c\u90ae\u4ef6\u95e8\u201d\uff1a\u9009\u4e3e\u653f\u6cbb\u91cc\u7684\u70ed\u95f9\u4e0e\u8352\u8bde', '\u5e0c\u62c9\u91cc\u8d74\u52a0\u5dde3\u5929\u603b\u8ba1\u52df\u6b3e1800\u4e07\u7f8e\u5143', '\u82f1\u56fd\u8131\u6b27\u6d3e\u5927\u5c06\u6cd5\u62c9\u5947\u4e3a\u7279\u6717\u666e\u7ad9\u53f0 \u53d1\u58f0\u529b\u633a', '\u53c8\u8981\u7206\u6599\uff1f\u963f\u6851\u5947\uff1a\u5c06\u516c\u5e03\u5e0c\u62c9\u91cc\u7ade\u9009\u91cd\u5927\u8d44\u8baf', '\u7f8e\u56fd\u524d\u603b\u7edf\u5361\u7279\uff1a\u5e0c\u62c9\u91cc\u548c\u7279\u6717\u666e\u5747\u4e0d\u53d7\u6b22\u8fce', '\u7f8e\u603b\u7edf\u5019\u9009\u4eba\u653b\u575a\u6218 \u7279\u6717\u666e\u79f0\u5e0c\u62c9\u91cc\u201c\u91cd\u75c5\u7f20\u8eab\u201d', '\u7279\u6717\u666e\uff1a\u5979\u6709\u75c5\u5e0c\u62c9\u91cc\uff1a\u4ed6\u4f20\u8c23', '\u7279\u6717\u666e\u62ff\u5065\u5eb7\u95ee\u9898\u201c\u8bf4\u4e8b\u201d\u5e0c\u62c9\u91cc\u4ee5\u5f92\u624b\u5f00\u7f50\u5934\u56de\u5e94', '\u7279\u6717\u666e\u62ff\u5e0c\u62c9\u91cc\u5065\u5eb7\u95ee\u9898\u201c\u8bf4\u4e8b\u201d', '\u7279\u6717\u666e\u5ef6\u540e\u79fb\u6c11\u653f\u7b56\u6f14\u8bf4 \u7f8e\u5a92\uff1a\u6216\u6539\u53d8\u5f3a\u786c\u7acb\u573a', '\u5e0c\u62c9\u91cc\u9996\u6b21\u56de\u5e94\u201c\u5065\u5eb7\u6709\u95ee\u9898\u201d \u5f92\u624b\u5f00\u7f50\u5934\u8f9f\u8c23', '\u5e0c\u62c9\u91cc\u5f92\u624b\u5f00\u7f50\u9996\u56de\u5e94\u201c\u5065\u5eb7\u95e8\u201d', '\u7f8e\u56fd\u548c\u5fb7\u56fd\u6570\u5bb6\u535a\u7269\u9986\u51c6\u5907\u5c55\u51fa\u7279\u6717\u666e\u88f8\u4f53\u96d5\u50cf', '\u7f8e\u8054\u90a6\u8c03\u67e5\u5c40\u53d1\u73b01.5\u4e07\u5c01\u5e0c\u62c9\u91cc\u672a\u88ab\u516c\u5f00\u7535\u90ae', '\u7f8e\u8054\u90a6\u8c03\u67e5\u5c40\u53d1\u73b01.5\u4e07\u5c01\u5e0c\u62c9\u91cc\u672a\u88ab\u516c\u5f00\u7535\u90ae', '\u7279\u6717\u666e\uff0c\u505a\u56de\u201c\u6076\u68cd\u201d\u624d\u53eb\u723d', '\u7279\u6717\u666e\uff1a\u9063\u8fd4\u975e\u6cd5\u79fb\u6c11\u65e2\u4e0d\u53ef\u80fd\u4e5f\u4e0d\u4eba\u9053', '\u7279\u6717\u666e\u547c\u5401\u4efb\u547d\u5355\u72ec\u68c0\u5bdf\u5b98\u8c03\u67e5\u5e0c\u62c9\u91cc\u6848\u4ef6', '\u7279\u6717\u666e\u6b20\u503a6.5\u4ebf\u7f8e\u5143', '\u7279\u6717\u666e\u5728\u79fb\u6c11\u95ee\u9898\u4e0a\u201c\u670d\u8f6f\u201d\uff1f', '\u6cd5\u5b98\u88c1\u5b9a\u5e0c\u62c9\u91cc\u65e0\u9700\u5c31\u201c\u90ae\u4ef6\u95e8\u201d\u51fa\u5ead\u4f5c\u8bc1', '\u7f8e\u6cd5\u9662\u6cd5\u5b98\u8981\u6c42\u5e0c\u62c9\u91cc\u4e66\u9762\u56de\u5e94\u201c\u90ae\u4ef6\u95e83.0\u201d', '\u7f8e\u5a92\u66dd\u7279\u6717\u666e\u4f01\u4e1a\u8d1f\u503a6.5\u4ebf\u7f8e\u5143 \u503a\u4e3b\u542b\u4e2d\u56fd\u6700\u5927\u94f6\u884c', '\u7279\u6717\u666e\u652f\u6301\u7387\u843d\u540e \u4e89\u53d6\u975e\u6d32\u4e0e\u62c9\u7f8e\u88d4\u9009\u6c11\u652f\u6301', '\u7279\u6717\u666e\u7ade\u9009\u7ecf\u7406\u8f9e\u804c', '\u7279\u6717\u666e\u7ade\u9009\u7ecf\u7406\u6d89\u6536\u53d7\u94b1\u8d22\u8f9e\u804c', '\u201c\u5927\u5634\u201d\u7279\u6717\u666e\u5c61\u906d\u201c\u6076\u641e\u201d', '\u514b\u6797\u987f\uff1a\u82e5\u5e0c\u62c9\u91cc\u5f53\u9009\u603b\u7edf \u6211\u9000\u51fa\u514b\u6797\u987f\u57fa\u91d1\u4f1a', '\u7279\u6717\u666e\uff1a\u201c\u5bf9\u4e0d\u8d77\uff0c\u6211\u8bf4\u9519\u8bdd\u4e86\u201d', '\u7279\u6717\u666e\u7ade\u9009\u56e2\u961f\u4e3b\u5e2d\u8f9e\u804c \u9ad8\u5c42\u4e24\u4e2a\u6708\u5185\u4e09\u6b21\u52a8\u8361', '\u7279\u6717\u666e\u4e3a\u201c\u5927\u5634\u4f24\u4eba\u201d\u9053\u6b49 \u5e0c\u62c9\u91cc\u9635\u8425\u55e4\u4e4b\u4ee5\u9f3b', '\u8c03\u6574\u7b56\u7565\uff0c\u7279\u6717\u666e\u7f55\u89c1\u4e3a\u201c\u5927\u5634\u201d\u9053\u6b49', '\u62dc\u767b\u201c\u957f\u957f\u7684\u62e5\u62b1\u201d\u8ba9\u5e0c\u62c9\u91cc\u6709\u70b9\u5c34\u5c2c', '\u8001\u81e3+\u5973\u5c06=\u5e0c\u62c9\u91cc\u8fc7\u6e21\u56e2\u961f', '\u7279\u6717\u666e\u518d\u6362\u7ade\u9009\u7ecf\u7406', '\u518d\u6362\u7ade\u9009\u7ecf\u7406\uff0c\u7279\u6717\u666e\u91cd\u56de\u201c\u5927\u5634\u201d\u5957\u8def\uff1f', '\u652f\u6301\u7387\u6301\u7eed\u4e0b\u6ed1\u7279\u6717\u666e\u6362\u7ade\u9009\u7ecf\u7406', '\u8ddd\u7f8e\u56fd\u5927\u9009\u65e5\u8fd8\u670982\u5929 \u7279\u6717\u666e\u518d\u6b21\u6539\u7ec4\u7ade\u9009\u56e2\u961f', '\u5a92\u4f53\u548c\u7279\u6717\u666e\u6760\u4e0a\u4e86_fina', '\u5e0c\u62c9\u91cc\u6210\u7acb\u201c\u653f\u6743\u4ea4\u63a5\u56e2\u961f\u201d', '\u5e0c\u62c9\u91cc\u7ec4\u767d\u5bab\u8fc7\u6e21\u56e2\u961f', '\u300a\u534e\u5c14\u8857\u65e5\u62a5\u300b\u8b66\u544a\u7279\u6717\u666e', '\u5965\u5df4\u9a6c\u5ea6\u5047\u65f6\u4e3a\u5e0c\u62c9\u91cc\u52a9\u9009 \u8bbd\u7279\u6717\u666e\u81ea\u635f\u9009\u60c5', '\u7f8e\u56fd\u5171\u548c\u515a\u516b\u540d\u4e9a\u6d32\u4e8b\u52a1\u4e13\u5bb6\u5012\u6208\u652f\u6301\u5e0c\u62c9\u91cc', '\u7f8e\u5a92\uff1a\u5e0c\u62c9\u91cc\u5973\u513f\u548c\u7279\u6717\u666e\u5973\u513f\u662f\u95fa\u871c', '\u7279\u6717\u666e\u79f0\u5e94\u5bf9\u79fb\u6c11\u505a\u610f\u8bc6\u5f62\u6001\u7b5b\u67e5\u906d\u5a92\u4f53\u62a8\u51fb', '\u7279\u6717\u666e\u6536\u4e4c\u4eb2\u4fc4\u653f\u515a\u5343\u4e07\u7f8e\u5143\uff1f', '\u5e0c\u62c9\u91cc\u6210\u7acb\u201c\u653f\u6743\u4ea4\u63a5\u56e2\u961f\u201d \u51c6\u5907\u5165\u4e3b\u767d\u5bab', '\u7279\u6717\u666e\uff1a\u82e5\u5a92\u4f53\u8bda\u5b9e\u62a5\u9053 \u652f\u6301\u7387\u4f1a\u8d85\u5e0c\u62c9\u91cc20%', '\u7279\u6717\u666e\u8c08\u53cd\u6050\u6218\u7565\uff1a\u62df\u201c\u6700\u5927\u9650\u5ea6\u5ba1\u67e5\u201d\u79fb\u6c11', '\u7279\u6717\u666e\u5916\u4ea4\u653f\u7b56\u51fa\u7089\uff1a\u4ee5\u53cd\u6050\u5212\u5b9a\u76df\u53cb \u4e25\u63a7\u79fb\u6c11', '\u7279\u6717\u666e\u4e0e\u300a\u7ebd\u7ea6\u65f6\u62a5\u300b\u6253\u5634\u4ed7', '\u5916\u5a92\uff1aFBI\u5c06\u628a\u5e0c\u62c9\u91cc\u7535\u90ae\u4e11\u95fb\u8c03\u67e5\u6750\u6599\u79fb\u4ea4\u56fd\u4f1a', '\u5e0c\u62c9\u91cc\u6652\u6536\u5165 \u7279\u6717\u666e\u8eb2\u732b\u732b', '\u5e0c\u62c9\u91cc\u6652\u6536\u5165\u201c\u6597\u201d\u7279\u6717\u666e', '70\u540d\u7f8e\u56fd\u5171\u548c\u515a\u4eba\u8054\u540d\u8981\u6c42\u505c\u6b62\u652f\u6301\u7279\u6717\u666e', '\u5e0c\u62c9\u91cc\u516c\u5f00\u62a5\u7a0e\u60c5\u51b5 \u6307\u8d23\u7279\u6717\u666e\u9690\u7792\u4e2a\u4eba\u4fe1\u606f', '\u5e0c\u62c9\u91cc\u660e\u786e\u8868\u793a\u53cd\u5bf9TPP', '\u5e0c\u62c9\u91cc\u660e\u786e\u53cd\u5bf9TPP\u5f53\u9009\u603b\u7edf\u540e\u4ecd\u4f1a\u575a\u6301', '\u5e0c\u62c9\u91cc\u906d\u201c\u90ae\u4ef6\u95e8\u201d\u6253\u51fb \u88ab\u9886\u4e8b\u9986\u88ad\u51fb\u4e8b\u4ef6\u6b7b\u8005\u5bb6\u5c5e\u63d0\u8d77\u8bc9\u8bbc', '\u9f13\u52b1\u67aa\u6740\u5e0c\u62c9\u91cc?\u7279\u6717\u666e\u906d\u201c\u70ae\u8f70\u201d', '\u547c\u5401\u6697\u6740\u5e0c\u62c9\u91cc\uff1f\uff01\u770b\u7279\u6717\u666e\u5982\u4f55\u7528\u5927\u5634\u8017\u5c3d\u5927\u9009\u8840\u69fd', '\u7f8e\u56fd\u5927\u9009\uff1a\u7279\u6717\u666e\u6307\u5965\u5df4\u9a6c\u662f\u6781\u7aef\u7ec4\u7ec7\u521b\u529e\u4eba', '\u7f8e\u56fd\u5171\u548c\u515a50\u540d\u56fd\u5bb6\u5b89\u5168\u4e13\u5bb6\u8054\u540d\u53cd\u5bf9\u7279\u6717\u666e', '\u7537\u5b50\u53d8\u201c\u8718\u86db\u4fa0\u201d\u7528\u6500\u722c\u7279\u6717\u666e\u5927\u53a6 \u88ab\u8b66\u65b9\u902e\u6355', '\u7279\u6717\u666e\u6697\u793a\u523a\u6740\u5e0c\u62c9\u91cc\u5728\u7f8e\u70b8\u7a9d \u6709\u5a92\u4f53\u8981\u5176\u9000\u9009', '\u7279\u6717\u666e\u88ab\u6307\u717d\u52a8\u6c11\u4f17\u653b\u51fb\u5e0c\u62c9\u91cc \u6fc0\u70c8\u8a00\u8bba\u906d\u6279\u8bc4', '\u7279\u6717\u666e\u5927\u5634\u53c8\u95ef\u7978\uff0c\u9f13\u52b1\u67aa\u6740\u5e0c\u62c9\u91cc\uff1f', '\u5e0c\u62c9\u91cc\u88ab\u8d77\u8bc9\u201c\u81f4\u6b7b\u4eba\u547d\u201d', '\u5e0c\u62c9\u91cc\u56de\u5e94\u7279\u6717\u666e\u6fc0\u70c8\u8a00\u8bba \u75db\u6279\u5176\u201c\u903e\u8d8a\u5e95\u7ebf\u201d', '\u7f8e\u56fd2.5\u4e07\u6c11\u4f17\u8bf7\u613f\u8981\u6c42\u7279\u6717\u666e\u68c0\u67e5\u662f\u5426\u60a3\u81ea\u604b\u75c7', '\u7279\u6717\u666e\u7ecf\u6d4e\u653f\u7b56\u4f53\u73b0\u201c\u7f8e\u56fd\u4f18\u5148\u201d \u906d\u4e13\u5bb6\u6279\u8bc4', '\u7279\u6717\u666e\u5973\u513f\u8981\u5751\u7239', '\u7279\u6717\u666e\u5ba3\u5e03\u5168\u9762\u51cf\u7a0e\u7ade\u9009\u4e3b\u5f20', '\u5e0c\u62c9\u91cc\u9635\u8425\u7ade\u9009\u7535\u89c6\u5e7f\u544a\u8d39\u5df2\u8fbe8900\u4e07\u7f8e\u5143', '\u6c11\u8c03\uff1a\u5e0c\u62c9\u91cc\u9886\u8dd1\u7279\u6717\u666e', '\u7279\u6717\u666e\u540e\u9662\u518d\u8d77\u706b\uff1a\u906d50\u540d\u5171\u548c\u515a\u5927\u4f6c\u8054\u540d\u53cd\u5bf9', '\u73b0\u5b9e\u7248\u7eb8\u724c\u5c4b\uff1f\u7f8e\u5a92\u79f0\u53cd\u5e0c\u62c9\u91cc\u8005\u76f8\u7ee7\u6b7b\u4ea1', '\u82f1\u5a92:\u7279\u6717\u666e\u88ab\u66dd\u9003\u7a0e\u6570\u5343\u4e07\u7f8e\u5143 \u6216\u5c06\u51fa\u5ead\u53d7\u5ba1', '\u7f8e\u56fd\u5927\u9009\u6700\u65b0\u6c11\u8c03\uff1a\u5e0c\u62c9\u91cc\u9886\u5148\u7279\u6717\u666e8\u4e2a\u767e\u5206\u70b9', '\u7279\u6717\u666e\uff1a\u201c\u4f0a\u65af\u5170\u56fd\u201d\u5e0c\u671b\u5e0c\u62c9\u91cc\u6210\u4e3a\u7f8e\u56fd\u603b\u7edf', '\u5e0c\u62c9\u91cc\u6f14\u8bb2\u53e3\u8bef\u8fde\u8fde\uff1a\u7279\u6717\u666e\u53d8\u6210\u201c\u6211\u7684\u4e08\u592b\u201d', '\u5e0c\u62c9\u91cc\u6b32\u62c9\u62e2\u5bf9\u624b\u9635\u8425\u9009\u6c11\uff1a\u7231\u56fd\u5c31\u53ea\u80fd\u9009\u6211', '\u8bf1\u201c\u654c\u201d\u5012\u6208 \u5e0c\u62c9\u91cc\u6316\u5899\u811a', '\u7279\u6717\u666e\uff1a\u7f8e\u56fd11\u6708\u5927\u9009\u5fc5\u5b58\u821e\u5f0a', '\u7279\u6717\u666e\u59bb\u5b50\u62cd\u88f8\u7167\u65f6\u7b7e\u8bc1\u5b58\u7591\u70b9 \u88ab\u6307\u6253\u9ed1\u5de5', '\u5965\u5df4\u9a6c\uff1a\u7279\u6717\u666e\u4e0d\u9002\u5408\u5f53\u603b\u7edf', '\u6c11\u8c03\uff1a\u5e0c\u62c9\u91cc\u58f0\u52bf\u56de\u5347 \u9886\u5148\u7279\u6717\u666e10\u4e2a\u767e\u5206\u70b9', '\u7279\u6717\u666e\u56de\u5e94\u5965\u5df4\u9a6c\u6307\u8d23\uff1a\u4f60\u662f\u53f2\u4e0a\u6700\u5dee\u7f8e\u56fd\u603b\u7edf', '\u7279\u6717\u666e\u5f3a\u786c\u56de\u51fb\u5965\u5df4\u9a6c\uff1a\u4f60\u662f\u7f8e\u56fd\u53f2\u4e0a\u6700\u5dee\u9886\u5bfc\u4eba', '\u5965\u5df4\u9a6c\u6279\u7279\u6717\u666e\u4e0d\u9002\u5408\u4efb\u603b\u7edf \u7279\u6717\u666e:\u4f60\u624d\u5931\u8d25', '\u5965\u6717\u5fb7\uff1a\u7279\u6717\u666e\u7684\u6781\u7aef\u8a00\u8bba\u4ee4\u4eba\u4f5c\u5455', '\u5df4\u83f2\u7279\u558a\u8bdd\u7279\u6717\u666e\u4e00\u8d77\u6652\u7a0e\u5355', '\u5df4\u83f2\u7279\u529b\u633a\u5e0c\u62c9\u91cc\u5355\u6311\u7279\u6717\u666e \u7ea6\u5bf9\u65b9\u4e92\u67e5\u7eb3\u7a0e\u5355', '\u5df4\u83f2\u7279\u6b32\u201c\u5355\u6311\u201d\u7279\u6717\u666e', '\u4e92\u67e5\u62a5\u7a0e\u5355 \u7ea6\u5417\uff1f', '\u91cc\u7ea6\u5965\u8fd0\u4f1a\u5f00\u5e55\u5f0f \u201c\u6700\u6027\u611f\u201dor\u201c\u6700\u5947\u8469\u201d\uff1f', '\u7f8e\u603b\u7edf\u5965\u5df4\u9a6c\uff1a\u7279\u6717\u666e\u6ca1\u6709\u6cbb\u7406\u56fd\u5bb6\u7684\u80fd\u529b', '\u7279\u6717\u666e\u59bb\u5b50\u88f8\u7167\u4e0a\u5934\u7248\u6216\u56e0\u8a00\u8bba\u60f9\u6bdb\u9ed8\u591a\u514b(\u56fe)', '\u4e00\u4e2a\u201c\u633a\u666e\u201d,\u4e00\u4e2a\u201c\u5012\u666e\u201d', '\u7279\u6717\u666e\uff1a\u201c\u8bf8\u5982\u514b\u6797\u987f\u592b\u5987\u90a3\u6837\u7684\u653f\u6cbb\u5bb6\u201d\u81f4\u7f8e\u56fd\u7ecf\u6d4e\u4f4e\u8ff7', '\u7279\u6717\u666e\u59bb\u5b50\u5e74\u8f7b\u65f6\u88f8\u7167\u88ab\u7f8e\u5a92\u520a\u4e0a\u62a5\u7eb8(\u56fe)', '\u7279\u6717\u666e\u8c08\u4e0e\u666e\u4eac\u201c\u5173\u7cfb\u201d\u65e0\u4e2a\u4eba\u6765\u5f80\u4f46\u5f88\u8d5e\u8d4f', '\u7279\u6717\u666e\u8c08\u4e0e\u666e\u4eac\u5173\u7cfb:\u4ed6\u5bf9\u6211\u5370\u8c61\u4e0d\u9519 \u8bc4\u4ef7\u5f88\u9ad8', '\u5e0c\u62c9\u91cc\u91cd\u83b7\u5bf9\u7279\u6717\u666e\u6c11\u8c03\u4f18\u52bf', '\u963f\u6851\u5947\u8981\u63ed\u5e0c\u62c9\u91cc\u7ade\u9009\u8001\u5e95 \u79f0\u6709\u66f4\u591a\u6709\u8da3\u8d44\u6599', '\u9152\u5e97\u7535\u68af\u201c\u5361\u58f3\u201d  \u7279\u6717\u666e\u722c\u68af\u5b50\u83b7\u6551', '\u82f9\u679cCEO\u5e93\u514b\u5c06\u4e3a\u5e0c\u62c9\u91cc\u4e3e\u529e\u7b79\u6b3e\u6d3b\u52a8', '\u4fa8\u62a5\uff1a\u5e0c\u62c9\u91cc\u51fa\u6218 \u54ea\u91cc\u662f\u6700\u786c\u7684\u5929\u82b1\u677f\uff1f', '\u7279\u6717\u666e\u88ab\u56f0\u7535\u68af,\u722c\u68af\u5b50\u83b7\u6551', '\u7279\u6717\u666e\u5426\u8ba4\u5bf9\u7f8e\u56fd\u201c\u96f6\u5949\u732e\u201d \u79f0\u521b\u9020\u6570\u5343\u5c97\u4f4d', '\u7279\u6717\u666e\u6279\u8bc4\u6d88\u9632\u90e8\u95e8 \u88ab\u56f0\u7535\u68af\u83b7\u6d88\u9632\u5458\u89e3\u6551', '\u5916\u5a92\uff1a\u88ab\u6279\u4e0d\u5c0a\u91cd\u7f8e\u9635\u4ea1\u5c06\u58eb \u7279\u6717\u666e\u518d\u5377\u5165\u4e89\u8bae', '\u5e0c\u62c9\u91cc\u56e2\u961f\u7535\u8111\u7591\u906d\u4fc4\u9ed1\u5ba2\u653b\u51fb \u7f8e\u5b89\u5168\u90e8\u95e8\u8c03\u67e5', '\u7f8e\u56fd\u5927\u9009\uff1a\u63a5\u53d7\u63d0\u540d\u6f14\u8bf4\u6536\u89c6\u7387\u7279\u6717\u666e\u9ad8\u4e8e\u5e0c\u62c9\u91cc', '\u7f8e\u56fd\u5927\u9009:\u7279\u6717\u666e\u63a5\u53d7\u63d0\u540d\u6f14\u8bf4\u6536\u89c6\u7387\u9ad8\u4e8e\u5e0c\u62c9\u91cc', '\u7279\u6717\u666e\u59bb\u5b50\u88ab\u8d28\u7591\u5b66\u5386\u9020\u5047', '\u7279\u6717\u666e\u59bb\u5b50\u5173\u95ed\u4e2a\u4eba\u7f51\u7ad9 \u6b64\u524d\u5176\u5b66\u5386\u906d\u9047\u8d28\u7591', '\u7279\u6717\u666e\u957f\u5973:\u201c\u9876\u914d\u7248\u767d\u5bcc\u7f8e\u201d', '\u5e0c\u62c9\u91cc\u4e0e\u642d\u6863\u542f\u62c9\u7968\u884c\u7a0b \u6279\u7279\u6717\u666e\u201c\u6beb\u65e0\u8d21\u732e\u201d', '\u7f8e\u56fd\u5927\u9009,\u4e71\u51fa\u65b0\u5883\u754c', '\u6c11\u4e3b\u515a\u652f\u6301\u8005\u201c\u60ac\u8d4f\u201d\u5bfb\u6c42\u66dd\u5149\u7279\u6717\u666e\u7a0e\u5355', '\u7279\u6717\u666e\u7a0e\u5355\u906d\u91cd\u91d1\u201c\u60ac\u8d4f\u201d \u59bb\u5b50\u5b66\u5386\u88ab\u7591\u9020\u5047', '\u5e0c\u62c9\u91cc\u201c\u73bb\u7483\u5929\u82b1\u677f\u201d \u63d0\u540d\u6f14\u8bf4\u8a93\u5f53\u201c\u5168\u6c11\u603b\u7edf\u201d', '\u5e0c\u62c9\u91cc\u52fe\u753b\u79ef\u6781\u84ec\u52c3\u7f8e\u56fd\u524d\u666f \u547c\u5401\u62d2\u7edd\u5206\u88c2\u653f\u6cbb', '\u5e0c\u62c9\u91cc\u63a5\u53d7\u603b\u7edf\u5019\u9009\u4eba\u63d0\u540d \u627f\u8bfa\u4e0e\u6851\u5fb7\u65af\u5408\u4f5c', '\u5e0c\u62c9\u91cc\u62ff\u4ec0\u4e48\u5bf9\u6297\u7279\u6717\u666e', '\u5965\u5df4\u9a6c\u652f\u6301\u5e0c\u62c9\u91cc\u5165\u4e3b\u767d\u5bab \u6279\u7279\u6717\u666e\u86ca\u60d1\u4eba\u5fc3', '\u5fb7\u5916\u957f\uff1a\u82e5\u7279\u6717\u666e\u5f53\u9009\u7f8e\u603b\u7edf \u7f8e\u6b27\u5173\u7cfb\u5c06\u5b58\u4e0d\u786e\u5b9a\u6027', '\u7f8e\u6c11\u4e3b\u515a\u515a\u4ee3\u4f1a\uff1a\u5e0c\u62c9\u91cc\u5973\u513f\u4ecb\u7ecd\u5176\u51fa\u573a \u67d4\u5316\u5f62\u8c61', '\u6c11\u4e3b\u515a\u5927\u4f1a\u201c\u56db\u5927\u91d1\u521a\u201d\u4e3a\u5e0c\u62c9\u91cc\u7ad9\u53f0', '\u7279\u6717\u666e\u59bb\u5b50\u5b66\u5386\u53d7\u5230\u8d28\u7591 \u5ba3\u5e03\u5173\u95ed\u4e2a\u4eba\u5b98\u65b9\u7f51\u7ad9', '\u7279\u6717\u666e\u9080\u4fc4\u67e5\u90ae\u4ef6\u95e8', '\u5e0c\u62c9\u91cc\u53d1\u8868\u6f14\u8bf4\u63a5\u53d7\u63d0\u540d \u5f3a\u8c03\u201c\u56e2\u7ed3\u8d77\u6765\u66f4\u5f3a\u5927\u201d', '\u5e0c\u62c9\u91cc\u63a5\u53d7\u6c11\u4e3b\u515a\u603b\u7edf\u5019\u9009\u4eba\u63d0\u540d \u5927\u9009\u4e3b\u6253\u201c\u56e2\u7ed3\u201d\u724c', '\u9080\u4fc4\u67e5\u5bf9\u624b \u7279\u6717\u666e\u60f9\u7978', '\u8d62\u4e86\u63d0\u540d,\u4e22\u4e86\u4eba\u5fc3', '\u5965\u5df4\u9a6c\uff1a\u7279\u6717\u666e\u6ca1\u6709\u9886\u5bfc\u7f8e\u56fd\u7684\u624d\u667a', '\u5965\u5df4\u9a6c\u5728\u7f8e\u56fd\u6c11\u4e3b\u515a\u5927\u4f1a\u4e0a\u53d1\u8868\u6f14\u8bf4 \u529b\u633a\u5e0c\u62c9\u91cc', '\u6253\u7834\u73bb\u7483\u5929\u82b1\u677f\uff1a\u5e0c\u62c9\u91cc\u8ddd\u6700\u7ec8\u8d62\u5bb6\u4ec5\u4e00\u6b65\u4e4b\u9065', '\u4fc4\u7f57\u65af\uff1a \u8ddf\u6211\u6ca1\u5173\u7cfb', '\u5c3d\u7ba1\u88ab\u201c\u9ed1\u201d,\u4ed6\u4ecd\u66ff\u5e0c\u62c9\u91cc\u8bf4\u8bdd', '\u8001\u5a46\u5938\u5b8c\u8001\u516c\u5938\uff0c\u4e3a\u4e86\u7ed9\u5e0c\u62c9\u91cc\u7ad9\u53f0\uff0c\u5965\u5df4\u9a6c\u4e24\u53e3\u5b50\u4e5f\u662f\u86ee\u62fc\u7684', '\u7f8e\u5927\u9009\u4e0a\u6f14\u73b0\u5b9e\u7248\u201c\u7eb8\u724c\u5c4b\u201d \u5185\u90e8\u90ae\u4ef6\u66dd\u5149\u5e0c\u62c9\u91cc\u7ade\u9009\u9ed1\u5e55', '\u7f8e\u56fd\u526f\u603b\u7edf\u62dc\u767b\uff1a\u5982\u4f55\u8ba9\u7f8e\u56fd\u4f1f\u5927 \u7279\u6717\u666e\u6beb\u65e0\u5934\u7eea', '\u7f8e\u56fd\u526f\u603b\u7edf\u62dc\u767b\u4e25\u8bcd\u62a8\u51fb\u7279\u6717\u666e \u79f0\u5176\u201c\u6beb\u65e0\u5934\u7eea\u201d', '\u7f8e\u6c11\u4e3b\u515a\u526f\u603b\u7edf\u5019\u9009\u4eba\u6f14\u8bb2\uff1a\u6211\u548c\u5e0c\u62c9\u91cc\u662f\u201c\u7075\u9b42\u4f19\u4f34\u201d', '\u7f8e\u4e0a\u767e\u827a\u4eba\u62b5\u5236\u7279\u6717\u666e', '\u6851\u5fb7\u65af\u201c\u94c1\u7c89\u201d\u62d2\u7edd\u627f\u8ba4\u5e0c\u62c9\u91cc', '\u7279\u6717\u666e\u6c11\u8c03\u53cd\u8d85\u5e0c\u62c9\u91cc\u4e24\u4e2a\u70b9', '\u5e0c\u62c9\u91cc\u6b63\u5f0f\u6210\u4e3a \u7f8e\u56fd\u6c11\u4e3b\u515a\u603b\u7edf\u5019\u9009\u4eba', '\u5965\u5df4\u9a6c\uff1a\u666e\u4eac\u6b63\u6697\u4e2d\u5e2e\u52a9\u7279\u6717\u666e', '\u5965\u5df4\u9a6c\u80de\u5144\u6b32\u6295\u7279\u6717\u666e', '\u4fc4\u5916\u957f\uff1a\u6211\u4e0d\u60f3\u8bf4\u810f\u8bdd', '\u7f8e\u56fd\u6c11\u4e3b\u515a\u6b63\u5f0f\u63d0\u540d\u5e0c\u62c9\u91cc\u4e3a\u603b\u7edf\u5019\u9009\u4eba', '\u7f8e\u56fd\u4eba\u7ec8\u4e8e\u627e\u5230\u4e86\u80fd\u963b\u6b62\u5ddd\u666e\u4e0a\u53f0\u7684\u4eba:\u54c8\u5229\u6ce2\u7279', '\u6851\u5fb7\u65af\u201c\u88ab\u9ed1\u201d \u4ecd\u633a\u5e0c\u62c9\u91cc', '\u6851\u5fb7\u65af\u662f\u88ab\u201c\u9ed1\u201d\u4e0b\u53bb\u7684_fina', '\u6851\u5fb7\u65af\u652f\u6301\u8005\u62d2\u7edd\u6295\u7968\u7ed9\u5e0c\u62c9\u91cc', '\u7279\u6717\u666e\u4eca\u5e745\u6708\u4ee5\u6765\u652f\u6301\u7387\u9996\u6b21\u8d85\u8fc7\u5e0c\u62c9\u91cc', '\u5e0c\u62c9\u91cc\u201c\u653e\u5927\u62db\u201d\uff1a\u4e08\u592b\u514b\u6797\u987f\u8bb2\u8ff0\u7231\u60c5\u7f57\u66fc\u53f2', '\u5e0c\u62c9\u91cc\u4eca\u8d77\u6b63\u5f0f\u5bf9\u51b3\u7279\u6717\u666e \u8fbe\u5dcd\uff1a\u53ef\u9884\u671fPK\u4e0d\u53ef\u9884\u671f', '\u5e0c\u62c9\u91cc\u6b63\u5f0f\u83b7\u5f97\u7f8e\u56fd\u5927\u9009\u6c11\u4e3b\u515a\u5019\u9009\u4eba\u63d0\u540d', '\u5e0c\u62c9\u91cc\u6b63\u5f0f\u83b7\u5f97\u7f8e\u56fd\u5927\u9009\u6c11\u4e3b\u515a\u5019\u9009\u4eba\u63d0\u540d', '\u5e0c\u62c9\u91cc\u6700\u597d\u548c\u6700\u540e\u7684\u673a\u4f1a', '\u73b0\u5b9e\u7248\u300a\u7eb8\u724c\u5c4b\u300b\u4e0a\u6f14 \u5e0c\u62c9\u91cc\u9ebb\u70e6\u4e0d\u65ad', 'CNN\u6700\u65b0\u6c11\u8c03\uff1a\u7279\u6717\u666e\u652f\u6301\u7387\u5168\u9762\u78be\u538b\u5e0c\u62c9\u91cc', '\u7f8e\u56fd\u6c11\u4e3b\u515a\u88ab\u66dd\u201c\u9ed1\u6389\u81ea\u5df1\u4eba\u201d\u4e11\u95fb \u9ad8\u5b98\u8f9e\u804c', '\u7f8e\u6c11\u4e3b\u515a\u5927\u4f1a\u5f00\u5e55 \u6851\u5fb7\u65af\u94c1\u7c89\u65a5\u5e0c\u62c9\u91cc\u6697\u7bb1\u64cd\u4f5c', '\u5185\u6597\u66dd\u5149\u88ab\u8feb\u8f9e\u804c', '\u5e0c\u62c9\u91cc\u7ade\u9009\u51fa\u65b0\u62db\u63a8\u51faAPP \u4e3a\u652f\u6301\u8005\u53d1\u5b9e\u7269\u5956\u52b1', '\u5965\u5df4\u9a6c\u54e5\u54e5\u5ba3\u5e03\u652f\u6301\u7279\u6717\u666e:\u5bf9\u5f1f\u5f1f\u603b\u7edf\u4efb\u671f\u5931\u671b', '\u7f8e\u56fd\u5927\u9009\u6c11\u8c03\uff1a\u7279\u6717\u666e\u5728\u6447\u6446\u5dde\u652f\u6301\u7387\u8d85\u5e0c\u62c9\u91cc', '\u7279\u6717\u666e\uff1a\u4e0d\u6392\u9664\u81ea\u5df1\u5f53\u9009\u603b\u7edf\u540e\u7f8e\u56fd\u9000\u51faWTO', '\u7279\u6717\u666e\u88ab\u6307\u78382000\u4e07\u7f8e\u5143\u6253\u51fb\u515a\u5185\u5bf9\u624b', '\u7279\u6717\u666e\u5f3a\u786c\u4e3b\u5f20\u8c03\u9ad8\u9a7b\u65e5\u7f8e\u519b\u8d39\u7528 \u65e5\u672c\uff1a\u8fd8\u6da8\uff1f', '\u5e0c\u62c9\u91cc\u7684\u526f\u624b\u662f\u201c\u4ed6\u201d', '\u7279\u6717\u666e\u82e5\u8d62\u4e86,\u4f1a\u5bf9\u4e2d\u56fd\u201c\u4f4e\u8c03\u201d?_fina', '\u5e0c\u62c9\u91cc\u516c\u5e03 \u7ade\u9009\u642d\u6863', '\u5e0c\u62c9\u91cc\u9009\u642d\u6863\u6253\u201c\u4fdd\u9669\u724c\u201d', '\u7279\u6717\u666e\uff1aTPP\u5c06\u6467\u6bc1\u7f8e\u56fd\u5236\u9020\u4e1a', '\u7279\u6717\u666e:\u82e5\u80dc\u9009\u5c06\u7981\u6b62\u6d89\u6050\u56fd\u5bb6\u79fb\u6c11', '\u7279\u6717\u666e\u201c\u6027\u4fb5\u6848\u201d\u5973\u4e3b\u89d2\u9996\u5f00\u8154', '\u7279\u6717\u666e\u63d0\u540d\u6f14\u8bb2\u5ba3\u626c\u201c\u7f8e\u56fd\u4e3b\u4e49\u201d\u4fe1\u6761', '\u7279\u6717\u666e\u6027\u4fb5\u6848\u5973\u4e3b\u89d2\uff1a\u6253\u7834\u6c89\u9ed8\u53ea\u56e0\u4e0d\u6ee1\u906d\u6c61\u8511', '\u5e0c\u62c9\u91cc\u731b\u6279\u7279\u6717\u666e\u63d0\u540d\u6f14\u8bb2 \u5ba3\u5e03\u526f\u603b\u7edf\u7ade\u9009\u642d\u6863', '\u5ddd\u666e\uff1a\u4e0d\u50cf\u5171\u548c\u515a\uff0c\u800c\u50cf\u6807\u9898\u515a', '\u514b\u9c81\u5179\u62d2\u7edd\u652f\u6301\u7279\u6717\u666e\u5f15\u201c\u5185\u8ba7\u201d', '\u514b\u9c81\u5179\u62d2\u4e3a\u7279\u6717\u666e\u201c\u80cc\u4e66\u201d', '\u7f8e\u56fd\u5e74\u8f7b\u534e\u4eba\u79fb\u6c11\u633a\u7279\u6717\u666e \u79f0\u8ba9\u7f8e\u56fd\u518d\u6b21\u5b89\u5168\u8d77\u6765', '\u7279\u6717\u666e\uff1a\u5c06\u5728\u7f8e\u58a8\u8fb9\u5883\u4fee\u5efa\u8fb9\u5883\u5899 \u9632\u8303\u975e\u6cd5\u79fb\u6c11', '\u7279\u6717\u666e\uff1a\u7f8e\u9762\u4e34\u56fd\u5185\u4e71\u5c40\u65e0\u6743\u8bf4\u6559\u4ed6\u56fd', '\u7279\u6717\u666e\uff1a\u82e5\u5f53\u9009\u5c06\u653e\u5f03\u5bf9\u5317\u7ea6\u76df\u56fd\u65e0\u6761\u4ef6\u4fdd\u62a4', '\u7279\u6717\u666e\uff1a\u82e5\u80dc\u9009\u5c06\u7981\u6b62\u6240\u6709\u6765\u81ea\u6d89\u6050\u56fd\u5bb6\u79fb\u6c11', '\u7279\u6717\u666e\u547c\u5401\u652f\u6301\u8005\u6350\u5341\u7f8e\u5143\u4ee5\u795d\u8d3a\u5176\u88ab\u63d0\u540d\u4e3a\u603b\u7edf\u5019\u9009\u4eba', '\u7279\u6717\u666e\u5c06\u53d1\u8868\u6700\u91cd\u8981\u6f14\u8bb2 \u6216\u627f\u8bfa\u5c31\u4efb\u540e\u7f8e\u91cd\u56de\u5b89\u5b81', '\u7279\u6717\u666e\u4e0a\u6f14\u201c\u63d0\u540d\u79c0\u201d_fina', '\u7279\u6717\u666e\u6b63\u5f0f\u63a5\u53d7\u5171\u548c\u515a\u603b\u7edf\u5019\u9009\u4eba\u63d0\u540d', '\u7279\u6717\u666e\u6b63\u5f0f\u63a5\u53d7\u5171\u548c\u515a\u603b\u7edf\u5019\u9009\u4eba\u63d0\u540d \u9ad8\u558a\uff1a\u7f8e\u56fd\uff01\u7f8e\u56fd\uff01', '\u514b\u9c81\u5179\u5171\u548c\u515a\u5927\u4f1a\u672a\u4e3a\u7279\u6717\u666e\u80cc\u4e66 \u8981\u7f8e\u56fd\u4eba\u51ed\u826f\u5fc3\u6295\u7968', '\u514b\u9c81\u5179\u62d2\u4e3a\u7279\u6717\u666e\u80cc\u4e66\u5f15\u5171\u548c\u515a\u201c\u5185\u8ba7\u201d  \u5e0c\u62c9\u91cc\u8d81\u673a\u4e3a\u5df1\u62c9\u7968', '\u7f8e\u56fd\u5927\u9009\uff1a\u7279\u6717\u666e\u592b\u4eba\u6f14\u8bb2\u7a3f\u5199\u624b\u201c\u627f\u8ba4\u72af\u9519\u201d', '\u7f8e\u520a\u5206\u6790\u7ea6\u7ff0\u900a\u548c\u7279\u6717\u666e\u8dd1\u504f\uff1a\u90fd\u4e0a\u8fc7\u5bc4\u5bbf\u5b66\u6821', '\u51ed\u826f\u5fc3\u6295\u7968\u5427\uff01\u514b\u9c81\u5179\u53d1\u8a00\u672a\u63d0\u652f\u6301\u7279\u6717\u666e\u5f15\u5618\u58f0', '\u795e\u5de7\u5408or\u6389\u94fe\u5b50\uff1f \u7279\u6717\u666e\u59bb\u5b50\u6f14\u8bf4\u201c\u6284\u88ad\u201d\u7c73\u6b47\u5c14', '\u7279\u6717\u666e\u5f53\u9009\u5171\u548c\u515a\u603b\u7edf\u5019\u9009\u4eba', '\u7279\u6717\u666e\u59bb\u5b50\u6f14\u8bf4\u3000\u6284\u88ad\u7c73\u6b47\u5c14\uff1f', '\u7279\u6717\u666e\u6b63\u5f0f\u6210\u4e3a\u7f8e\u5171\u548c\u515a\u603b\u7edf\u5019\u9009\u4eba', '\u767e\u540d\u88f8\u5973\u805a\u96c6\u5171\u548c\u515a\u5927\u4f1a\u573a\u5916 \u6297\u8bae\u7279\u6717\u666e\u8a00\u8bba', '\u5927\u5b66\u751f\u5de5\u4f5c\u6708\u85aa160\u5143 \u57fa\u672c\u5de5\u8d44OR\u57fa\u7840\u5de5\u8d44\uff1f\uff01', '\u515a\u4ee3\u4f1a\u5435\u58f0\u4e00\u7247 \u7279\u6717\u666e\u7ec8\u83b7\u63d0\u540d', '\u5171\u548c\u515a\u5927\u4f1a\u9996\u65e5\u95f9\u54c4\u54c4', '\u5171\u548c\u515a\u53d1\u8a00\u4eba\u5bf9\u8bdd\u65b0\u6d6a\uff1a\u5168\u529b\u652f\u6301\u7279\u6717\u666e\u8d62\u5f97\u5927\u9009', '\u7f8e\u5171\u548c\u515a\u5927\u4f1a\u6b63\u5f0f\u63d0\u540d\u7279\u6717\u666e\u4e3a\u5019\u9009\u4eba', '\u7279\u6717\u666e\u592b\u4eba\u6f14\u8bb2\u7a3f\u88ab\u6307\u201c\u6284\u88ad\u201d\u7c73\u6b47\u5c14', '\u7279\u6717\u666e\u83b7\u5171\u548c\u515a\u63d0\u540d \u88ab\u79f0\u5c06\u7f8e\u6273\u56de\u6b63\u8f68\u5355\u4e00\u9886\u8896', '\u7279\u6717\u666e\u59bb\u5b50\u6f14\u8bb2\u88ab\u6307\u6284\u88ad \u4e0e\u5965\u5df4\u9a6c\u592b\u4eba\u8bb2\u8bdd\u76f8\u4f3c', '\u7279\u6717\u666e\u4e0e\u5e0c\u62c9\u91cc\u652f\u6301\u7387\u5dee\u8ddd\u62c9\u8fd1\u52307%', '\u7279\u6717\u666e\u6b63\u5f0f\u6210\u4e3a\u5171\u548c\u515a\u603b\u7edf\u5019\u9009\u4eba', '\u7279\u6717\u666e\u6b63\u5f0f\u83b7\u5f97\u5171\u548c\u515a\u603b\u7edf\u5019\u9009\u4eba\u63d0\u540d', '130\u540d\u5973\u5b50\u62cd\u88f8\u4f53\u6444\u5f71\u8bbd\u523a\u7279\u6717\u666e \u9009\u4e3e\u524d\u5c06\u5c55\u51fa', '\u7f8e\u5171\u548c\u515a\u5927\u4f1a\u591a\u4f4d\u5927\u4f6c\u7f3a\u5e2d \u7279\u6717\u666e\u592b\u4eba\u6f14\u8bb2\u5168\u529b\u652f\u6301', '\u7f8e\u5171\u548c\u515a\u515a\u4ee3\u4f1a\uff1a\u529b\u5851\u7279\u6717\u666e\u4e3a\u201c\u53ef\u4fe1\u7684\u603b\u53f8\u4ee4\u201d', '\u7f8e\u8fde\u53d1\u67aa\u51fb\u6848\uff1a\u662f\u7279\u6717\u666e\u7684\u673a\u4f1a\u8fd8\u662f\u63a7\u67aa\u7684\u5951\u673a', '\u7279\u6717\u666e\u6216\u4e3a\u590d\u5236\u5c3c\u514b\u677e\u653b\u7565 \u4e71\u4e16\u5f3a\u8c03\u201c\u6cd5\u5f8b\u4e0e\u79e9\u5e8f\u201d', '\u7279\u6717\u666e\u540d\u6a21\u59bb\u5b50\u5171\u548c\u515a\u5927\u4f1a\u9996\u79c0\u6210\u201c\u5a07\u201d\u70b9 \u6d89\u5acc\u6284\u88ad\u5f15\u4e89\u8bae', '\u7f8e\u5171\u548c\u515a\u4eca\u8d77\u4e3e\u884c\u515a\u4ee3\u4f1a \u201c\u53cd\u7279\u6717\u666e\u201d\u6700\u540e\u52aa\u529b', '\u7279\u6717\u666e\u643a\u7ade\u9009\u642d\u6863\u9996\u6b21\u4eae\u76f8 \u65b0\u95fb\u53d1\u5e03\u4f1a\u5e73\u6de1\u65e0\u5473', '\u65b0\u6d6a\u5168\u666f\u76f4\u51fb\u7f8e\u56fd\u5171\u548c\u515a\u5168\u56fd\u4ee3\u8868\u5927\u4f1a', '\u4e2d\u56fd\u5236\u9020\u7f8e\u56fd\u7ade\u9009\u4eba\u9762\u5177\u8d70\u4fcf', '\u7f8e\u79d1\u6280\u754c\u96c6\u4f53\u201c\u70ae\u8f70\u201d\u7279\u6717\u666e', '\u7279\u6717\u666e\u4e0e\u526f\u603b\u7edf\u7ade\u9009\u642d\u6863\u5f6d\u65af\u9996\u6b21\u6b63\u5f0f\u540c\u53f0\u4eae\u76f8', '\u7279\u6717\u666e\u7d22\u8d54\u5343\u4e07\u7f8e\u5143', '\u7279\u6717\u666e\u5ba3\u5e03\u5370\u5dde\u5dde\u957f\u5f6d\u65af\u4e3a\u526f\u603b\u7edf\u7ade\u9009\u642d\u6863', '\u7f8e\u5927\u9009\u5c06\u6b63\u5f0f\u8d77\u8dd1 \u5e0c\u62c9\u91cc\u7279\u6717\u666e\u6c11\u8c03\u62c9\u952f\u80dc\u8d1f\u96be\u6599', '\u7279\u6717\u666e\u5c06\u524d\u7ade\u9009\u987e\u95ee\u544a\u4e0a\u6cd5\u5ead \u6307\u5176\u6cc4\u5bc6\u7d22\u8d54\u5343\u4e07', '\u7279\u6717\u666e\u5c06\u5ba3\u5e03\u526f\u624b\u4eba\u9009 \u5916\u754c\u201c\u9501\u5b9a\u201d\u5370\u5dde\u5dde\u957f\u5f6d\u65af', '\u7279\u6717\u666e\u5ba3\u5e03\u5370\u7b2c\u5b89\u7eb3\u5dde\u5dde\u957f\u4e3a\u81ea\u5df1\u7ade\u9009\u642d\u6863', '\u7f8e\u56fd\u6c11\u4e3b\u515a\u4eba\u529b\u963b\u7279\u6717\u666e\u5f53\u603b\u7edf \u5e0c\u62c9\u91cc\u6c11\u8c03\u9886\u5148', '\u7279\u6717\u666e\u526f\u624b\u540d\u5355\u201c\u9760\u8c31\u7248\u201d\u65b0\u51fa\u7089', '\u7279\u6717\u666e\u63a7\u544a\u524d\u52a9\u7406\u8fdd\u53cd\u4fdd\u5bc6\u534f\u8bae \u7d22\u8d541000\u4e07\u7f8e\u5143', '\u7279\u6717\u666e\u9009\u642d\u6863\u770b\u4e0a\u4e2d\u5c06', '\u5e0c\u62c9\u91cc\u5021\u8bae\u63a8\u65b0\u653f STEM\u6bd5\u4e1a\u751f\u6216\u53ef\u76f4\u63a5\u7533\u8bf7\u7eff\u5361', '\u5e0c\u62c9\u91cc\u526f\u624b\u518d\u73b0\u4e00\u70ed\u95e8\u4eba\u9009 \u66fe\u79c1\u81ea\u4f7f\u7528\u653f\u5e9c\u98de\u673a', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u52a0\u7d27\u6311\u9009\u5404\u81ea\u526f\u624b\u4eba\u9009', '\u5e0c\u62c9\u91cc\u9009\u5b9a\u526f\u624b\u662f\u524d\u5317\u7ea6\u9ad8\u5b98\uff1f', '\u7f8e\u56fd\u5973\u5b50\u4e13\u4e1a\u6a21\u4eff\u5e0c\u62c9\u91cc23\u5e74 \u6bcf\u6708\u6536\u51651\u4e07\u7f8e\u5143', '\u6851\u5fb7\u65af\u6b63\u5f0f\u8868\u6001\u652f\u6301\u5e0c\u62c9\u91cc\u6210\u4e3a\u6c11\u4e3b\u515a\u603b\u7edf\u5019\u9009\u4eba', '\u6851\u5fb7\u65af\u6b63\u5f0f\u5ba3\u5e03\u4e3a\u5e0c\u62c9\u91cc\u80cc\u4e66 \u79f0\u5c06\u52a9\u5176\u8d62\u5f97\u5927\u9009', '\u7279\u6717\u666e\uff1a\u53cd\u79cd\u65cf\u6b67\u89c6\u793a\u5a01\u4ec5\u4ec5\u662f\u4e2a\u5f00\u59cb', '\u7279\u6717\u666e\uff1a\u7f8e\u56fd\u79cd\u65cf\u66b4\u529b\u51b2\u7a81\u521a\u5f00\u59cb', '\u201c\u90ae\u4ef6\u95e8\u201d\u66b4\u9732\u5e0c\u62c9\u91cc\u4e24\u5927\u81f4\u547d\u4f24', '\u72ec\u5bb6-\u7f8e\u62c6\u5f39\u90e8\u961f\u524d\u519b\u5b98\uff1a\u7279\u6717\u666e\u662f\u6765\u7ed9\u7f8e\u56fd\u201c\u706d\u866b\u201d', '\u7f8e\u56fd\u56fd\u4f1a\u73ed\u52a0\u897f\u8c03\u67e5\u62a5\u544a\u8ba4\u4e3a\u5e0c\u62c9\u91cc\u5904\u7f6e\u65e0\u8fc7', '\u5e0c\u62c9\u91cc\u8981\u518d\u7ef7\u7d27:\u7f8e\u56fd\u52a1\u9662\u51b3\u5b9a\u91cd\u542f\u8c03\u67e5\u7535\u90ae\u95e8', 'FBI:\u5e0c\u62c9\u91cc\u5bf9\u201c\u90ae\u4ef6\u95e8\u201d\u4e8b\u4ef6\u90e8\u5206\u8fa9\u89e3\u4e0d\u5c5e\u5b9e', '\u6fb3\u95e8\u65e5\u62a5\uff1a\u5e0c\u62c9\u91cc\u6e05\u9664\u901a\u5f80\u767d\u5bab\u6700\u5927\u53f8\u6cd5\u969c\u788d', '\u7f8e\u56fd\u56fd\u52a1\u9662\u91cd\u542f\u5e0c\u62c9\u91cc\u7535\u90ae\u95e8\u8c03\u67e5', '\u7f8e\u56fd\u56fd\u52a1\u9662\u91cd\u542f\u9488\u5bf9\u5e0c\u62c9\u91cc\u201c\u7535\u90ae\u95e8\u201d\u5185\u90e8\u8c03\u67e5', '\u201c\u7535\u90ae\u95e8\u201d\u53f8\u6cd5\u7ed3\u6848 \u7f8e\u5171\u548c\u515a\u501f\u56fd\u4f1a\u7d27\u54ac\u5e0c\u62c9\u91cc', 'FBI\u4e0d\u5efa\u8bae\u5c31\u201c\u90ae\u4ef6\u95e8\u201d\u8bc9\u5e0c\u62c9\u91cc', 'FBI\u62a4\u9001\u5e0c\u62c9\u91cc\u9003\u51fa\u201c\u7535\u90ae\u95e8\u201d  \u7279\u6717\u666e\uff1a\u4e0d\u516c\u5e73', '\u4e0d\u8d77\u8bc9 \u5e0c\u62c9\u91cc\u8eb2\u8fc7\u201c\u90ae\u4ef6\u95e8\u201d', '\u4e0d\u8d77\u8bc9\uff01 \u5e0c\u62c9\u91cc\u8eb2\u8fc7\u201c\u90ae\u4ef6\u95e8\u201d', '\u7f8e\u79f0\u7279\u6717\u666e\u653f\u7b56\u63d0\u9ad8\u53f0\u6d77\u5f00\u6218\u53ef\u80fd \u7f8e\u96be\u5a01\u6151\u4e2d\u56fd', '\u7f8e\u56fd\u53f8\u6cd5\u90e8\u51b3\u5b9a\u4e0d\u5c31\u7535\u90ae\u95e8\u8d77\u8bc9\u5e0c\u62c9\u91cc', '\u7f8e\u56fd\u53f8\u6cd5\u90e8\u51b3\u5b9a\u4e0d\u56e0\u201c\u7535\u90ae\u95e8\u201d\u8d77\u8bc9\u5e0c\u62c9\u91cc', '\u7279\u6717\u666e\uff1a\u9a97\u5b50\u5e0c\u62c9\u91cc\u4e0d\u914d\u5f53\u603b\u7edf', '\u7279\u6717\u666e\u60e8\u906d\u8bbd\u523a\u7ed8\u672c\u4e11\u5316:\u76ae\u80a4\u4eae\u6a58\u8272\u8eab\u6750\u4f3c\u571f\u8c46', '\u7279\u6717\u666e\u5f88\u751f\u6c14', '\u7279\u6717\u666e\u6012\u65a5\u5e0c\u62c9\u91cc\u514d\u906d\u8d77\u8bc9\uff1a\u7edd\u5bf9\u7684\u5ba1\u5224\u4e0d\u516c', '\u5965\u5df4\u9a6c\u201c\u5316\u654c\u4e3a\u53cb\u201d \u9996\u6b21\u4e3a\u5e0c\u62c9\u91cc\u7ad9\u53f0\u52a9\u9009', '\u7f8e\u56fdFBI\u5efa\u8bae\u4e0d\u5c31\u201c\u7535\u90ae\u95e8\u201d\u8d77\u8bc9\u5e0c\u62c9\u91cc', '\u5e0c\u62c9\u91cc\u201c\u7535\u90ae\u95e8\u201d\uff1aFBI\u6279\u5176\u5bf9\u673a\u5bc6\u201c\u6781\u4e3a\u7c97\u5fc3\u201d', '\u5e0c\u62c9\u91cc\u4ece\u201c\u90ae\u4ef6\u95e8\u201d\u8131\u8eab \u5965\u5df4\u9a6c\u4e3a\u5e0c\u62c9\u91cc\u52a9\u9009', '\u5e0c\u62c9\u91cc\u642d\u603b\u7edf\u4e13\u673a\u524d\u5f80\u9020\u52bf\u5730 \u7279\u6717\u666e\u545b\u201c\u8c01\u4e70\u5355\u201d', '\u6700\u65b0\u6c11\u8c03\uff1a\u5e0c\u62c9\u91cc\u652f\u6301\u738745.5% \u9886\u5148\u7279\u6717\u666e12.6%', '\u534e\u5c14\u8857\u5acc\u5f03\u7279\u6717\u666e', '\u7f8e\u56fd\u5927\u9009\u8fdb\u5c55\uff1a\u7279\u6717\u666e\u548c\u5e0c\u62c9\u91cc\u5c06\u6311\u9009\u7ade\u9009\u4f19\u4f34', '\u5e0c\u62c9\u91cc\u4e0eFBI\u9762\u8c08', 'FBI\u4e0e\u5e0c\u62c9\u91cc3\u5c0f\u65f6\u9762\u8c08\u201c\u90ae\u4ef6\u95e8\u201d\u8fdb\u5165\u6536\u5c3e\u9636\u6bb5', '\u7f8e\u6c11\u4e3b\u515a\u4eba\u76f8\u4fe1\u5e0c\u62c9\u91cc\u4e0d\u4f1a\u56e0\u7535\u90ae\u95ee\u9898\u88ab\u8d77\u8bc9', '\u5e0c\u62c9\u91cc\u5c31\u201c\u90ae\u4ef6\u95e8\u201d\u4e8b\u4ef6\u81ea\u613f\u63a5\u53d7FBI\u7ea6\u8c08', '\u72ec\u5bb6\u5bf9\u8bdd\uff1a\u5e0c\u62c9\u91cc\u56e2\u961f\u5982\u4f55\u4e89\u53d6\u534e\u88d4\u9009\u6c11', '\u5965\u5df4\u9a6c\u79f0\u79bb\u4efb\u603b\u7edf\u6709\u6743\u53d1\u7262\u9a9a\uff1a\u7279\u6717\u666e\u4e0d\u914d\u79f0\u201c\u6c11\u7cb9\u201d', '\u6cd5\u56fd\u603b\u7edf\u8b66\u544a\uff1a\u82e5\u7279\u6717\u666e\u5f53\u9009\u7f8e\u56fd\u603b\u7edf \u5c06\u662f\u201c\u5371\u9669\u201d\u7ed3\u679c', '\u8054\u5408\u9020\u52bf\uff1a\u7f8e\u56fd\u603b\u7edf\u5965\u5df4\u9a6c\u5c06\u9996\u6b21\u4e3a\u5e0c\u62c9\u91cc\u52a9\u9009', '\u7279\u6717\u666e\u79f0\u5982\u80dc\u9009\u5c06\u8131\u79bbTPP \u88ab\u6279\u6050\u5f31\u5316\u7f8e\u56fd\u7ecf\u6d4e', '\u7279\u6717\u666e\u5984\u8a00\u5bf9\u534e\u641e\u65e0\u60c5\u653b\u52bf \u77db\u593412\u6b21\u6307\u5411\u4e2d\u56fd', '\u7279\u6717\u666e\u4e0e\u7b2c\u4e8c\u4efb\u59bb\u5b50\u8ba2\u5a5a\u94bb\u6212\u62cd\u5356 30\u4e07\u7f8e\u5143\u843d\u69cc', '\u7f8e\u4f17\u9662\u73ed\u52a0\u897f\u4e8b\u4ef6\u62a5\u544a\u51fa\u7089 \u96be\u64bc\u5e0c\u62c9\u91cc\u7ade\u9009\u9886\u5148\u4f18\u52bf', '\u6c11\u8c03\uff1a\u5e0c\u62c9\u91cc\u7684\u652f\u6301\u7387\u8f83\u7279\u6717\u666e\u9886\u514811\u4e2a\u767e\u5206\u70b9', '\u7279\u6717\u666e\u5c31\u4e1a\u8ba1\u521212\u6b21\u63d0\u4e2d\u56fd\uff1a\u8a93\u8a00\u5c06\u4e2d\u56fd\u5217\u4e3a\u6c47\u7387\u64cd\u7eb5\u56fd', '\u72ec\u5bb6\u63a2\u8bbf\u5e0c\u62c9\u91cc\u5927\u672c\u8425\uff1a\u8fd9\u91cc\u80fd\u5426\u8d70\u51fa\u7f8e\u9996\u4f4d\u5973\u603b\u7edf\uff1f', '\u201c\u5916\u5a46\u201d\u5e0c\u62c9\u91cc', '\u7f8e\u5927\u9009\u5e0c\u62c9\u91cc\u652f\u6301\u7387\u5168\u9762\u9886\u5148 \u7279\u6717\u666e\u88ab\u6279\u6709\u504f\u89c1', '\u7f8e\u56fd\u6c11\u8c03\u663e\u793a:\u5e0c\u62c9\u91cc\u6240\u83b7\u652f\u6301\u7387\u9ad8\u51fa\u7279\u6717\u666e12%', '\u6851\u5fb7\u65af\u79f0\u5c06\u6295\u7968\u7ed9\u5e0c\u62c9\u91cc \u4ee5\u963b\u6b62\u7279\u6717\u666e\u5f53\u9009', '\u7279\u6717\u666e\u8d5e\u82f1\u56fd\u516c\u6295 \u5e0c\u62c9\u91cc\u6279\u5176\u53ea\u5173\u5fc3\u4e2a\u4eba\u751f\u610f', '\u7279\u6717\u666e\u524d\u7ade\u9009\u7ecf\u7406\u518d\u5c31\u4e1a', '\u5965\u5df4\u9a6c\u79fb\u6c11\u6539\u9769\u96be\u4ea7 \u6216\u53d8\u76f8\u52a9\u5e0c\u62c9\u91cc\u5165\u4e3b\u767d\u5bab\uff1f', '\u5973\u5b50\u72b6\u544a\u5f3a\u5978\u7279\u6717\u666e\uff1a\u80e1\u626f\uff01', '\u5916\u5a92\uff1a\u6851\u5fb7\u65af\u8868\u793a\u5c06\u6295\u7968\u7ed9\u5e0c\u62c9\u91cc', '\u5e0c\u62c9\u91cc\u9009\u526f\u624b\u9501\u5b9a\u201c\u4e09\u9009\u4e00\u201d', '\u7279\u6717\u666e\u79f0\u5e0c\u62c9\u91cc\u662f\u6700\u8150\u8d25\u5019\u9009\u4eba \u4e3a\u201c\u4e16\u754c\u7ea7\u9a97\u5b50\u201d', '\u7279\u6717\u666e\u70ae\u8f70\u5e0c\u62c9\u91cc\u662f\u201c\u4e16\u754c\u7ea7\u7684\u9a97\u5b50\u201d', '\u7231\u5973\u5439\u98ce \u7279\u6717\u666e\u7092\u6389\u7231\u5c06', '\u514b\u6797\u987f\u5e0c\u62c9\u91cc\u6dfb\u5916\u5b59\u201c\u6b23\u559c\u82e5\u72c2\u201d', '\u5a92\u4f53\u89e3\u8bfb\u7279\u6717\u666e\u7ade\u9009\u529f\u81e3\u906d\u89e3\u96c7:\u6216\u56e0\u5f97\u7f6a\u5176\u5973\u513f', '\u67aa\u51fb\u6848\u540e\u7279\u6717\u666e\u652f\u6301\u7387\u4e0a\u5347 \u5e0c\u62c9\u91cc\u4f18\u52bf\u7f29\u5c0f', '\u7279\u6717\u666e\u7ade\u9009\u8d44\u91d1\u77ed\u7f3a \u843d\u540e\u5e0c\u62c9\u91cc\u8fd1\u4ebf\u7f8e\u5143', '\u7279\u6717\u666e\u70ae\u8f70\u5e0c\u62c9\u91cc \u79f0\u5176\u6536\u201c\u8840\u94b1\u201d\u4e3a\u534e\u5c14\u8857\u529e\u4e8b', '\u7279\u6717\u666e\u8981\u5411\u4e3b\u6d41\u548c\u91d1\u4e3b\u6295\u964d\uff1f', '\u82f1\u56fd\u7537\u5b50\u593a\u8b66\u5b98\u4f69\u67aa\u6b32\u884c\u523a\u7279\u6717\u666e \u6216\u88ab\u5224\u521110\u5e74', '\u82f1\u4e00\u7537\u5b50\u6b32\u523a\u6740\u7279\u6717\u666e\u88ab\u6355', '\u6b32\u523a\u6740\u7279\u6717\u666e \u82f1\u7537\u5b50\u88ab\u6355', '\u8001\u4eba\u7684\u9057\u613f\uff1a\u522b\u6295\u7968\u7ed9\u5e0c\u62c9\u91cc\u7279\u6717\u666e', '\u7279\u6717\u666e\u96c6\u4f1a\u9047\u9669 \u82f1\u56fd\u7537\u5b50\u62a2\u8b66\u5bdf\u914d\u67aa\u8bd5\u56fe\u884c\u523a', '\u7279\u6717\u666e\u626c\u8a00\u76d1\u89c6\u6e05\u771f\u5bfa \u5efa\u8bae\u7528\u79cd\u65cf\u5206\u6790\u6253\u51fb\u72af\u7f6a', '\u82f1\u56fd\u7537\u5b50\u56e0\u4f01\u56fe\u593a\u67aa\u6740\u7279\u6717\u666e\u906d\u8d77\u8bc9\uff1a\u5df2\u8c0b\u52121\u5e74', '\u7f8e\u603b\u7edf\u5019\u9009\u4eba\u7279\u6717\u666e\u79f0\u652f\u6301\u82f1\u56fd\u8131\u79bb\u6b27\u76df', '\u7279\u6717\u666e\u79f0\u4e0d\u8981\u5171\u548c\u515a\u652f\u6301\u4e5f\u80fd\u8d62\u5927\u9009', '\u666e\u4eac\uff1a\u63a5\u53d7\u7f8e\u56fd\u552f\u4e00\u8d85\u7ea7\u5927\u56fd\u5730\u4f4d', '\u5207\u5c14\u897f\u751f\u4e8c\u80ce\u7537\u5b9d \u5e0c\u62c9\u91cc\u559c\u6dfb\u5916\u5b59\u76f4\u8a00\u6b23\u559c\u82e5\u72c2', '\u5e0c\u62c9\u91cc\u9009\u642d\u6863\u4e0d\u8003\u8651\u6851\u5fb7\u65af', '\u7279\u6717\u666e\u201c\u80cc\u53db\u201d  \u5168\u7f8e\u6b65\u67aa\u534f\u4f1a\u4e86\uff1f', '\u63a7\u67aa\u8fd8\u662f\u63a7\u4eba\uff1f\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u6fc0\u8fa9', '\u7279\u6717\u666e\u6709\u610f\u540c\u91d1\u6b63\u6069\u7f8e\u56fd\u4f1a\u9762:\u8fb9\u5403\u6c49\u5821\u8fb9\u8c08\u6838', '\u5e0c\u62c9\u91cc\u6c11\u8c03\u4f18\u52bf\u7565\u51cf', '\u4e00\u4e2a\u575a\u6301\u63a7\u67aa\u4e00\u4e2a\u575a\u6301\u63a7\u4eba', '\u5965\u5170\u591a\u8840\u6848\u540e\u6c11\u8c03:\u5e0c\u62c9\u91cc\u9886\u5148\u7279\u6717\u666e\u5e45\u5ea6\u7f29\u5c0f', '\u5f53\u5965\u5df4\u9a6c\u5f7b\u5e95\u88ab\u7279\u6717\u666e\u6fc0\u6012 \u4ed6\u662f\u600e\u4e48\u53cd\u51fb\u7684\uff1f', '\u201c\u7ef4\u57fa\u89e3\u5bc6\u201d\u8ba1\u5212\u516c\u5e03 \u65b0\u4e00\u6279\u5e0c\u62c9\u91cc\u7535\u90ae', '\u67aa\u51fb\u6848\u540e\u7279\u6717\u666e\u6279\u5965\u5df4\u9a6c\u8f6f\u5f31 \u91cd\u7533\u53cd\u79fb\u6c11\u4e3b\u5f20', '\u67aa\u51fb\u6848\u5f15\u53d1\u7279\u6717\u666e\u5e0c\u62c9\u91cc\u4e92\u6495', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u56f4\u7ed5\u67aa\u51fb\u6848\u6253\u5634\u4ed7', '\u963f\u6851\u5947\uff1a\u7ef4\u57fa\u89e3\u5bc6\u8ba1\u5212\u516c\u5e03\u4e00\u6279\u5e0c\u62c9\u91cc\u7535\u90ae', '\u8c37\u6b4c\u4e3a\u5e0c\u62c9\u91cc\u201c\u6d17\u5730\u201d\u610f\u5473\u7740\u4ec0\u4e48\uff1f', '\u7279\u6717\u666e\u53d1\u58f0\u660e \u8981\u6c42\u5965\u5df4\u9a6c\u8f9e\u804c\u5e0c\u62c9\u91cc\u9000\u9009', '\u7279\u6717\u666e\u5c31\u5965\u5170\u591a\u6050\u88ad\u8981\u6c42\u5965\u5df4\u9a6c\u4e0b\u53f0\u5e0c\u62c9\u91cc\u9000\u9009', '\u5e0c\u62c9\u91cc\u201c\u624b\u673a\u529e\u516c\u201d\u6d89\u72af\u7f6a\uff1f', '\u5e0c\u62c9\u91cc\u90ae\u4ef6\u95e8\u6301\u7eed\u53d1\u9175 \u88ab\u66dd\u7528\u79c1\u4eba\u624b\u673a\u6388\u6743\u7a7a\u88ad', '\u201c\u5973\u5973\u7ec4\u5408\u201d\u80fd\u5426\u51fb\u8d25\u7279\u6717\u666e', '\u5979\u60f3\u6210\u4e3a\u5e0c\u62c9\u91cc\u526f\u624b', '\u5e0c\u62c9\u91cc\u88ab\u66dd\u7528\u79c1\u4eba\u624b\u673a\u6388\u6743\u5728\u5df4\u57fa\u65af\u5766\u7a7a\u88ad\u6d3b\u52a8', '\u5e0c\u62c9\u91cc\u526f\u624b\u6d6e\u51fa\u6c34\u9762', '\u5370\u6709\u7279\u6717\u666e\u5934\u50cf\u6361\u5c4e\u888b\u7545\u9500 \u5ba0\u7269\u5e97\u534e\u88d4\u8001\u677f\u53d1\u8d22', '\u8c37\u6b4c\u5426\u8ba4\u64cd\u7eb5\u641c\u7d22\u8054\u60f3\u8bcd\u652f\u6301\u5e0c\u62c9\u91cc', '\u5965\u5df4\u9a6c\u5ba3\u5e03\u652f\u6301\u5e0c\u62c9\u91cc\u5f53\u603b\u7edf \u5e0c\u62c9\u91cc\u7269\u8272\u7ade\u9009\u642d\u6863', '\u5965\u5df4\u9a6c\u5ba3\u5e03\u652f\u6301\u5e0c\u62c9\u91cc\u7ade\u9009\u603b\u7edf \u5c06\u4e3a\u5176\u7ad9\u53f0\u52a9\u9009', '\u7f8e\u56fd\u603b\u7edf\u5965\u5df4\u9a6c\u5ba3\u5e03\u652f\u6301\u5e0c\u62c9\u91cc\u7ade\u9009\u603b\u7edf', '\u7279\u6717\u666e\u63a8\u6587\u8ba5\u8bbd \u5e0c\u62c9\u91cc\u53cd\u51fb\uff1a\u5220\u6389\u4f60\u8d26\u6237(\u56fe)', '\u5e0c\u62c9\u91cc\u6311\u7ade\u9009\u642d\u6863 \u6216\u6210\u5c31\u201c\u5973\u5b50\u7ec4\u5408\u201d', '\u5e0c\u62c9\u91cc\u6311\u7ade\u9009\u642d\u6863\u6709\u610f\u201c\u5973\u5973\u201d\u7ec4\u5408\uff1f', '\u5e0c\u62c9\u91cc\u8eab\u77408\u4e07\u5143\u963f\u739b\u5c3c\u5927\u8c08\u6536\u5165\u4e0d\u5e73\u7b49\u906d\u6279', '\u963f\u6851\u5947\uff1a\u5e0c\u62c9\u91cc\u7684\u201c\u9e70\u6d3e\u201d\u653f\u7b56\u5c06\u5bfc\u81f4\u5168\u7403\u8bf8\u591a\u51b2\u7a81', '\u5965\u5df4\u9a6c\u4e3a\u4fdd\u653f\u6cbb\u9057\u4ea7\u8ba1\u5212\u4e3a\u5e0c\u62c9\u91cc\u52a9\u9009', '\u767d\u5bab\u79f0\u5e0c\u62c9\u91cc\u7684\u5f3a\u6709\u529b\u652f\u6491\u662f\u5176\u4e08\u592b\u7684\u652f\u6301', '\u7f8e\u56fd\u5927\u9009\u53ae\u6740\u63d0\u524d\u5230\u6765', '\u7279\u6717\u666e\u5e0c\u62c9\u91cc\u96be\u5f97\u201c\u5171\u8bc6\u201d \u5747\u79f0\u4e2d\u56fd\u5e94\u65bd\u538b\u671d\u9c9c', '\u5e0c\u62c9\u91cc\u7a7f\u4e0a\u4e07\u7f8e\u5143\u963f\u739b\u5c3c\u8bb2\u6536\u5165\u516c\u5e73\u88ab\u5632\u8bbd', '\u5e0c\u62c9\u91cc\u9501\u5b9a\u6c11\u4e3b\u515a\u603b\u7edf\u5019\u9009\u4eba\u63d0\u540d \u5c06\u5bf9\u51b3\u7279\u6717\u666e', '\u5e0c\u62c9\u91cc\u9501\u5b9a\u63d0\u540d \u6851\u5fb7\u65af\u62d2\u7edd\u9000\u51fa', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u88ab\u6307\u7cfb20\u4e16\u7eaa\u4ee5\u6765\u6700\u906d\u4eba\u538c\u5019\u9009\u4eba', '\u5e0c\u62c9\u91cc\u5ba3\u5e03\u8d62\u5f97\u521d\u9009 \u5965\u5df4\u9a6c\u81f4\u7535\u795d\u8d3a', '\u524d\u7279\u5de5\u51fa\u4e66\u8c08\u5e0c\u62c9\u91cc\uff1a\u66fe\u628a\u514b\u6797\u987f\u773c\u775b\u6253\u9752', '\u7279\u6717\u666e\u201c\u5927\u5634\u201d\u8bc4\u6cd5\u5b98\u60f9\u9ebb\u70e6', '\u5e0c\u62c9\u91cc\u521d\u9009\u4ee3\u8868\u7968\u8fbe\u6807 \u5c06\u83b7\u6c11\u4e3b\u515a\u63d0\u540d', '\u5e0c\u62c9\u91cc\u83b7\u5f97\u8db3\u989d\u515a\u5185\u5e2d\u4f4d\u6570\u63d0\u540d\u603b\u7edf\u5019\u9009\u4eba', '\u5e0c\u62c9\u91cc\u9501\u5b9a\u63d0\u540d \u5c06\u4ee3\u8868\u6c11\u4e3b\u515a\u89d2\u9010\u767d\u5bab', '\u7279\u6717\u666e\uff1a\u6211\u7231\u4e2d\u56fd\u548c\u4e2d\u56fd\u4eba\uff01', '\u7279\u6717\u666e\u82e5\u5f53\u9009\u6216\u8981\u6c42\u65e5\u672c\u8d1f\u62c5\u66f4\u591a\u9a7b\u65e5\u7f8e\u519b\u7ecf\u8d39', '\u5e0c\u62c9\u91cc\u8d62\u5f97\u6ce2\u591a\u9ece\u5404\u521d\u9009 \u8fdb\u4e00\u6b65\u9501\u5b9a\u6c11\u4e3b\u515a\u63d0\u540d', '\u5965\u5df4\u9a6c\u63d0\u9192\u7f8e\u6c11\u4e3b\u515a\uff1a\u201c\u5982\u5c65\u8584\u51b0\u201d\u8fce\u6218\u7279\u6717\u666e', '\u5e0c\u62c9\u91cc\u70ae\u8f70\u7279\u6717\u666e\uff1a\u6211\u4eec\u5728\u9009\u603b\u7edf\u800c\u975e\u72ec\u88c1\u8005', '\u5171\u548c\u515a\u8001\u5927\u8868\u6001 \u652f\u6301\u7279\u6717\u666e', '\u7f8e\u5171\u548c\u515a\u5927\u4f6c\u5ba3\u5e03\u652f\u6301\u7279\u6717\u666e', '\u7279\u6717\u666e\u9996\u6b21\u4f1a\u89c1\u534e\u88d4\u9009\u6c11:\u6211\u7231\u4e2d\u56fd\u548c\u4e2d\u56fd\u4eba(\u56fe)', '\u4f17\u8bae\u9662\u8bae\u957f\u5ba3\u5e03\u652f\u6301\u7279\u6717\u666e', 'FBI\u7279\u5de5\u66dd\u6599:\u767d\u5bab\u524d\u987e\u95ee\u4e0d\u582a\u5e0c\u62c9\u91cc\u7f9e\u8fb1\u81ea\u6740', '\u7279\u6717\u666e\u52a0\u5dde\u96c6\u4f1a\u906d\u53cd\u5bf9\u8005\u6297\u8bae \u793a\u5a01\u8005\u6012\u7838\u9e21\u86cb', '\u5e0c\u62c9\u91cc\u4eae\u738b\u724c\u70ae\u8f70\u7279\u6717\u666e\u5916\u4ea4\u653f\u7b56\uff1a\u516c\u62a5\u79c1\u4ec7', '\u4e2d\u4f01\u7784\u51c6\u7f8e\u5927\u9009\u5546\u673a \u7279\u6717\u666e\u5395\u7eb8\u9500\u91cf\u8fdc\u8d85\u5e0c\u62c9\u91cc', '\u201c\u7279\u6717\u666e\u5927\u5b66\u201d\u655b\u8d22 \u5b66\u52363\u5929\u5b66\u8d3923\u4e07\u5143', '\u201c\u7279\u6717\u666e\u5927\u5b66\u201d\u79d8\u5bc6\u6d17\u8111\u6559\u7a0b\u66dd\u5149', '\u671d\u9c9c\u5a92\u4f53\u8d5e\u626c\u7279\u6717\u666e\u777f\u667a\u6709\u8fdc\u89c1 \u80fd\u5e2e\u52a9\u534a\u5c9b\u7edf\u4e00', '\u7279\u6717\u666e\u5927\u5b66\u201d\u9a97\u94b1\u79d8\u6280\u66dd\u5149\uff1a\u7f16\u5199\u201c\u6d17\u8111\u6559\u7a0b\u201d', '\u7279\u6717\u666e\u5c06\u4e8e\u82f1\u56fd\u8131\u6b27\u516c\u6295\u6b21\u65e5\u8bbf\u82f1', '\u5ddd\u666e\u795e\u66f2\uff01\u53f2\u4e0a\u6700\u840c\u300a\u80d6\u5a03\u513f\u4e0a\u6210\u90fd\u300b[\u718a\u732b]', '\u7279\u6717\u666e\u70ae\u8f70\u7f8e\u56fd\u5a92\u4f53\u201c\u4e0d\u8bda\u5b9e\u201d \u4e0d\u6ee1\u81ea\u5df1\u5f62\u8c61\u88ab\u62b9\u9ed1', '\u5916\u5a92\uff1a\u5e0c\u62c9\u91cc\u51fb\u8d25\u7279\u6717\u666e \u987b\u514b\u670d\u4e09\u5927\u56f0\u96be', '\u5e0c\u62c9\u91cc\uff1a\u5e0c\u671b\u4e0e\u6851\u5fb7\u65af\u8054\u5408\u8d77\u6765\u963b\u6b62\u7279\u6717\u666e', '\u970d\u91d1\u8bc4\u4ef7\u7279\u6717\u666e\uff1a\u4ed6\u662f\u4e2a\u717d\u52a8\u5bb6', '\u5201\u5927\u660e\uff1a\u7279\u6717\u666e\u4e0e\u91cc\u6839\u4e4b\u95f4\u5dee\u4e86\u597d\u51e0\u4e2a\u6851\u5fb7\u65af', '\u6c11\u4e3b\u515a\u4fc3\u5e0c\u62c9\u91cc\u6539\u53d8\u7b56\u7565 \u5f3a\u8c03\u7279\u6717\u666e\u7f3a\u70b9', '\u751f\u4ea7\u201c\u7279\u6717\u666e\u201d\u7684\u6d59\u6c5f\u5de5\u5382', '\u5965\u5df4\u9a6c\u8bbf\u65e5\u6279\u7279\u6717\u666e\u65e0\u77e5 \u7279\u6717\u666e\uff1a\u4ed6\u4e0d\u61c2\u751f\u610f', '\u7279\u6717\u666e\u9ad8\u547c\u6211\u7231\u4e2d\u56fd\u4eba', '\u5e0c\u62c9\u91cc\uff1a\u201c\u7535\u90ae\u95e8\u201d\u4e0d\u5f71\u54cd\u9009\u6c11\u505a\u6b63\u786e\u51b3\u5b9a', '\u4e2d\u56fd\u5236\u9020\u201c\u7279\u6717\u666e\u201d\u8d70\u4fcf\u7f8e\u56fd', '\u201c\u90ae\u4ef6\u95e8\u201d\u51fa\u62a5\u544a \u5e0c\u62c9\u91cc\u660e\u77e5\u6545\u72af\uff1f', '\u5965\u5df4\u9a6cG7\u8bc4\u7279\u6717\u666e\u8d62\u521d\u9009\uff1a\u8ba9\u9996\u8111\u4eec\u201c\u60ca\u614c\u201d', '\u7f8e\u56fd\u52a1\u9662\u7763\u5bdf\u957f:\u5e0c\u62c9\u91cc\u5728\u201c\u90ae\u4ef6\u95e8\u201d\u4e8b\u4ef6\u4e2d\u8fdd\u89c4', '\u7f8e\u603b\u7edf\u53c2\u9009\u4eba\u7ade\u4e89\u8d8b\u767d\u70ed\u5316 \u5ddd\u666e\u5e0c\u62c9\u91cc\u83b7\u534e\u4eba\u652f\u6301', '\u7279\u6717\u666e\u6b63\u5f0f\u9501\u5b9a\u5171\u548c\u515a\u603b\u7edf\u5019\u9009\u4eba\u63d0\u540d', '\u7279\u6717\u666e\u6210\u4e3a\u5171\u548c\u515a\u552f\u4e00\u603b\u7edf\u5019\u9009\u4eba \u5bf9\u624b\u7eb7\u7eb7\u9000\u51fa', '\u7279\u6717\u666e\u9996\u6b21\u9080\u534e\u88d4\u767b\u53f0 \u79f0\u201c\u6211\u7231\u4e2d\u56fd\u4eba\u201d', '\u7f8e\u56fd\u6c11\u8c03\uff1a\u4e9a\u88d4\u9009\u6c11\u8f83\u559c\u7231\u5e0c\u62c9\u91cc \u591a\u652f\u6301\u5965\u5df4\u9a6c', '\u7f8e\u56fd\u65b0\u58a8\u897f\u54e5\u5dde\u53cd\u7279\u6717\u666e\u6297\u8bae\u5f15\u53d1\u51b2\u7a81', '\u671d\u9c9c\u62d2\u7edd\u7279\u6717\u666e\u4e0e\u91d1\u6b63\u6069\u4f1a\u6664\uff1a\u80e1\u8a00\u4e71\u8bed\u6ca1\u8bda\u610f', '\u7f8e\u5927\u9009\u5019\u9009\u4eba\u8d22\u529b\u6bd4\u62fc \u7279\u6717\u666e\u652f\u51fa\u4ec5\u5e0c\u62c9\u91cc\u4e09\u6210', '\u66dd\u5149\u201c\u526f\u603b\u7edf\u5019\u9009\u4eba\u540d\u5355\u201d\u7279\u6717\u666e\u5708\u5185\u4eba\u88ab\u7092', '\u516b\u6210\u7f8e\u5171\u548c\u515a\u4eba\u652f\u6301\u7279\u6717\u666e \u5e0c\u62c9\u91cc\u5927\u9009\u4ecd\u5360\u4f18\u52bf', '\u7279\u6717\u666e\u9ad8\u8c03\u70ab\u5bcc\u53f7\u79f0\u767e\u4ebf\u5bcc\u7fc1 \u5e0c\u62c9\u91cc\uff1a\u4f60\u5c31\u5439\u5427', '\u7279\u6717\u666e\u516c\u5e03104\u9875\u8d22\u52a1\u62a5\u8868\u4eae\u201c\u5bb6\u5e95\u201d(\u56fe)', '\u7279\u6717\u666e\u70ab\u5bcc \u5e0c\u62c9\u91cc\u8bf4\u201c\u5439\u725b\u201d', '\u7279\u6717\u666e\uff1a\u60f3\u5f53\u9762\u548c\u91d1\u6b63\u6069\u804a\u4e00\u804a', '\u7279\u6717\u666e\uff1a\u613f\u4e0e\u91d1\u6b63\u6069\u672c\u4eba\u5bf9\u8bdd\u89e3\u51b3\u671d\u6838\u95ee\u9898', '\u7279\u6717\u666e\u79f0\u548c\u5361\u6885\u4f26\u5173\u7cfb\u4e0d\u4f1a\u597d \u8ba9\u4f26\u6566\u5e02\u957f\u6d4b\u667a\u5546', '\u5e0c\u62c9\u91cc\u592b\u5987\u53bb\u5e74\u9760\u6f14\u8bb2\u8d5a650\u4e07\u7f8e\u5143', '\u5e0c\u62c9\u91cc\u8d62\u5f97\u80af\u5854\u57fa\u5dde\u521d\u9009 \u79bb\u515a\u5185\u63d0\u540d\u66f4\u8fdb\u4e00\u6b65', '\u79f0\u82e5\u5f53\u9009\u5c06\u91cd\u7528\u4e08\u592b \u5e0c\u62c9\u91cc\u4e3a\u4f55\u4e0d\u907f\u5acc', '\u7279\u6717\u666e\u4e5f\u5f97\u9760\u6350\u6b3e\u6253\u9009\u6218\u4e86', '\u5e0c\u62c9\u91cc:\u82e5\u5f53\u9009\u603b\u7edf\u5c06\u6d3e\u514b\u6797\u987f\u4e3b\u7ba1\u6062\u590d\u7f8e\u56fd\u7ecf\u6d4e', '\u7279\u6717\u666e\u201c\u526f\u603b\u7edf\u5019\u9009\u4eba\u540d\u5355\u201d\u66dd\u5149 \u6709\u5165\u56f4\u8005\u62d2\u7edd', '\u7279\u6717\u666e\u66fe\u5468\u65cb\u4e8e\u4e0d\u540c\u5973\u4eba\u4e4b\u95f4 \u76f4\u8a00\u5973\u6027\u4e3a\u6027\u5de5\u5177', '\u7279\u6717\u666e\u6076\u9a82\u5973\u4e3b\u64ad\u201c\u8361\u5987\u201d', '\u7279\u6717\u666e\u56e2\u961f\u9ad8\u5c42\u9996\u6b21\u63a5\u53d7\u97e9\u5a92\u91c7\u8bbf:\u51b3\u4e0d\u653e\u5f03\u97e9\u56fd', '\u5e0c\u62c9\u91cc:\u82e5\u80dc\u9009\u5c06\u4ea4\u7531\u4e08\u592b\u514b\u6797\u987f\u91cd\u632f\u7f8e\u56fd\u7ecf\u6d4e', '\u7279\u6717\u666e\u7a0e\u52a1\u95ee\u9898\u6210\u5173\u6ce8\u7126\u70b9 \u575a\u6301\u4e0d\u516c\u5e03\u62a5\u7a0e\u7eaa\u5f55', '\u7acb\u9676\u5b9b\u793e\u4ea4\u5a92\u4f53\u73b0\u7279\u6717\u666e\u4e0e\u666e\u4eac\u63a5\u543b\u6d82\u9e26', '\u7f8e\u5171\u548c\u515a\u201c\u5927\u4f6c\u201d\u8868\u6001\uff1a\u4ecd\u4e0d\u80fd\u652f\u6301\u7279\u6717\u666e', '\u7279\u6717\u666e\u8001\u7ba1\u5bb6\uff1a\u5965\u5df4\u9a6c\u8be5\u6b7b', '\u7279\u6717\u666e\u524d\u7ba1\u5bb6\u8138\u4e66\u53d1\u6587\uff1a\u5e94\u628a\u5965\u5df4\u9a6c\u5f53\u95f4\u8c0d\u6bd9\u6389', '\u83f2\u5f8b\u5bbe\u8206\u8bba\u70ed\u8bae\u51c6\u603b\u7edf\uff1a\u5e76\u975e\u201c\u83f2\u7248\u7279\u6717\u666e\u201d', '\u5e0c\u62c9\u91cc:\u82e5\u5f53\u9009\u603b\u7edf\u5c06\u516c\u5f0051\u533a\u5916\u661f\u751f\u547d\u4fe1\u606f', '\u7f8e\u5a92\u9884\u6d4b\u7279\u6717\u666e\u5f53\u9009\u201c\u603b\u7edf\u201d\u540e\u5934\u4ee8\u6708', '\u7f8e\u8bae\u5458\u63d0\u6848\u627c\u6740\u7279\u6717\u666e\u201c\u7981\u6b62\u7a46\u65af\u6797\u5165\u5883\u201d\u5021\u8bae', '\u7279\u6717\u666e\u903c\u8fd1\u603b\u7edf\u5b9d\u5ea7 \u5a5a\u604b\u7f51\u7ad9\u53f7\u53ec\u5ac1\u5230\u52a0\u62ff\u5927', '\u7279\u6717\u666e\u6539\u53e3:\u7981\u6b62\u7a46\u65af\u6797\u5165\u7f8e\u53ea\u662f\u5efa\u8bae \u672a\u5fc5\u5b9e\u65bd', '\u7279\u6717\u666e\u6c11\u8c03\u652f\u6301\u7387\u51e0\u4e4e\u8ffd\u5e73\u5e0c\u62c9\u91cc:40%\u6bd441%', '\u7279\u6717\u666e\u4efb\u547d\u524d\u7ade\u9009\u5bf9\u624b\u4e3a\u201c\u603b\u7edf\u4ea4\u63a5\u201d\u603b\u7ba1(\u56fe)', '\u5e0c\u62c9\u91cc\u627f\u8bfa\u4e0a\u53f0\u89e3\u5bc6\u201c51\u533a\u201d \u4ee5\u4e0eUFO\u6709\u5173\u95fb\u540d', '\u63d2\u624b\u5357\u6d77 \u5e0c\u62c9\u91cc\u4e3a\u81ea\u5df1\u70b9\u8d5e', '\u72ec\u5bb6\uff1a\u7528\u4e2d\u56fd\u793e\u4ea4\u7f51 \u5728\u7f8e\u534e\u88d4\u7ec4\u5efa\u7279\u6717\u666e\u652f\u6301\u56e2', '\u56fd\u9645\u653f\u575b\u4e3a\u4f55\u6d41\u884c\u7279\u6717\u666e\u5f0f\u96f7\u8bed', '\u7f8e\u5a92\uff1a\u9762\u5bf9\u201c\u7279\u6717\u666e\u73b0\u8c61\u201d\u5171\u548c\u515a\u9700\u6539\u8fdb\u6295\u7968\u7cfb\u7edf', '\u7ebd\u7ea6\u4e2d\u592e\u516c\u56ed\u73b0\u7279\u6717\u666e\u5893\u7891 \u6216\u827a\u672f\u5bb6\u6240\u4e3a(\u56fe)', '\u6851\u5fb7\u65af\u51fb\u8d25\u5e0c\u62c9\u91cc\u8d62\u5f97\u897f\u5f17\u5409\u5c3c\u4e9a\u5dde\u521d\u9009', '\u7279\u6717\u666e\u4e0e\u5e0c\u62c9\u91cc \u8c01\u7684\u5bf9\u534e\u653f\u7b56\u9760\u8c31\uff1f', '\u201c\u83f2\u7248\u7279\u6717\u666e\u201d\u9886\u8dd1\u5927\u9009 \u66fe\u79f0\u8981\u5230\u5357\u6d77\u63d2\u56fd\u65d7', '\u9664\u4e86\u7279\u6717\u666e\u6ca1\u5f97\u9009\u4e86\uff1f \u7f8e\u5171\u548c\u515a\u4fdd\u5b88\u6d3e\u8bda\u5f81\u201c\u6700\u540e\u7684\u9ed1\u9a6c\u201d', '\u83f2\u5f8b\u5bbe\u7248\u201c\u7279\u6717\u666e\u201d\u5f53\u9009\u8be5\u56fd\u603b\u7edf \u66fe\u8a93\u8a00\u6740\u5149\u7f6a\u72af', '\u83f2\u5f8b\u5bbe\u5927\u9009\u4eca\u63ed\u6653 \u201c\u83f2\u7248\u7279\u6717\u666e\u201d\u675c\u7279\u5c14\u7279\u6599\u80dc\u51fa', '\u4f26\u6566\u65b0\u5e02\u957f\uff1a\u82e5\u7279\u6717\u666e\u5f53\u9009\u5c31\u4e0d\u53bb\u7f8e\u56fd', '\u6c11\u8c03:\u8d85\u534a\u6570\u7f8e\u73b0\u5f79\u519b\u4eba\u652f\u6301\u7279\u6717\u666e\u6210\u4e3a\u7f8e\u56fd\u603b\u7edf', '\u83f2\u5f8b\u5bbe\u201c\u7279\u6717\u666e\u201d\u6216\u6bd4\u7f8e\u56fd\u7279\u6717\u666e\u9760\u8c31', '\u7f8e\u603b\u7edf\u5019\u9009\u4eba\u7279\u6717\u666e\uff1a\u4e0d\u62c5\u5fc3\u7f3a\u5c11\u515a\u5185\u652f\u6301', '\u7279\u6717\u666e\u4f1a\u6210\u4e3a\u4e0b\u5c4a\u7f8e\u56fd\u603b\u7edf\u5417\uff1f', '\u7279\u6717\u666e\u5e0c\u62c9\u91cc\u5747\u521b\u7eaa\u5f55\u6210\u6700\u53d7\u9119\u89c6\u53c2\u9009\u4eba', '\u7279\u6717\u666e\u73b0\u8c61\uff1a\u6c11\u7cb9\u4e3b\u4e49\u5728\u6539\u53d8\u7f8e\u56fd\u653f\u6cbb\u56fe\u666f\u5417\uff1f', '\u7279\u6717\u666e\u6b63\u7834\u574f\u7f8e\u56fd \u8bf7\u6709\u52c7\u6c14\u7684\u653f\u6cbb\u5bb6\u7ad9\u51fa\u6765\uff01', '\u82f1\u5a92\uff1a\u7279\u6717\u666e\u5c06\u846c\u9001\u7f8e\u56fd\u6cbb\u4e0b\u7684\u548c\u5e73 \u4ed6\u8f93\u5b9a\u4e86', '\u201c\u7279\u6717\u666e\u5927\u5b66\u201d\u88ab\u6307\u6d89\u5acc\u5708\u94b1 \u65e0\u5927\u5b66\u529e\u5b66\u8ba4\u8bc1', '\u7ebd\u7ea6\u5730\u4ea7\u5927\u4ea8\u7279\u6717\u666e \u906d\u5171\u548c\u515a\u5927\u4f6c\u201c\u51b7\u9047\u201d', '\u6570\u636e\u79f0\u5e0c\u62c9\u91cc\u8d62\u4e0b\u603b\u7edf\u5927\u9009\u51e0\u738761% \u4f18\u52bf\u7f29\u51cf', '\u5965\u5df4\u9a6c\u8c08\u7279\u6717\u666e\u53c2\u9009\u603b\u7edf\uff1a\u8fd9\u4e0d\u662f\u771f\u4eba\u79c0', '\u7f8e\u56fdFBI\u6216\u56e0\u201c\u90ae\u4ef6\u95e8\u201d\u7ea6\u8c08\u5e0c\u62c9\u91cc', '\u7279\u6717\u666e\u518d\u5411\u65e5\u672c\u53d1\u96be\uff1a\u4e3b\u5f20\u4e0a\u8c03\u65e5\u672c\u6c7d\u8f66\u5173\u7a0e', '\u6eda\u77f3\u4e50\u961f\u8981\u6c42\u7279\u6717\u666e\u505c\u7528\u5176\u6b4c\u66f2\u7528\u4e8e\u7ade\u9009\u5ba3\u4f20', '\u73af\u7403\u65f6\u62a5\u8bc4\u7279\u6717\u666e\u521d\u9009\u5927\u80dc\uff1a\u8fd9\u5c4a\u7f8e\u56fd\u4eba\u6c11\u4e0d\u884c', '\u4eca\u5e74\u7f8e\u56fd\u5927\u9009\u57fa\u672c\u4e0a\u5c31\u662f\u4ed6PK\u5e0c\u62c9\u91cc\u4e86', '\u514b\u9c81\u5179\u9000\u9009 \u7279\u6717\u666e\u9501\u5b9a\u603b\u7edf\u5019\u9009\u4eba\u63d0\u540d', '\u7279\u6717\u666e\uff1a\u4ece\u201c\u79d1\u897f\u5609\u7684\u6076\u9b54\u201d\u5230\u201c\u4f1f\u5927\u7684\u7687\u5e1d\u201d\u8fd8\u6709\u591a\u8fdc', '\u7279\u6717\u666e:\u97e9\u56fd\u5e94\u5168\u989d\u627f\u62c5\u7f8e\u519b\u9a7b\u624e\u8d39\u7528', '\u7279\u6717\u666e\u548c\u5e0c\u62c9\u91cc\uff0c\u7f8e\u56fd\u4eba\u4f1a\u9009\u8c01', '\u7279\u6717\u666e\u7a81\u7834  \u770b\u7a7a\u8bae\u5458\u53cd\u624b\u505a\u591a', '\u7279\u6717\u666e\u518d\u5411\u97e9\u65e5\u8981\u201c\u4fdd\u62a4\u8d39\u201d\uff1a\u4e0d\u7ed9\u94b1\u5c31\u64a4\u5175', '\u5e0c\u62c9\u91ccVS\u7279\u6717\u666e\uff0c\u4e24\u4e2a\u4e11\u95fb\u7f20\u8eab\u8005\u7684\u5bf9\u51b3', '\u7f8e\u5171\u548c\u515a\u79f0\u7279\u6717\u666e\u6599\u83b7\u63d0\u540d \u5168\u515a\u9700\u56e2\u7ed3\u5bf9\u4ed8\u5e0c\u62c9\u91cc', '\u7f8e\u5171\u548c\u515a\u6392\u540d\u7b2c\u4e8c\u5019\u9009\u4eba\u9000\u9009 \u7279\u6717\u666e\u5c06\u7a33\u83b7\u63d0\u540d', '\u4e0b\u4e00\u4e2a\u7f8e\u56fd\u8d85\u7ea7\u82f1\u96c4\u2014\u2014\u7279\u6717\u666e', '\u610f\u5916\u201c\u8d62\u5f97\u201d\u521d\u9009 \u7279\u6717\u666e\u662f\u771f\u201c\u9760\u8c31\u201d\u4e86\u5417', '\u5370\u7b2c\u5b89\u7eb3\u5dde\u521d\u9009\u6851\u5fb7\u65af\u53cd\u8d85\u5e0c\u62c9\u91cc\u53d6\u80dc', '\u7279\u6717\u666e\u8c08\u8d38\u6613\u9006\u5dee:\u4e0d\u80fd\u8ba9\u4e2d\u56fd\u7ee7\u7eed\u201c\u5f3a\u5978\u201d\u7f8e\u56fd', '\u7279\u6717\u666e\u8bed\u51fa\u60ca\u4eba\uff1a\u4e0d\u8bb8\u4e2d\u56fd\u7ee7\u7eed\u201c\u5f3a\u5978\u201d\u7f8e\u56fd', '\u7279\u6717\u666e\u652f\u6301\u7387\u9996\u8d85\u5e0c\u62c9\u91cc \u5973\u6027\u9009\u6c11\u66f4\u652f\u6301\u5e0c\u62c9\u91cc', '\u6700\u540e\u4e00\u6b21\u201c\u767d\u5bab\u76f8\u58f0\u5927\u4f1a\u201d \u5965\u5df4\u9a6c\u5f00\u6dae\u7279\u6717\u666e', '\u7279\u6717\u666e\u5927\u9009\u9020\u52bf\u6d3b\u52a8\u9047\u963b \u52a0\u5dde\u6c11\u4f17\u8fde\u7eed\u4e24\u5929\u793a\u5a01', '\u7f8e\u56fd\u6570\u767e\u4eba\u4e0a\u8857\u6297\u8bae\u7279\u6717\u666e(\u56fe)', '\u7f8e\u603b\u7edf\u7ade\u9009\u4eba\u7279\u6717\u666e\u96c6\u4f1a\u7206\u53d1\u793a\u5a01\u51b2\u7a81\u591a\u4eba\u88ab\u6355', '\u5171\u548c\u515a\u5df2\u65e0\u6cd5\u963b\u6b62\u7279\u6717\u666e', '\u4e0d\u60e7\u5171\u548c\u515a\u5185\u963b\u51fb\u8054\u76df \u7279\u6717\u666e\u9884\u9009\u6a2a\u626b\u7f8e\u4e1c\u4e94\u5dde', '\u72ec\u5bb6\u76f4\u51fb\uff1a\u5728\u534e\u76db\u987f\u9996\u6b21\u8c08\u5916\u4ea4 \u7279\u6717\u666e\u53d8\u4e86\u4e2a\u4eba', '\u7279\u6717\u666e:\u7f8e\u56fd\u4e0d\u5e94\u4e0e\u4fc4\u7f57\u65af\u548c\u4e2d\u56fd\u4e3a\u654c', '\u7279\u6717\u666e\u516c\u5f00\u9610\u8ff0\u5916\u4ea4\u653f\u7b56\u91cd\u70b9 \u671b\u4e0e\u4fc4\u4e2d\u53d1\u5c55\u53cb\u597d\u5173\u7cfb', '\u7279\u6717\u666e\u5171\u548c\u515a\u521d\u9009\u62ff\u4e0b\u4e1c\u5317\u4e94\u5dde \u79f0\u4e00\u5207\u5df2\u7ecf\u7ed3\u675f', '\u7279\u6717\u666e\u6a2a\u626b\u4e94\u5dde\u79f0\u521d\u9009\u5df2\u7ed3\u675f \u79bb\u80dc\u5229\u53ea\u5dee\u4e24\u4e2a\u5dde', '\u7279\u6717\u666e\u9996\u8c08\u5916\u4ea4\u653f\u7b56 \u79f0\u7f8e\u56fd\u5e94\u201c\u8c28\u614e\u514b\u5236\u201d', '\u7279\u6717\u666e\u5916\u4ea4\u6f14\u8bf4\u5168\u6587\u8bfb \u6279\u5965\u5df4\u9a6c\u4e2d\u4e1c\u79fb\u690d\u6c11\u4e3b', '\u7279\u6717\u666e\u8d62\u5f97\u4e94\u5dde\u5171\u548c\u515a\u521d\u9009 \u5047\u5b9a\u5df2\u83b7\u515a\u5185\u63d0\u540d', '\u7f8e\u4e94\u5dde\u521d\u9009\u7279\u6717\u666e\u5e0c\u62c9\u91cc\u6210\u8d62\u5bb6 \u5411\u515a\u63d0\u540d\u8fc8\u8fdb', '\u7279\u6717\u666e\u4e1c\u53175\u5dde\u521d\u9009\u5168\u90e8\u83b7\u80dc \u5e0c\u62c9\u91cc\u8d62\u4e0b3\u5dde', '\u7f8e\u56fd2\u4f4d\u5171\u548c\u515a\u7ade\u9009\u4eba\u7ed3\u76df\u963b\u7279\u6717\u666e \u7ea6\u5b9a\u4e0d\u4e92\u6495', '\u76ee\u6807\uff1a\u6273\u5012\u7279\u6717\u666e\uff01', '\u7f8e\u4e1c\u5317\u4e94\u5dde\u521d\u9009\u5c06\u767b\u573a \u5e0c\u62c9\u91cc\u7279\u6717\u666e\u76fc\u9501\u5b9a\u80dc\u5c40', '20\u7f8e\u5143\u7eb8\u5e01\u5370\u4e0a\u5973\u6027\u5934\u50cf\u201c\u60f9\u5230\u201d\u7279\u6717\u666e', '\u83f2\u7248\u7279\u6717\u666e\u518d\u653e\u72c2\u8a00:\u82e5\u5f53\u9009\u603b\u7edf\u5c31\u548c\u7f8e\u6fb3\u65ad\u4ea4', '\u5e0c\u62c9\u91cc\uff1a\u5f53\u5e74\u652f\u6301\u4f0a\u62c9\u514b\u6218\u4e89\u662f\u6700\u5927\u653f\u6cbb\u9057\u61be', '\u201c\u83f2\u7248\u7279\u6717\u666e\u201d\u518d\u653e\u8a00\uff1a\u82e5\u5f53\u9009\u603b\u7edf \u5c31\u548c\u7f8e\u6fb3\u65ad\u4ea4', '911\u8fd8\u662f711\uff1f\u7279\u6717\u666e\u53e3\u8bef\u8d3b\u7b11\u5927\u65b9', '\u51ed\u4ec0\u4e48\u91cc\u6839\u53ef\u4ee5\u5f53\u603b\u7edf\uff0c\u5ddd\u666e\u4e0d\u884c\uff1f', '\u7279\u6717\u666e\u5e0c\u62c9\u91cc\u9f50\u83b7\u80dc \u8ddd\u79bb\u63d0\u540d\u4ec5\u4e00\u6b65\u4e4b\u9065', '\u7279\u6717\u666e\u5e0c\u62c9\u91cc\u8d62\u4e0b\u7ebd\u7ea6\u9884\u9009\u6218', '\u559d\u5976\u8336\u5403\u9505\u8d34\uff0c\u5e0c\u62c9\u91cc\u5927\u6253\u201c\u4eb2\u6c11\u724c\u201d', '\u7f8e\u56fd\u5927\u9009\u521d\u9009\uff1a\u7279\u6717\u666e\u5728\u7ebd\u7ea6\u5dde\u83b7\u80dc', '\u7f8e\u56fd\u7ebd\u7ea6\u5dde\u521d\u9009\u6218\u51b5\u63ed\u6653 \u5e0c\u62c9\u91cc\u7279\u6717\u666e\u518d\u4e0b\u4e00\u57ce', '\u7279\u6717\u666e\u8d62\u5f97\u5171\u548c\u515a\u7ebd\u7ea6\u5dde\u521d\u9009(\u56fe)', '\u4e24\u515a\u53c2\u9009\u4eba\u4e3a\u7ebd\u7ea6\u5dde\u521d\u9009\u51b2\u523a \u5e0c\u62c9\u91cc\u7279\u6717\u666e\u4ecd\u9886\u5148', '\u624e\u514b\u4f2f\u683c\u53d1\u8868\u6f14\u8bb2\u6697\u6279\u7279\u6717\u666e\u6240\u53d1\u8868\u201c\u7b51\u5899\u201d\u8a00\u8bba', '\u5e0c\u62c9\u91cc\u5750\u7ebd\u7ea6\u5730\u94c1\u9047\u201c\u5c34\u5c2c\u201d', '\u6c11\u8c03\u663e\u793a\u7279\u6717\u666e\u652f\u6301\u7387\u9886\u5148 \u6269\u5927\u4e0e\u5171\u548c\u515a\u5bf9\u624b\u5dee\u8ddd', '\u5965\u5df4\u9a6c\uff1a\u7279\u6717\u666e\u6216\u514b\u9c81\u5179\u90fd\u4e0d\u4f1a\u6210\u4e3a\u7ee7\u4efb\u8005', '\u5e0c\u62c9\u91cc\u5984\u8a00\u8981\u8ba9\u4e2d\u56fd\u201c\u5b88\u89c4\u77e9\u201d \u53f7\u79f0\u8981\u4e25\u60e9\u4e2d\u56fd', '\u7f8e\u5a92\u4f53\u8054\u624b\u201c\u8ffd\u6253\u201d\u7279\u6717\u666e \u6068\u4ece\u54ea\u91cc\u6765\uff1f', '\u7f8e\u5a92\uff1a\u4e2d\u56fd\u4eba\u559c\u6b22\u7279\u6717\u666e\u8fd8\u662f\u5e0c\u62c9\u91cc\uff1f', '\u540d\u6a21\u59bb\u5b50\u4e3a\u7279\u6717\u666e\u201c\u51fa\u53f0\u201d', '\u7f8e\u56fd\u5a01\u65af\u5eb7\u661f\u5dde\u5c06\u4e3e\u884c\u521d\u9009 \u5e0c\u62c9\u91cc\u7279\u6717\u666e\u6216\u5403\u8d25\u4ed7', '\u7f8e\u56fd\u52a1\u9662\u6682\u505c\u8c03\u67e5\u5e0c\u62c9\u91cc\u201c\u90ae\u4ef6\u95e8\u201d', '\u7279\u6717\u666e\u7f55\u89c1\u6094\u8fc7\uff1a\u8f6c\u63a8\u514b\u9c81\u5179\u8001\u5a46\u7167\u7247\u662f\u4e2a\u9519\u8bef(\u56fe)', '\u5965\u5df4\u9a6c\u516c\u5f00\u6279\u7279\u6717\u666e\uff1a\u4ed6\u4e0d\u4e86\u89e3\u4e16\u754c', '\u767d\u5bab\u56de\u5e94\u7279\u6717\u666e\u5141\u8bb8\u97e9\u65e5\u62e5\u6838\uff1a\u4e0e\u7f8e\u653f\u7b56\u4e0d\u7b26', '\u7279\u6717\u666e\u7ade\u9009\u7ecf\u7406\u6253\u4eba\u201c\u88ab\u6355\u201d', '\u5e0c\u62c9\u91cc\u4e8e\u7ebd\u7ea6\u5c55\u5f00\u5927\u578b\u7ade\u9009\u9020\u52bf\u6d3b\u52a8 \u73b0\u9ad8\u89c4\u683c\u5b89\u4fdd', '\u7f8e\u56fd\u7537\u5b50\u4e13\u4e1a\u6a21\u4eff\u7279\u6717\u666e\u8868\u6f14\u9a82\u4eba \u6708\u51654\u4e07\u7f8e\u5143', '\u65e5\u672c\u56de\u5e94\u7279\u6717\u666e\u64a4\u519b\u8a00\u8bba \u79f0\u65e5\u7f8e\u540c\u76df\u7cfb\u5916\u4ea4\u57fa\u7840', '\u7279\u6717\u666e\u5973\u513f\u751f\u4e0b\u7537\u5a74 \u7528\u524d\u603b\u7edf\u540d\u5b57\u8d77\u540d', '\u3010\u4fa0\u5ba2\u5c9b\u3011\u53f2\u8bb0\xb7\u5ddd\u666e\u672c\u7eaa', '\u7f8e\u56fd\u4e00\u516c\u56ed\u51fa\u73b0\u201c\u7279\u6717\u666e\u5893\u7891\u201d \u7f51\u53cb\u75af\u4f20\u7167\u7247', '\u7279\u6717\u666e\uff1a\u7f8e\u56fd\u4eba\u53bb\u6b27\u6d32\u65c5\u884c\u4e0d\u5b89\u5168 \u5728\u7f8e\u56fd\u4e5f\u4e0d\u5b89\u5168', '\u7279\u6717\u666e\u8d34\u53cc\u65b9\u59bb\u5b50\u5bf9\u6bd4\u7167\u7247\u653b\u51fb\u7ade\u9009\u5bf9\u624b(\u56fe)', '\u7f8e\u56fd\u6c11\u4e3b\u515a\u4e09\u5dde\u521d\u9009 \u5206\u6790\u6307\u5e0c\u62c9\u91cc\u96be\u6dd8\u6c70\u6851\u5fb7\u65af', '\u7279\u6717\u666e\u79f0\u82f1\u56fd\u4eba\u652f\u6301\u53cd\u7a46\u65af\u6797 \u96be\u6c11\u5c06\u4fc3\u4f7f\u82f1\u56fd\u8131\u6b27', '\u65b0\u6d6a\u76f4\u51fb-\u7279\u6717\u666e\uff1a\u4e2d\u56fd\u4eba\u201c\u5438\u8d70\u201d\u7f8e\u56fd\u7684\u94b1', '\u5e0c\u62c9\u91cc\u65af\u5766\u798f\u5927\u5b66\u53cd\u6050\u6f14\u8bf4:\u6211\u4eec\u4e00\u5b9a\u4f1a\u6253\u8d25\u6050\u6016\u4e3b\u4e49', '\u7f8e\u56fd\u5bf9\u4e16\u754c\u7684\u201c\u9886\u5bfc\u529b\u201d\u8fd8\u6709\u51e0\u8bb8', '\u7279\u6717\u666e\u62d2\u8c08\u5bf9\u5357\u6d77\u4e3e\u63aa\uff1a\u6211\u5fc5\u987b\u8ba9\u4eba\u6349\u6478\u4e0d\u900f', '\u201c\u7279\u6717\u666e\u4e3b\u4e49\u201d\u6210\u7f8e\u56fd\u793e\u4f1a\u65b0\u52a8\u8361\u6e90', '\u7f8e\u56fd\u5927\u9009\u7279\u6717\u666e\u60f9\u5b98\u53f8 \u5e0c\u62c9\u91cc\u7535\u90ae\u95e8\u6216\u6210\u70b8\u5f39', '\u7f8e\u56fd\u4e00\u90e8\u7535\u89c6\u526716\u5e74\u524d\u9884\u6d4b\u7279\u6717\u666e\u4f1a\u5f53\u603b\u7edf', '\u65e5\u5a92\uff1a\u7279\u6717\u666e\u4e0e\u957f\u671f\u4e0e\u4fc4\u7f57\u65af\u53ca\u671d\u9c9c\u4ea4\u597d', '\u7279\u6717\u666e\u201c\u5931\u8a00\u201d\u4e0d\u65ad \u652f\u6301\u7387\u53cd\u4e0a\u5347', '\u7279\u6717\u666e\u73b0\u8c61\u6298\u5c04\u771f\u5b9e\u7684\u7f8e\u56fd', '\u7f8e\u56fd\u5171\u548c\u515a\u915d\u917f\u201c\u767e\u65e5\u884c\u52a8\u201d\u963b\u51fb\u7279\u6717\u666e', '\u65e5\u5a92\uff1a\u5982\u679c\u7f8e\u56fd\u8bde\u751f\u7279\u6717\u666e\u653f\u6743 \u4e16\u754c\u5c06\u9677\u5165\u6df7\u4e71', '\u7279\u6717\u666e\u4e4b\u5b50\u6536\u5230\u6050\u5413\u4fe1 \u5a01\u80c1\u5176\u7236\u4eb2\u9000\u51fa\u7ade\u9009', '\u4fc4\u4e0d\u6ee1\u7279\u6717\u666e\u62ff\u666e\u4eac\u505a\u5e7f\u544a\uff1a\u5996\u9b54\u5316\u4fc4\u7f57\u65af', '\u7279\u6717\u666e\u5632\u8bbd\u5e0c\u62c9\u91cc\u666e\u4eac\u65e0\u8f9c\u8eba\u67aa', '\u7279\u6717\u666e\u9669\u4e9b\u88ab\u63a7\u717d\u52a8\u66b4\u529b\u7f6a', '\u7f8e\u524d\u8d22\u957f\uff1a\u7279\u6717\u666e\u5f53\u9009\u53ef\u80fd\u7ed9\u7f8e\u56fd\u5e26\u6765\u4e25\u91cd\u635f\u5bb3', '\u7279\u6717\u666e\u7ade\u9009\u83b7\u80dc\u5929\u73b0\u5f02\u8c61\uff1a\u540c\u540d\u5927\u697c\u906d\u95ea\u7535\u51fb\u4e2d', '\u7279\u6717\u666e\u6620\u5c04\u51fa\u7684\u201c\u7cdf\u7cd5\u7f8e\u56fd\u201d\u4e0d\u771f\u5b9e', '\u300a\u534e\u76db\u987f\u90ae\u62a5\u300b\u558a\u8bdd\u5171\u548c\u515a\uff1a\u5fc5\u987b\u62e6\u4e0b\u7279\u6717\u666e', '\u7f8e\u56fd\u5927\u9009\u521d\u9009\u7279\u6717\u666e\u8fde\u4e0b\u4e09\u57ce \u9c81\u6bd4\u5965\u9eef\u7136\u9000\u9009', '\u7279\u6717\u666e\u7ee7\u7eed\u201c\u95fb\u7740\u81ed\u5403\u7740\u9999\u201d\u4f20\u5947', '\u4e2d\u56fd\u9a6c\u6876\u54c1\u724c\u649e\u540d\u7279\u6717\u666e \u7f8e\u5a92:\u90fd\u7231\u5439\u725b', '\u7279\u6717\u666e\u53c8\u8d62\u4e86 \u4ed6\u5f53\u603b\u7edf\u7684\u53ef\u80fd\u6027\u6709\u591a\u5927\uff1f', '\u767d\u5bab\u53d1\u8a00\u4eba\uff1a\u5965\u5df4\u9a6c\u6709\u4fe1\u5fc3\u7279\u6717\u666e\u4e0d\u4f1a\u5f53\u9009\u603b\u7edf', '\u5927\u516c\u62a5\uff1a\u5e0c\u62c9\u91cc\u4e3a\u4f55\u8f93\u6389\u5bc6\u6b47\u6839\u5dde\uff1f', '\u7f8e\u56fd\u9752\u5e74\u7ec4\u7ec7\u793a\u5a01\u53cd\u7279\u6717\u666e \u6253\u51fa\u6bdb\u4e3b\u5e2d\u8bed\u5f55(\u56fe)', '\u7279\u6717\u666e\u652f\u6301\u8005\u5230\u5e95\u662f\u8c01\uff1f', '\u6c1b\u56f4\u592a\u201c\u706b\u7206\u201d \u7279\u6717\u666e\u9020\u52bf\u96c6\u4f1a\u9669\u9047\u88ad', '\u75af\u72c2\u52a8\u7269\u57ce\u201d\u662f\u5728\u7ed9\u7279\u6717\u666e\u6572\u8b66\u949f\uff1f', '\u65e5\u5a92\uff1a\u7279\u6717\u666e\u5bf9\u4e2d\u65e5\u9884\u793a\u7740\u51f6\u5146 \u65e5\u6216\u88ab\u903c\u53c2\u6218', '\u7279\u6717\u666e\uff0c\u5f04\u5047\u6210\u771f\u7684\u6c11\u7cb9\u4e3b\u4e49\u5076\u50cf', '\u7279\u6717\u666e\u5728\u5171\u548c\u515a\u4e24\u5dde\u521d\u9009\u4e2d\u4e0d\u654c\u5bf9\u624b', '\u7279\u6717\u666e\u7ade\u9009\u96c6\u4f1a\u56e0\u6597\u6bb4\u53d6\u6d88', '\u7279\u6717\u666e\u4e0e\u5e0c\u62c9\u91cc\uff1a\u4ece\u76df\u53cb\u5230\u5bbf\u654c', '\u7279\u6717\u666e\u7ade\u9009\u96c6\u4f1a\u73b0\u66b4\u529b\u4e8b\u4ef6 78\u5c81\u8001\u7fc1\u62f3\u51fb\u6297\u8bae\u8005', '\u7279\u6717\u666e\u652f\u6301\u8005\u5f3a\u8feb\u5ba0\u7269\u72d7\u4e00\u8d77\u201c\u4e3e\u624b\u201d\u5ba3\u8a93\u652f\u6301', '\u56fd\u5916\u5973\u7f51\u7ea2\u7528\u80f8\u90e8\u5f53\u7b14\u753b\u7279\u6717\u666e\u8096\u50cf\u7b79\u6b3e', '\u7279\u6717\u666e\u8d62\u5f97\u5bc6\u6b47\u6839\u5dde\u548c\u5bc6\u897f\u897f\u6bd4\u5dde\u5171\u548c\u515a\u521d\u9009', '\u58a8\u897f\u54e5\u603b\u7edf\uff1a\u7279\u6717\u666e\u8a00\u8bba\u582a\u6bd4\u5e0c\u7279\u52d2\u548c\u58a8\u7d22\u91cc\u5c3c', '\u7279\u6717\u666e\u5f00\u53d1\u516c\u5bd3\u4f4f\u6ee1\u4e2d\u56fd\u5bcc\u8c6a \u56de\u5e94\u79f0\u672a\u53c2\u4e0e\u878d\u8d44', '\u7279\u6717\u666e\u906d\u515a\u5185\u8054\u624b\u963b\u51fb \u5171\u548c\u515a\u5143\u8001\u70ae\u8f70\u5176\u4e3a\u9a97\u5b50', '\u53e3\u6c34\u4ed7\u5347\u7ea7\uff1a\u7f57\u59c6\u5c3c\u75db\u6279\u7279\u6717\u666e\u865a\u4f2a \u7279\u6717\u666e\u56de\u51fb', '\u7f8e\u56fd\u5171\u548c\u515a\u5927\u4f6c\u963b\u51fb\u7279\u6717\u666e:\u63d0\u540d\u4ed6\u5371\u53ca\u56fd\u5bb6\u5b89\u5168', '\u7279\u6717\u666e\u59bb\u5b50\u8c08\u6210\u4e3a\u7b2c\u4e00\u592b\u4eba:\u5df2\u5f00\u59cb\u4e3a\u4ee5\u540e\u505a\u51c6\u5907', '\u7f8e\u5a92\uff1a\u4e2d\u56fd\u7f51\u6c11\u5632\u7b11\u7279\u6717\u666e\uff0c\u4f46\u66f4\u62c5\u5fc3\u5e0c\u62c9\u91cc', '\u7279\u6717\u666e\u521d\u9009\u83b7\u80dc \u7f8e\u6c11\u4f17\u7eb7\u7eb7\u641c\u7d22\u5982\u4f55\u79fb\u5c45\u52a0\u62ff\u5927', '\u7279\u6717\u666e\u5927\u80dc\uff1f\u5e0c\u62c9\u91cc\u7b11\u4e86\u2026\u2026', '\u5e0c\u62c9\u91cc\u3001\u7279\u6717\u666e \u6a2a\u626b\u201c\u8d85\u7ea7\u661f\u671f\u4e8c\u201d', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u6a2a\u626b\u8d85\u7ea7\u661f\u671f\u4e8c \u5e0c\u62c9\u91cc\u57fa\u672c\u83b7\u63d0\u540d', '\u767d\u5bab\u4e4b\u8def\uff1a\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u9886\u5148', '\u591a\u5143\u900f\u89c6\u201c\u8d85\u7ea7\u661f\u671f\u4e8c\u201d\u6700\u5927\u7968\u4ed3 \u514b\u9c81\u5179\u5e0c\u62c9\u91cc\u8d62\u5f97\u5dde\u521d\u9009', '\u7279\u6717\u666e\u53c8\u8d62\u4e86 \u5230\u5e95\u54ea\u4e9b\u4eba\u5728\u652f\u6301\u4ed6\uff1f', '\u4e13\u7a3f\uff1a\u7f8e\u56fd\u5927\u9009\u201c\u8d85\u7ea7\u661f\u671f\u4e8c\u201d\u843d\u5e55 \u7279\u6717\u666e\u5927\u80dc', '\u201c\u8d85\u7ea7\u661f\u671f\u4e8c\u201d\u5b9a\u80dc\u8d1f\u5728\u5373\u7279\u6717\u666e\u600e\u4e48\u8fd8\u5728\u9886\u8dd1\uff1f', '\u8d85\u7ea7\u661f\u671f\u4e8c\u201c\u89c2\u6218\u201d\u6307\u5357\uff1a\u7279\u6717\u666e\u6216\u5c06\u5927\u80dc', '\u7f8e\u5171\u548c\u515a\u6367\u9c81\u6bd4\u5965\u963b\u7279\u6717\u666e', '\u7f8e\u5171\u548c\u515a\u963b\u51fb\u201c\u9ed1\u9a6c\u201d\u7279\u6717\u666e \u62c5\u5fe7\u5927\u9009\u5931\u63a7', '\u7f8e\u56fd\u53c2\u8bae\u9662\u5171\u548c\u515a\u515a\u97ad\u5bf9\u7279\u6717\u666e\u53ef\u80fd\u6210\u4e3a\u5927\u9009\u5019\u9009\u4eba\u8868\u793a\u62c5\u5fe7', '\u7f8e\u56fd\u4e09K\u515a\u5927\u4f6c\u652f\u6301\u7279\u6717\u666e\u7ade\u9009 \u7279\u6717\u666e\u79f0\u4e0d\u63a5\u53d7', '\u7279\u6717\u666e\u6700\u8fd1\u53c8\u5e72\u4e86\u5565\u4e0d\u62db\u4eba\u5f85\u89c1\u7684\u4e8b\u513f\uff1f', '\u5357\u5361\u5dde\u521d\u9009\uff1a\u5e0c\u62c9\u91cc\u5927\u80dc', '\u524d\u4e2d\u60c5\u5c40\u957f\uff1a\u7279\u6717\u666e\u82e5\u5f53\u603b\u7edf\u519b\u961f\u4f1a\u66b4\u4e71', '\u7279\u6717\u666e\u5e0c\u62c9\u91cc\u8c01\u662f\u5927\u8d62\u5bb6\uff1f', '\u7279\u6717\u666e\u7ade\u9009\u8fde\u83b7\u4e24\u4f4d\u5dde\u957f\u652f\u6301', '\u5e0c\u62c9\u91cc\u8d62\u5f97\u5357\u5361\u5dde\u521d\u9009', '\u6ca1\u6234\u5047\u53d1\uff01\u7279\u6717\u666e\u53d1\u578b\u5927\u89e3\u5bc6:\u7792\u5929\u8fc7\u6d77\u7ed3\u6784\u590d\u6742', 'CNN\u7f51\u7ad9\u9996\u9875\u6279\u7279\u6717\u666e\uff1a\u5634\u8138\u8fd9\u4e48\u4e11\u600e\u914d\u5f53\u603b\u7edf', '\u8521\u82f1\u6587\u9001\u4e09\u53ea\u5c0f\u732a\u56fe\u7ed9\u5e0c\u62c9\u91cc\uff1a\u795d\u4f60\u8d62(\u56fe)', '\u7279\u6717\u666e\u5728\u5185\u534e\u8fbe\u5dde\u515a\u5185\u521d\u9009\u4e2d\u80dc\u51fa \u5df2\u8fde\u4e0b3\u57ce', '\u4e16\u754c\u65e5\u62a5\uff1a\u83b7\u5f97\u4e00\u5f20A\u724c \u5e0c\u62c9\u91cc\u5f62\u52bf\u7ffb\u8f6c\u88ab\u770b\u597d', '\u7279\u6717\u666e\u9886\u5148\u5171\u548c\u515a\u5185\u534e\u8fbe\u5dde\u6c11\u8c03', '\u4e2d\u82f1\uff1a\u300a\u6743\u529b\u7684\u6e38\u620f\u300b\u795e\u526a\u8f91 \u5ddd\u666e\u5c06\u81f3[doge]', '\u5171\u548c\u515a\u8fd9\u8fb9 \u7279\u6717\u666e\u98ce\u5934\u6700\u52b2', '\u6c11\u4e3b\u515a\u8fd9\u8fb9 \u5e0c\u62c9\u91cc\u6682\u9886\u98ce\u9a9a', '\u5e0c\u62c9\u91cc\u548c\u7279\u6717\u666e\u8d62\u5f97\u7f8e\u5927\u9009\u5173\u952e\u5dde\u521d\u9009', '\u5965\u5df4\u9a6c\uff1a\u7279\u6717\u666e\u8a00\u8bba\u4ee4\u4eba\u4e0d\u5b89 \u7f8e\u56fd\u4eba\u4e0d\u4f1a\u9009\u4ed6', '\u7f8e\u603b\u7edf\u7ade\u9009\u4eba\u5e0c\u62c9\u91cc\u6f14\u8bb2\u65f6\u5b66\u72d7\u53eb', '\u524d\u7f8e\u56fd\u963f\u80af\u8272\u5dde\u5c0f\u59d0\u7206\u6599\uff1a\u514b\u6797\u987f\u5e8a\u4e0a\u529f\u592b\u4e00\u822c \u5e0c\u62c9\u91cc\u662f\u540c\u6027\u604b', '\u524d\u9009\u7f8e\u5c0f\u59d0\uff1a\u514b\u6797\u987f\u5e8a\u6280\u4e00\u822c \u5e0c\u62c9\u91cc\u540c\u6027\u604b\u5438\u6bd2', '\u7279\u6717\u666e\uff0c\u64cd\u7eb5\u6c11\u610f\u7684\u5929\u624d', '\u7279\u6717\u666e\u545b\u6770\u5e03\xb7\u5e03\u4ec0\u201c\u8be5\u8ba9\u4f60\u5988\u6765\u7ade\u9009\u201d', '\u7279\u6717\u666e\uff1a\u7f8e\u56fd\u53d1\u52a8\u4f0a\u62c9\u514b\u6218\u4e89\u7834\u574f\u4e86\u4e2d\u4e1c\u7a33\u5b9a', '\u5965\u5df4\u9a6c\u627f\u8ba4\u6ca1\u6709\u80fd\u529b\u5f25\u5408\u4e24\u515a\u5bbf\u6028 \u4e0d\u6ee1\u7279\u6717\u666e', 'CNN\u8bf7\u98ce\u6c34\u5e08\u7b97\u5366 \u7279\u6717\u666e\u7334\u5e74\u5c06\u884c\u5927\u8fd0', '\u6851\u5fb7\u65af\u51fb\u8d25\u5e0c\u62c9\u91cc\u8d62\u5f97\u7f8e\u56fd\u5927\u9009\u521d\u9009\u65b0\u5dde\u7ad9', '\u7279\u6717\u666e\u83b7\u8bfa\u8d1d\u5c14\u548c\u5e73\u5956\u63d0\u540d \u5916\u5a92\u79f0\u96be\u4ee5\u7f6e\u4fe1', '\u7279\u6717\u666e\u56e0\u53cd\u534e\u8a00\u8bba\u83b7\u8bfa\u8d1d\u5c14\u548c\u5e73\u5956\u63d0\u540d', '\u8be6\u89e3\u5e0c\u62c9\u91cc\u9996\u6218\u9669\u80dc:\u771f\u7684\u662f\u9760\u201c\u63b7\u786c\u5e01\u201d\u5417', '\u5e0c\u62c9\u91cc\u201c\u8d4c\u795e\u201d\u9644\u4f53', '10\u53e5\u8bdd\u4e86\u89e3\u521d\u9009\u9996\u6218\u201c\u5403\u6389\u201d\u7279\u6717\u666e\u7684\u79d1\u9c81\u5179', '2016\u5e74\u7f8e\u56fd\u5927\u90092\u67081\u65e5\u5c55\u5f00 \u7279\u6717\u666e\u6700\u4e0d\u53d7\u6b22\u8fce', '\u7f8e\u56fd\u603b\u7edf\u5927\u9009\u201c\u9996\u6218\u201d\u7ed3\u679c\u63ed\u6653 \u5e0c\u62c9\u91cc\u548c\u514b\u9c81\u5179\u80dc\u51fa', '\u7279\u6717\u666e\u7684\u201c\u81ea\u604b\u201d\u548c\u7f8e\u56fd\u53f2\u4e0a\u6700\u81ea\u604b\u603b\u7edf', '\u5e0c\u62c9\u91cc\u9760\u629b\u786c\u5e01\u8d62\u5f97\u7f8e\u5927\u9009\u521d\u9009\u9996\u6218', '\u5e0c\u62c9\u91cc\u4ee5\u5fae\u5f31\u4f18\u52bf\u8d62\u5f97\u827e\u5965\u74e6\u5dde\u6c11\u4e3b\u515a\u9884\u9009', '\u7f8e\u603b\u7edf\u9884\u9009\u4eca\u5f00\u9523 \u300a\u7ebd\u7ea6\u65f6\u62a5\u300b\u518d\u6491\u5e0c\u62c9\u91cc', '\u5e0c\u62c9\u91cc\u7535\u90ae\u66dd\u7f8e\u66fe\u8981\u65e5\u672c\u201c\u8d2d\u5c9b\u201d\u524d\u4e0e\u4e2d\u56fd\u78cb\u5546', '\u7f8e\u603b\u7edf\u5927\u9009\u660e\u65e5\u5f00\u542f\u9996\u573a\u9884\u9009 \u5e0c\u62c9\u91cc\u518d\u9047\u90ae\u4ef6\u95e8', '\u5e0c\u62c9\u91cc\u7279\u6717\u666e\u9886\u8dd1\u5927\u9009\u4e24\u515a \u6216\u5c06\u51fa\u73b0\u53d8\u6570', '\u770b\u4e0d\u60ef\u4e3b\u6301\u4eba \u7279\u6717\u666e\u62d2\u7535\u89c6\u8fa9\u8bba', 'JK-\u7f57\u7433\u63a8\u7279\u70ae\u8f70\u7279\u6717\u666e \u6697\u8bbd\u5176\u56e2\u961f\u201c\u98df\u6b7b\u5f92\u201d', '\u7279\u6717\u666e\u79f0\u798f\u514b\u65af\u65b0\u95fb\u5bf9\u5176\u6709\u504f\u89c1 \u9000\u51fa\u7535\u89c6\u8fa9\u8bba\u4f1a', '\u7f8e\u56fd\u7537\u5b50\u901d\u4e16\u7559\u4e0b\u9057\u613f\uff1a\u4e0d\u8981\u6295\u7968\u7ed9\u7279\u6717\u666e', '\u7279\u6717\u666e:\u6211\u5728\u7ebd\u7ea6\u95f9\u5e02\u5411\u4eba\u5f00\u67aa\u4e5f\u65e0\u635f\u652f\u6301\u7387', '\u4f69\u6797\u652f\u6301\u7279\u6717\u666e\u4e89\u53d6\u7f8e\u5171\u548c\u515a\u603b\u7edf\u5019\u9009\u4eba\u63d0\u540d', '\u7279\u6717\u666e\u88ab\u66dd\u201c\u592a\u8ba4\u5e8a\u201d \u56db\u5904\u7ade\u9009\u5fc5\u56de\u7ebd\u7ea6\u8fc7\u591c', '\u514b\u6797\u987f\u5355\u72ec\u51fa\u9762\u4e3a\u5e0c\u62c9\u91cc\u62c9\u7968 \u7279\u6717\u666e\u9694\u7a7a\u62c6\u53f0', '\u5e0c\u62c9\u91cc\uff1a\u82e5\u5f53\u9009\u7f8e\u56fd\u603b\u7edf\u5c06\u516c\u5e03UFO\u771f\u76f8', '\u5e0c\u62c9\u91cc\u201c\u4e0a\u4f4d\u201d\u9ed8\u514b\u5c14\u201c\u4e0b\u53f0\u201d\uff1f', '\u7f8e\u56fd\u82b1\u8f66\u6e38\u884c\u7a7a\u4e2d\u73b0\u5927\u5b57\uff1a\u7279\u6717\u666e\u771f\u6076\u5fc3(\u56fe)', '\u6e2f\u5a92\uff1a\u7279\u6717\u666e\u628a\u4e2d\u56fd\u89c6\u4e3a\u9a97\u5b50 \u53cd\u534e\u53eb\u56a3\u4e0d\u5f97\u4eba\u5fc3', '\u7f8e\u7279\u52e4\u5c404\u540d\u4fdd\u62a4\u5e0c\u62c9\u91cc\u7279\u5de5\u56e0\u8f66\u7978\u53d7\u91cd\u4f24', '\u7279\u6717\u666e\u653e\u8c6a\u8a00\uff1a\u6bcf\u5468\u81f3\u5c11\u4e3a\u7ade\u9009\u5ba3\u4f20\u82b1200\u4e07\u7f8e\u5143', '\u7279\u6717\u666e\uff1a\u514b\u6797\u987f\u5916\u9047\u7eaa\u5f55\u4f1a\u62d6\u7d2f\u5e0c\u62c9\u91cc\u6210\u7f8e\u56fd\u53f2\u4e0a\u9996\u4f4d\u5973\u603b\u7edf', '\u4eca\u5e74\u73af\u7403\u9009\u7f8e\u201c\u8e22\u201d\u8d70\u7279\u6717\u666e', '\u7279\u6717\u666e\u5411\u5e0c\u62c9\u91cc\u8ba8\u8bf4\u6cd5', '\u4e13\u7a3f\uff1a\u666e\u4eac\u7279\u6717\u666e\u201c\u60fa\u60fa\u76f8\u60dc\u201d \u53d1\u751f\u4e86\u4ec0\u4e48\uff1f', '\u666e\u4eac\u9ad8\u5ea6\u8bc4\u4ef7\u7279\u6717\u666e\uff1a\u806a\u660e\u6709\u624d\u4eba\u683c\u51fa\u4f17', '\u9664\u4e86\u5510\u7eb3\u5fb7\uff1f\u7279\u6717\u666e \u8fd8\u6709\u54ea\u4e9b\u201c\u5927\u5634\u201d\u653f\u5ba2\u60f9\u7978\u4e0a\u8eab\uff1f', '\u9ed1\u5ba2\u7ec4\u7ec7\u201c\u533f\u540d\u8005\u201d\u62a8\u51fb\u7279\u6717\u666e\u79cd\u65cf\u8a00\u8bba', '\u6c99\u7279\u738b\u5b50\u4e0d\u6ee1\u7279\u6717\u666e\u53cd\u7a46\u65af\u6797\u8a00\u8bba:\u4ed6\u662f\u7f8e\u56fd\u4e4b\u803b', '\u7279\u6717\u666e\u79f0\u82f1\u56fd\u7a46\u65af\u6797\u52a0\u5165IS\u4eba\u6570\u8d85\u8fc7\u53c2\u519b(\u56fe)', '\u7279\u6717\u666e\u5927\u5634\u60f9\u5927\u7978', '\u201c\u5927\u5634\u201c\u7279\u6717\u666e\u6345\u4e86\u9a6c\u8702\u7a9d \u7279\u6717\u666e\u4f60\u53ef\u957f\u70b9\u5fc3\u5427', '\u7279\u6717\u666e\u81ea\u6bd4\u7f57\u65af\u798f', '\u7279\u6717\u666e\u53d1\u8868\u6d89\u7a46\u65af\u6797\u8a00\u8bba \u767d\u5bab\u65a5\u5176\u65e0\u8d44\u683c\u5f53\u603b\u7edf', '\u7279\u6717\u666e\u4eec\u8d8a\u6fc0\u8fdb\u8d8a\u53ef\u80fd\u6210\u5168IS', '\u7279\u6717\u666e\u53c8\u53d1\u6781\u7aef\u8a00\u8bba\uff0c\u88ab\u6279\u7cbe\u795e\u9519\u4e71', '\u4e13\u7a3f\uff1a\u53e3\u51fa\u72c2\u8a00\u7684\u7279\u6717\u666e\uff0c\u600e\u4e48\u5c31\u8fd9\u4e48\u9ad8\u652f\u6301\u7387\uff1f', '\u7279\u6717\u666e\u79f0\u4e0aCNN\u8fa9\u8bba\u6216\u8981500\u4e07\u7f8e\u5143\u51fa\u573a\u8d39', '\u5e0c\u62c9\u91cc\u79f0\u7f8e\u56fd\u4e0d\u5e94\u6d3e\u5730\u9762\u90e8\u961f\u6253\u51fbIS', '\u7f8e\u56fd\u65b0\u4e66\u7206\u6599\u5e0c\u62c9\u91cc\u66fe\u903c\u514b\u6797\u987f\u505a\u827e\u6ecb\u75c5\u68c0\u9a8c', '\u7279\u6717\u666e\u653b\u51fb\u7a46\u65af\u6797\u5632\u7b11\u6b8b\u969c \u6c11\u8c03\u652f\u6301\u7387\u9aa4\u964d12%', '\u7279\u6717\u666e\u79f0\u4eb2\u89c1\u65b0\u6cfd\u897f\u963f\u88d4\u4e3a\u201c911\u201d\u6b22\u547c \uff1a\u5927\u9519\u7279\u9519', '\u5e0c\u62c9\u91cc\u63d0\u51cf\u7a0e\u65b9\u6848\u8865\u8d34\u201c\u6276\u8001\u65cf\u201d\u4e2d\u4ea7\u9636\u7ea7', '\u6280\u672f\u8fdb\u6b65or\u793e\u4ea4\u5012\u9000\uff1f', '\u7279\u6717\u666e\u6c11\u8c03\u9886\u5148\u62c9\u5927 \u4e3b\u5f20\u7f8e\u56fd\u6c11\u4f17\u643a\u67aa\u6297\u51fb\u6050\u88ad', '\u5e0c\u62c9\u91cc\u8fa9\u8bba\u7528911\u505a\u201c\u6321\u7bad\u724c\u201d \u88ab\u6307\u8f93\u4e8e\u6851\u5fb7\u65af(\u56fe)', '\u5e0c\u62c9\u91cc\u8c08\u5df4\u9ece\u6050\u88ad\u4e8b\u4ef6\uff1a\u5fc5\u987b\u6253\u8d25IS', '\u7f8e\u56fd\u6c11\u4e3b\u515a\u603b\u7edf\u5019\u9009\u4eba\u521d\u9009 \u5e0c\u62c9\u91cc\u652f\u6301\u7387\u4ecd\u9886\u5148', '\u5965\u5df4\u9a6c\u79f0\u7279\u6717\u666e\u5927\u89c4\u6a21\u9a71\u9010\u975e\u6cd5\u79fb\u6c11\u7684\u8ba1\u5212\u4e0d\u73b0\u5b9e', '\u5e0c\u62c9\u91cc\u865a\u62a5\u8eab\u9ad87\u5e74\u201c\u957f\u201d7\u5398\u7c73', '\u661f\u5df4\u514b\u5723\u8bde\u676f\u5f15\u53d1\u5168\u7f8e\u5927\u8fa9\u8bba \u7279\u6717\u666e\u547c\u5401\u6c11\u4f17\u62b5\u5236', '\u661f\u5df4\u514b\u5723\u8bde\u7ea2\u676f\u88ab\u6559\u4f1a\u6279\u5ba3\u6218 \u906d\u7279\u6717\u666e\u62b5\u5236', '\u661f\u5df4\u514b\u7ea2\u8272\u5723\u8bde\u676f\u60f9\u4e89\u8bae \u5927\u5634\u201c\u7279\u6717\u666e\u201d\u547c\u5401\u62b5\u5236', '\u53c2\u9009\u7f8e\u603b\u7edf\u58f0\u52bf\u9ad8 \u7279\u6717\u666e\u548c\u5361\u68ee\u5c06\u83b7\u7279\u52e4\u5c40\u4fdd\u62a4', '\u7f8e\u5171\u548c\u515a\u7f3a\u5c11\u91cc\u6839\u5f0f\u5019\u9009\u4eba \u7279\u6717\u666e\u76f8\u5dee\u5341\u4e07\u516b\u5343\u91cc', '\u5e0c\u62c9\u91cc\u63a8\u65b0\u7ade\u9009\u5e7f\u544a\u547c\u5401\u63a7\u67aa \u6311\u6218\u7f8e\u62e5\u67aa\u6743\u56e2\u4f53', '\u7279\u6717\u666e\u524d\u59bb\u6279\u8bc4\u5176\u73b0\u4efb\u59bb\u5b50\u4e0d\u61c2\u653f\u6cbb\u793e\u4ea4', '\u201c\u6bb5\u5b50\u624b\u201d\u7279\u6717\u666e\u7ec8\u4e8e\u88ab\u8d85\u8d8a\u4e86 \u662f\u4f4d\u533b\u751f', '\u7279\u6717\u666e\u4e5f\u201c\u9760\u7239\u201d \u66fe\u83b7\u8001\u7238\u767e\u4e07\u7f8e\u5143\u63f4\u52a9 - \u4e2d\u6587\u56fd\u9645 - \u4e2d\u56fd\u65e5\u62a5\u7f51', '\u95ee\u9f0e\u767d\u5bab\u4e4b\u65c5 \u6bd4\u5c14\xb7\u514b\u6797\u987f\u80fd\u5426\u52a9\u529b\u5e0c\u62c9\u91cc\uff1f', '\u7f8e\u56fd\u300a\u798f\u5e03\u65af\u300b\u6742\u5fd7 \u7279\u6717\u666e\u7684\u8eab\u5bb6', '\u65b0\u6d6a\u76f4\u51fb\u5e0c\u62c9\u91cc\u7ade\u9009\u73b0\u573a\uff1a\u7537\u5973\u5e73\u6743\u634d\u536b\u8005', '\u5927\u9009\u6216\u6210\u5e0c\u62c9\u91cc\u5bf9\u51b3\u7279\u6717\u666e', '\u5e0c\u62c9\u91cc\u51fa\u5e2d\u73ed\u52a0\u897f\u88ad\u51fb\u4e8b\u4ef6\u542c\u8bc1\u4f1a \u4e3a\u81ea\u5df1\u8fa9\u62a4(\u56fe)', '\u5e0c\u62c9\u91cc\u56fd\u4f1a\u542c\u8bc1\u4f1a\u8fde\u621811\u5c0f\u65f6 \u4e00\u5ea6\u5206\u5fc3\u62d2\u4f11\u606f', '\u65b0\u6d6a\u76f4\u51fb\uff1a\u5e0c\u62c9\u91cc\u5982\u4f55\u5e94\u5bf9\u56fd\u4f1a11\u4e2a\u5c0f\u65f6\u7684\u201c\u62f7\u95ee\u201d\uff1f', '\u6fb3\u524d\u5973\u603b\u7406\u88ab\u8d5e\u201c\u56fd\u9645\u5de8\u661f\u201d \u5e0c\u62c9\u91cc\u9080\u5176\u5f55\u7ade\u9009\u5e7f\u544a', '\u4e13\u7a3f\uff1a\u62dc\u767b\u653e\u5f032016\u5e74\u5927\u9009 \u5e0c\u62c9\u91cc\u66f4\u8fdb\u4e00\u6b65', '\u7f8e\u56fd\u5171\u548c\u515a\u591a\u4eba\u7b56\u5212\u6b32\u5c06\u7279\u6717\u666e\u62c9\u4e0b\u9a6c', '\u5e0c\u62c9\u91cc\u642d\u6863\u6731\u5229\u5b89\xb7\u5361\u65af\u7279\u7f57\u6210\u70ed\u95e8 - \u4e2d\u6587\u56fd\u9645 - \u4e2d\u56fd\u65e5\u62a5\u7f51', '\u5e0c\u62c9\u91cc\u4e00\u6311\u56db \u7279\u6717\u666e\u5410\u69fd\u62a2\u5934\u6761', '\u4e13\u7a3f\uff1a\u5e0c\u62c9\u91cc\u820c\u6218\u7fa4\u96c4\uff0c\u8c01\u662f\u8d62\u5bb6\uff1f', '\u7279\u6717\u666e\u515a\u5185\u652f\u6301\u7387\u4ecd\u9ad8\u5c45\u7b2c\u4e00 \u5c06\u518d\u5ea6\u4e3b\u6301\u559c\u5267\u79c0', '\u5965\u5df4\u9a6c\uff1a\u7279\u6717\u666e\u5f53\u4e0d\u4e86\u7f8e\u56fd\u603b\u7edf', '\u5965\u5df4\u9a6c\u516c\u5f00\u66ff\u5e0c\u62c9\u91cc\u201c\u6491\u8170\u201d', '\u5e0c\u62c9\u91cc\u518d\u6279\u7279\u6717\u666e\u79fb\u6c11\u653f\u7b56 \u5728\u5bf9\u65b9\u201c\u5bb6\u95e8\u524d\u201d\u6f14\u8bb2', '\u514b\u6797\u987f\u5e0c\u62c9\u91cc\u7ed3\u5a5a40\u5468\u5e74\u53d1\u56fe\u79c0\u6069\u7231 \u79f0\u72b9\u5982\u6628\u5929', '\u5e0c\u62c9\u91cc\u5e86\u5a5a40\u5468\u5e74 \u514b\u6797\u987f\u524d\u60c5\u5987\uff1a\u63e1\u6709\u66f4\u591a\u672a\u516c\u5f00\u4eb2\u5bc6\u8bc1\u636e - \u4e2d\u6587\u56fd\u9645 - \u4e2d\u56fd\u65e5\u62a5\u7f51', '\u7f8e\u56fd\u5927\u9009\uff1a\u7279\u6717\u666e\u5c55\u5f00\u7b2c\u4e8c\u9636\u6bb5\u653b\u52bf \u59bb\u5973\u4e0a\u9635\u52a9\u9009 - \u4e2d\u6587\u56fd\u9645 - \u4e2d\u56fd\u65e5\u62a5\u7f51', '\u5e0c\u62c9\u91cc\u516c\u5f00\u8868\u6001\u4e0d\u652f\u6301TPP\u534f\u5b9a', '\u5e0c\u62c9\u91cc\u7535\u90ae\u89e3\u5bc6 \u66dd\u5149\u5e03\u83b1\u5c14\u66fe\u63d0\u9192\u5361\u624e\u83f2\u907f\u7978', '\u5e0c\u62c9\u91cc\u88ab\u66dd\u4e3a\u603b\u7edf\u9009\u4e3e\u8fdb\u884c\u9762\u90e8\u62c9\u76ae\u624b\u672f', '\u5e0c\u62c9\u91cc\u8fd9\u6b21\u4f60\u9a82\u4e2d\u56fd\uff0c\u6211\u8d75\u65e5\u5929\u771f\u7684\u4e0d\u670d', '\u4e2d\u65b9\u56de\u5e94\u5e0c\u62c9\u91cc\u6279\u8bc4\uff1a\u5973\u6743\u4eba\u58eb\u88ab\u6293\u56e0\u8fdd\u6cd5', '\u5e0c\u62c9\u91cc\u53d1\u63a8\u6587\u65a5\u8d23\u751f\u7269\u5236\u836f\u4f01\u4e1a\u54c4\u62ac\u836f\u4ef7 \u751f\u7269\u79d1\u6280\u80a1\u5e94\u58f0\u4e0b\u8dcc', '\u5e0c\u62c9\u91cc\u4e3a\u7ade\u9009\u4e5f\u662f\u62fc\u4e86', '\u5e0c\u62c9\u91cc\u53c2\u52a0\u8131\u53e3\u79c0\u8282\u76ee \u5410\u69fd\u7279\u6717\u666e\u5934\u53d1\u4f3c\u96ea\u7cd5', '\u5e0c\u62c9\u91cc\u5206\u4eab\u5927\u91cf\u5e74\u8f7b\u65f6\u751f\u6d3b\u7167\u53d1\u8d77\u5ba3\u4f20\u653b\u52bf(\u56fe)', '\u7279\u6717\u666e\u56e0\u4e71\u8bf4\u8bdd\u4e22\u4e3b\u6301\u4eba\u5de5\u4f5c \u65bd\u74e6\u8f9b\u683c\u63a5\u73ed(\u56fe)', '\u7279\u6717\u666e\u9886\u5148\u51ed\u4ec0\u4e48\uff1f', '\u7279\u6717\u666e\u516c\u5f00\u65a5\u5965\u5df4\u9a6c\u201c\u65e0\u80fd\u201d', '\u5e0c\u62c9\u91cc\u5c31\u90ae\u4ef6\u98ce\u6ce2\u81f4\u6b49\uff1a\u5bf9\u6b64\u8d1f\u8d23 \u5e94\u5c3d\u53ef\u80fd\u5766\u7387', '\u201c\u7279\u6717\u666e\u73b0\u8c61\u201d\u9762\u9762\u89c2', '\u5e0c\u62c9\u91cc\u6df1\u53d7\u201c\u90ae\u4ef6\u95e8\u201d\u62d6\u7d2f \u6c11\u8c03\u4e0b\u6ed1\u9009\u60c5\u4f4e\u8ff7', '\u7279\u6717\u666e\u4e0a\u8282\u76ee\u7b54\u975e\u6240\u95ee \u6012\u6279\u4e3b\u6301\u4eba\u6709\u610f\u5201\u96be', '\u7f8e\u56fd\u6c11\u4f17\u5bf9\u5e0c\u62c9\u91cc\u597d\u611f\u5ea6\u964d\u81f323\u5e74\u6765\u6700\u4f4e', '\u65af\u8bfa\u767b\uff1a\u5e0c\u62c9\u91cc\u8ba4\u4e3a\u4e2a\u4eba\u7535\u90ae\u5b89\u5168\u7684\u60f3\u6cd5\u592a\u8352\u8c2c', '\u201c\u5973\u52a9\u624b\u548c\u5e0c\u62c9\u91cc\u4e00\u4e2a\u5fb7\u884c\u201d', '\u7f8e\u56fd\u620f\u5267\u6f14\u5458\u53bb\u4e16 \u9057\u8a00\u8981\u6c42\u4e0d\u8981\u6295\u7968\u7ed9\u5e0c\u62c9\u91cc', '\u6c11\u8c03\u79f0\u7279\u6717\u666e\u652f\u6301\u7387\u7d27\u8ffd\u5e0c\u62c9\u91cc', '\u7279\u6717\u666e\uff1a\u82e5\u5f53\u9009\u7f8e\u603b\u7edf\u5c06\u9063\u8fd4\u6240\u6709\u975e\u6cd5\u79fb\u6c11', '\u5e0c\u62c9\u91cc\u820c\u6218\u6770\u5e03\u5e03\u4ec0\u5426\u8ba4\u66fe\u52a9\u957fIS\u5174\u8d77', '\u201c\u5927\u5634\u5df4\u201d\u7279\u6717\u666e\u70ae\u8f70\u5e0c\u62c9\u91cc \u6279\u201c\u90ae\u4ef6\u95e8\u201d\u4e8b\u4ef6', '\u7279\u6717\u666e\u7684\u7ade\u9009\u201c\u738b\u724c\u201d', '\u5e0c\u62c9\u91cc\u7231\u8377\u534e\u5dde\u7ade\u9009 \u548c\u201c\u5c0f\u725b\u4ed4\u201d\u4e92\u52a8\u79c0\u4eb2\u6c11(\u9ad8\u6e05\u7ec4\u56fe)', '\u7f8e\u56fd\u5171\u548c\u515a\u521d\u9009\u8fa9\u8bba\uff1a\u53c2\u9009\u4eba\u9f50\u8f70\u5e0c\u62c9\u91cc', '\u7279\u6717\u666e\u5165\u56f4\u7f8e\u56fd\u5171\u548c\u515a\u9996\u573a\u7535\u89c6\u8fa9\u8bba\u8d5b', '\u7279\u6717\u666e\u88ab\u7591\u5e0c\u62c9\u91cc\u5978\u7ec6 \u548c\u514b\u6797\u987f\u5bb6\u5173\u7cfb\u94c1(\u56fe)', '\u533b\u751f\u786e\u8ba4\u5e0c\u62c9\u91cc\u8eab\u4f53\u72b6\u51b5\u826f\u597d\uff1a\u9002\u5408\u5f53\u603b\u7edf', '\u5e0c\u62c9\u91cc\u505a600\u7f8e\u5143\u53d1\u578b\u8ba9\u7f8e\u53d1\u5385\u6574\u5c42\u505c\u4e1a\u88ab\u6279', '\u7f8e\u8bb0\u8005\u66dd\u5e0c\u62c9\u91cc\u548c\u514b\u6797\u987f\u662f\u5f62\u5a5a:\u4e3a\u4e86\u7ade\u9009\u79c0\u6069\u7231', '\u7f8e\u6c11\u8c03:\u7279\u6717\u666e\u652f\u6301\u7387\u98d9\u5347 \u5927\u5e45\u9886\u5148\u6770\u5e03-\u5e03\u4ec0', '\u7f8e\u56fd\u53f8\u6cd5\u90e8\u88ab\u8981\u6c42\u8c03\u67e5\u5e0c\u62c9\u91cc\u201c\u90ae\u4ef6\u95e8\u201d\u4e8b\u4ef6', '\u58a8\u897f\u54e5\u88d4\u59bb\u5b50\u906d\u7279\u6717\u666e\u8a00\u8bba\u653b\u51fb \u6770\u5e03\xb7\u5e03\u4ec0\u55e4\u4e4b\u4ee5\u9f3b - \u4e2d\u6587\u56fd\u9645 - \u4e2d\u56fd\u65e5\u62a5\u7f51', '\u5e0c\u62c9\u91cc\u5984\u79f0\u4e2d\u56fd\u9ed1\u5ba2\u5165\u4fb5\u7f8e\u56fd\u4e00\u5207\u4e0d\u80fd\u52a8\u7684\u4e1c\u897f', '\u5e0c\u62c9\u91cc\u7f51\u4e0a\u9f13\u52b1\u540c\u6027\u604b\u7537\u5b69\uff1a\u4f60\u7684\u672a\u6765\u5c06\u4f1a\u5f88\u68d2', '\u5e0c\u62c9\u91cc\u6307\u8d23\u4e2d\u56fd\u7a83\u53d6\u7f8e\u56fd\u673a\u5bc6 \u79f0\u5e94\u5bf9\u534e\u4fdd\u6301\u8b66\u60d5', '\u7279\u6717\u666e\u51e0\u6210\u201c\u5168\u6c11\u516c\u654c\u201d', '\u5e0c\u62c9\u91cc\u7535\u90ae\u66dd\u5149\uff1a\u5ff5\u5ff5\u4e0d\u5fd8\u4eba\u6c11\u5927\u4f1a\u5802\u5730\u6bef', '\u5e0c\u62c9\u91cc\u6f14\u8bb2\u5f00\u91d1\u53e3\u898127\u4e07\u7f8e\u5143 \u5927\u5b66\u6c42\u5176\u6b21\u8bf7\u5176\u5973']
